P_HTM[604]='*1-7. Paṭiccavārādi*';
P_HTM[605]='*Paccayacatukkaṃ*';
P_HTM[606]='*Hetupaccayo*';
P_HTM[607]='*12. Hetuṃ hetusampayuttaṃ dhammaṃ paṭicca hetu hetusampayutto dhammo uppajjati hetupaccayā. Hetuṃ hetusampayuttaṃ dhammaṃ paṭicca nahetu hetusampayutto dhammo uppajjati hetupaccayā. Hetuṃ hetusampayuttaṃ dhammaṃ paṭicca hetu hetusampayutto ca nahetu hetusampayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[608]='*Nahetuṃ hetusampayuttaṃ dhammaṃ paṭicca nahetu hetusampayutto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[609]='*Hetuṃ hetusampayuttañca nahetuṃ hetusampayuttañca dhammaṃ paṭicca hetu hetusampayutto dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[610]='*13. Hetuyā  nava, ārammaṇe nava…pe… avigate nava. (Saṃkhittaṃ.)*';
P_HTM[611]='*14. Hetu  hetusampayutto dhammo hetussa hetusampayuttassa dhammassa hetupaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[612]='*Hetuyā tīṇi…pe… avigate nava. (Saṃkhittaṃ.)*';
P_HTM[613]='*(Yathā kusalattike pañhāvāraṃ, evaṃ vitthāretabbaṃ.)*';
P_HTM[614]='*15. Hetuṃ hetuvippayuttaṃ dhammaṃ paṭicca nahetu hetuvippayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[615]='*Nahetuṃ hetuvippayuttaṃ dhammaṃ paṭicca nahetu hetuvippayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[616]='*Hetuṃ  hetuvippayuttañca nahetuṃ hetuvippayuttañca dhammaṃ paṭicca nahetu hetuvippayutto dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[617]='*Hetuyā tīṇi, ārammaṇe ekaṃ…pe… avigate tīṇi.*';
