P_HTM[635]='*19. Nahetuṃ  sahetukaṃ dhammaṃ paṭicca nahetu sahetuko dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[636]='*Nahetuṃ  ahetukaṃ dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
