P_HTM[657]='*1-9. Hetuduka-sappaṭighadukaṃ*';
P_HTM[658]='*24. Nahetuṃ sappaṭighaṃ dhammaṃ paṭicca nahetu sappaṭigho dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[659]='*25. Hetuṃ appaṭighaṃ dhammaṃ paṭicca hetu appaṭigho dhammo uppajjati hetupaccayā. Hetuṃ appaṭighaṃ dhammaṃ paṭicca nahetu appaṭigho dhammo uppajjati hetupaccayā. Hetuṃ appaṭighaṃ dhammaṃ paṭicca hetu appaṭigho ca nahetu appaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[660]='*Nahetuṃ appaṭighaṃ dhammaṃ paṭicca nahetu appaṭigho dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[661]='*Hetuṃ  appaṭighañca nahetuṃ appaṭighañca dhammaṃ paṭicca hetu appaṭigho dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
