P_HTM[1316]='*69. Nasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkilesiko dhammo uppajjati hetupaccayā. Nasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkilesiko dhammo uppajjati hetupaccayā. Nasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkilesiko ca naasaṃkilesiko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1317]='*Naasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkilesiko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1318]='*Nasaṃkilesikañca  naasaṃkilesikañca dhammaṃ paṭicca naasaṃkilesiko dhammo  uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1319]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha vitthāro.)*';
