P_HTM[1321]='*70. Nasaṃkiliṭṭhaṃ  dhammaṃ paṭicca nasaṃkiliṭṭho dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1322]='*Naasaṃkiliṭṭhaṃ dhammaṃ paṭicca naasaṃkiliṭṭho dhammo uppajjati hetupaccayā. Naasaṃkiliṭṭhaṃ dhammaṃ paṭicca nasaṃkiliṭṭho dhammo uppajjati hetupaccayā. Naasaṃkiliṭṭhaṃ dhammaṃ paṭicca nasaṃkiliṭṭho ca naasaṃkiliṭṭho ca dhammā uppajjanti hetupaccayā. (3)*';
