P_HTM[1445]='*Paccayacatukkaṃ*';
P_HTM[1446]='*Hetupaccayo*';
P_HTM[1447]='*1. Nahetuṃ  nakusalaṃ dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā – nahetuṃ akusalaṃ abyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ. Nahetuṃ nakusalaṃ dhammaṃ paṭicca nanahetuṃ nakusalo dhammo uppajjati hetupaccayā – nahetū akusale abyākate khandhe paṭicca hetū. Nahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1448]='*Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nanahetu nakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1449]='*Nahetuṃ  nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nanahetu nakusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1450]='*2. Hetuyā  nava…pe… avigate nava.*';
P_HTM[1451]='*Nahetuyā dve.*';
P_HTM[1452]='*(Sahajātavārepi…pe… sampayuttavārepi sabbattha vitthāro.)*';
P_HTM[1453]='*Hetu-ārammaṇapaccayā*';
P_HTM[1454]='*3. Nanahetu nakusalo dhammo nanahetussa nakusalassa dhammassa hetupaccayena paccayo. Nanahetu nakusalo dhammo nahetussa nakusalassa dhammassa hetupaccayena paccayo. Nanahetu nakusalo dhammo nahetussa nakusalassa ca nanahetussa nakusalassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1455]='*Nahetu nakusalo dhammo nahetussa nakusalassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[1456]='*4. Hetuyā tīṇi, ārammaṇe nava…pe… avigate nava. (Pañhāvāraṃ evaṃ vitthāretabbaṃ).*';
P_HTM[1457]='*5. Nahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā – nahetuṃ kusalaṃ abyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… dve khandhe…pe… nahetuṃ naakusalaṃ dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā – nahetū kusale abyākate khandhe paṭicca hetū. Nahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1458]='*Nanahetuṃ naakusalaṃ dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ  naakusalaṃ dhammaṃ paṭicca nahetu  naakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1459]='*Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā. Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ).*';
P_HTM[1460]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1461]='*6. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu naabyākato dhammo uppajjati hetupaccayā – kusalākusalaṃ nahetuṃ ekaṃ khandhaṃ paṭicca tayo khandhā, tayo khandhe paṭicca eko khandho. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu naabyākato ca nanahetu naabyākato ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1462]='*Nanahetuṃ naabyākataṃ dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1463]='*Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākatañca  nanahetuṃ naabyākatañca dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nahetu naabyākato ca nanahetu naabyākato ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1464]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1465]='*1-2 Hetuduka-vedanāttikaṃ*';
P_HTM[1466]='*7. Nahetuṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nanahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1467]='*Hetuyā nava. (Sabbattha nava.)*';
P_HTM[1468]='*8. Nahetuṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1469]='*Hetuyā nava. (Sabbattha nava.)*';
P_HTM[1470]='*9. Nahetuṃ  naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1471]='*Hetuyā nava. (Sabbattha nava.)*';
P_HTM[1472]='*1-3-9. Hetuduka-vipākādittikāni*';
P_HTM[1473]='*10. Nahetuṃ navipākaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1474]='*Nahetuṃ navipākadhammadhammaṃ  paṭicca…pe….*';
P_HTM[1475]='*Nahetuṃ nanevavipākanavipākadhammadhammaṃ paṭicca…pe….*';
P_HTM[1476]='*11. Nahetuṃ naupādinnupādāniyaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1477]='*Nahetuṃ naanupādinnupādāniyaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1478]='*Nahetuṃ naanupādinnaanupādāniyaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1479]='*12. Nahetuṃ nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1480]='*Nahetuṃ  naasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1481]='*Nahetuṃ naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1482]='*13. Nahetuṃ nasavitakkasavicāraṃ dhammaṃ paṭicca…pe….*';
P_HTM[1483]='*Nahetuṃ naavitakkavicāramattaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1484]='*Nahetuṃ naavitakkaavicāraṃ dhammaṃ paṭicca…pe….*';
P_HTM[1485]='*14. Nahetuṃ napītisahagataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1486]='*Nahetuṃ nasukhasahagataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1487]='*Nahetuṃ naupekkhāsahagataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1488]='*15. Nahetuṃ nadassanena pahātabbaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1489]='*Nahetuṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1490]='*Nahetuṃ nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1491]='*16. Nahetuṃ  nadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1492]='*Nahetuṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1493]='*Nahetuṃ nanevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1494]='*1-10-21. Hetuduka-ācayagāmādittikāni*';
P_HTM[1495]='*17. Nahetuṃ naācayagāmiṃ dhammaṃ paṭicca…pe….*';
P_HTM[1496]='*Nahetuṃ naapacayagāmiṃ dhammaṃ paṭicca…pe….*';
P_HTM[1497]='*Nahetuṃ nanevaācayagāmiṃ nāpacayagāmiṃ dhammaṃ paṭicca…pe….*';
P_HTM[1498]='*18. Nahetuṃ  nasekkhaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1499]='*Nahetuṃ naasekkhaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1500]='*Nahetuṃ nanevasekkhanāsekkhaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1501]='*19. Nahetuṃ naparittaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1502]='*Nahetuṃ namahaggataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1503]='*Nahetuṃ naappamāṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1504]='*20. Nahetuṃ naparittārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1505]='*Nahetuṃ namahaggatārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1506]='*Nahetuṃ naappamāṇārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1507]='*21. Nahetuṃ nahīnaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1508]='*Nahetuṃ namajjhimaṃ dhammaṃ paṭicca  …pe….*';
P_HTM[1509]='*Nahetuṃ napaṇītaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1510]='*22. Nahetuṃ namicchattaniyataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1511]='*Nahetuṃ nasammattaniyataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1512]='*Nahetuṃ naaniyataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1513]='*23. Nahetuṃ  namaggārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1514]='*Nahetuṃ namaggahetukaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1515]='*Nahetuṃ namaggādhipatiṃ dhammaṃ paṭicca…pe….*';
P_HTM[1516]='*24. Nahetuṃ  naanuppannaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1517]='*Nahetuṃ nauppādiṃ dhammaṃ paṭicca…pe….*';
P_HTM[1518]='*25. Nahetuṃ naatītaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1519]='*Nahetuṃ naanāgataṃ dhammaṃ paṭicca…pe….*';
P_HTM[1520]='*26. Nahetuṃ naatītārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1521]='*Nahetuṃ naanāgatārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1522]='*Nahetuṃ napaccuppannārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1523]='*27. Nahetuṃ naajjhattaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1524]='*Nahetuṃ nabahiddhā dhammaṃ paṭicca…pe….*';
P_HTM[1525]='*28. Nahetuṃ  naajjhattārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1526]='*Nahetuṃ nabahiddhārammaṇaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1527]='*1-22. Hetuduka-sanidassanattikaṃ*';
P_HTM[1528]='*1-7. Paṭiccavārādi*';
P_HTM[1529]='*Paccayacatukkaṃ*';
P_HTM[1530]='*Hetupaccayo*';
P_HTM[1531]='*29. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1532]='*Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo uppajjati  hetupaccayā. Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca  nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1533]='*Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo  uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1534]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1535]='*30. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1536]='*Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1537]='*Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca  dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1538]='*Hetuyā nava…pe… avigate nava. (Sahajātavārepi…pe… sampayuttavārepi sabbattha vitthāro.)*';
P_HTM[1539]='*Hetu-ārammaṇapaccayā*';
P_HTM[1540]='*31. Nanahetu  naanidassanasappaṭigho dhammo nanahetussa naanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Nanahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Nanahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa ca nanahetussa naanidassanasappaṭighassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1541]='*Nahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[1542]='*Hetuyā tīṇi, ārammaṇe nava…pe… upanissaye nava, purejāte pacchājāte tīṇi, āsevane nava, kamme tīṇi, vipāke nava, āhāre tīṇi, indriye nava, jhāne tīṇi, magge sampayutte nava, vippayutte pañca…pe… avigate nava. (Pañhāvāraṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[1543]='*32. Nahetuṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanaappaṭigho dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1544]='*Hetuyā ekaṃ. (Sabbattha vitthāro.)*';
P_HTM[1545]='*2-3-1. Sahetukadukādi-kusalattikaṃ*';
P_HTM[1546]='*33. Nasahetukaṃ  nakusalaṃ dhammaṃ paṭicca nasahetuko nakusalo dhammo uppajjati hetupaccayā  – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca cittasamuṭṭhānaṃ rūpaṃ, ekaṃ mahābhūtaṃ paṭicca tayo mahābhūtā…pe… dve mahābhūte…pe… nasahetukaṃ nakusalaṃ dhammaṃ paṭicca naahetuko nakusalo dhammo uppajjati hetupaccayā – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca sampayuttakā khandhā; paṭisandhikkhaṇe vatthuṃ paṭicca sahetukā khandhā. Nasahetukaṃ nakusalaṃ dhammaṃ paṭicca nasahetuko nakusalo ca naahetuko nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1547]='*Naahetukaṃ nakusalaṃ dhammaṃ paṭicca naahetuko nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1548]='*Nasahetukaṃ  nakusalañca naahetukaṃ nakusalañca dhammaṃ paṭicca nasahetuko nakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1549]='*Hetuyā nava.*';
P_HTM[1550]='*34. Nasahetukaṃ naakusalaṃ dhammaṃ paṭicca nasahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1551]='*Naahetukaṃ naakusalaṃ dhammaṃ paṭicca naahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1552]='*Nasahetukaṃ naakusalañca naahetukaṃ naakusalañca dhammaṃ paṭicca nasahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1553]='*Hetuyā nava.*';
P_HTM[1554]='*35. Nasahetukaṃ  naabyākataṃ dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1555]='*Naahetukaṃ naabyākataṃ dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1556]='*Nasahetukaṃ  naabyākatañca naahetukaṃ naabyākatañca dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1557]='*Hetuyā tīṇi.*';
P_HTM[1558]='*(Hetusampayuttadukaṃ sahetukadukasadisaṃ.)*';
P_HTM[1559]='*4-5-1. Hetusahetukadukādi-kusalattikaṃ*';
P_HTM[1560]='*36. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca naahetuko ceva nana ca hetu nakusalo dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo ca naahetuko ceva nana ca hetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1561]='*Naahetukañceva  nana ca hetuṃ nakusalaṃ dhammaṃ paṭicca naahetuko ceva nana ca hetu nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1562]='*Nahetuñceva naahetukañca nakusalañca naahetukañceva nana ca hetuṃ nakusalañca dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1563]='*Hetuyā  nava.*';
P_HTM[1564]='*37. Nahetuñceva naahetukañca naakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1565]='*Hetuyā nava.*';
P_HTM[1566]='*38. Nahetuñceva naahetukañca naabyākataṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naabyākato dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1567]='*Hetuyā nava.*';
P_HTM[1568]='*(Hetuhetusampayuttadukaṃ  hetusahetukadukasadisaṃ.)*';
P_HTM[1569]='*6-1. Nahetusahetukaduka-kusalattikaṃ*';
P_HTM[1570]='*39. Nahetuṃ nasahetukaṃ nakusalaṃ dhammaṃ paṭicca nahetu nasahetuko nakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1571]='*Hetuyā nava.*';
P_HTM[1572]='*40. Nahetuṃ nasahetukaṃ naakusalaṃ dhammaṃ paṭicca nahetu nasahetuko naakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1573]='*Hetuyā nava.*';
