P_HTM[1590]='*54. Nosaññojanaṃ  nakusalaṃ dhammaṃ paṭicca…pe… nanosaññojanaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1591]='*55. Noganthaṃ nakusalaṃ dhammaṃ paṭicca…pe… nooghaṃ…pe… noyogaṃ…pe… nonīvaraṇaṃ.*';
P_HTM[1592]='*Noparāmāsaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1593]='*55-1. Mahantaraduka-kusalattikaṃ*';
P_HTM[1594]='*56. Nasārammaṇaṃ  nakusalaṃ dhammaṃ paṭicca…pe… naanārammaṇaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1595]='*57. Nacittaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanocittaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1596]='*58. Nacetasikaṃ nakusalaṃ  dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1597]='*59. Nacittasampayuttaṃ nakusalaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1598]='*60. Nacittasaṃsaṭṭhaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1599]='*61. Nocittasamuṭṭhānaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1600]='*62. Nocittasahabhuṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1601]='*63. Nocittānuparivattiṃ nakusalaṃ dhammaṃ paṭicca…pe…. Nocittasaṃsaṭṭhasamuṭṭhānaṃ nakusalaṃ dhammaṃ paṭicca…pe… nocittasaṃsaṭṭhasamuṭṭhānasahabhuṃ nakusalaṃ dhammaṃ paṭicca…pe… nocittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1602]='*64. Naajjhattikaṃ nakusalaṃ dhammaṃ paṭicca…pe… nabāhiraṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1603]='*65. Naupādā nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1604]='*66. Naupādinnaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1605]='*69-74-1. Upādānagocchaka-kusalattikaṃ*';
P_HTM[1606]='*67. Noupādānaṃ  nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1607]='*75-82-1. Kilesagocchaka-kusalattikaṃ*';
P_HTM[1608]='*68. Nokilesaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanokilesaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1609]='*69. Nasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1610]='*70. Nasaṃkiliṭṭhaṃ  nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1611]='*71. Nakilesasampayuttaṃ nakusalaṃ dhammaṃ paṭicca…pe… nakilesavippayuttaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1612]='*72. Nakilesañceva naasaṃkilesikañca nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkilesikañceva nano ca kilesaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1613]='*73. Nakilesañceva naasaṃkiliṭṭhañca nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhañceva  nano ca kilesaṃ nakusalaṃ dhammaṃ paṭicca…pe… nakilesañceva nakilesavippayuttañca nakusalaṃ dhammaṃ paṭicca…pe… nakilesavippayuttañceva nano ca kilesaṃ nakusalaṃ dhammaṃ paṭicca…pe… (sabbattha nava, vipākaṃ natthi).*';
P_HTM[1614]='*Kilesavippayuttaṃ nasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca…pe… kilesavippayuttaṃ naasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1615]='*83-1. Piṭṭhiduka-kusalattikaṃ*';
P_HTM[1616]='*74. Nadassanena pahātabbaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanadassanena pahātabbaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1617]='*75. Nabhāvanāya pahātabbaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanabhāvanāya pahātabbaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1618]='*76. Nadassanena  pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanadassanena pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanabhāvanāya pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1619]='*77. Nasavitakkaṃ nakusalaṃ dhammaṃ paṭicca…pe… naavitakkaṃ nakusalaṃ dhammaṃ paṭicca…pe… nasavicāraṃ nakusalaṃ dhammaṃ paṭicca…pe… naavicāraṃ nakusalaṃ dhammaṃ paṭicca…pe… nasappītikaṃ nakusalaṃ dhammaṃ paṭicca…pe… naappītikaṃ nakusalaṃ dhammaṃ paṭicca …pe… napītisahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… nanapītisahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… nasukhasahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… nanasukhasahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… naupekkhāsahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… nanaupekkhāsahagataṃ nakusalaṃ dhammaṃ paṭicca ….*';
P_HTM[1620]='*78. Nakāmāvacaraṃ nakusalaṃ dhammaṃ paṭicca…pe… nanakāmāvacaraṃ nakusalaṃ dhammaṃ paṭicca…pe… narūpāvacaraṃ nakusalaṃ dhammaṃ paṭicca…pe… nanarūpāvacaraṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1621]='*79. Naarūpāvacaraṃ nakusalaṃ dhammaṃ paṭicca…pe… nanaarūpāvacaraṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1622]='*80. Napariyāpannaṃ nakusalaṃ dhammaṃ paṭicca…pe… naapariyāpannaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1623]='*81. Naniyyānikaṃ nakusalaṃ dhammaṃ paṭicca…pe… naaniyyānikaṃ nakusalaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ. Sabbattha ekaṃ.)*';
P_HTM[1624]='*Naniyataṃ nakusalaṃ dhammaṃ paṭicca…pe… naaniyataṃ nakusalaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1625]='*82. Nasauttaraṃ nakusalaṃ dhammaṃ paṭicca…pe… naanuttaraṃ nakusalaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1626]='*83. Nasaraṇaṃ nakusalaṃ dhammaṃ paṭicca nasaraṇo nakusalo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1627]='*Naaraṇaṃ  nakusalaṃ dhammaṃ paṭicca naaraṇo nakusalo dhammo uppajjati hetupaccayā. Naaraṇaṃ nakusalaṃ dhammaṃ paṭicca nasaraṇo nakusalo dhammo uppajjati hetupaccayā. Naaraṇaṃ nakusalaṃ dhammaṃ paṭicca nasaraṇo nakusalo ca naaraṇo nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1628]='*Nasaraṇaṃ nakusalañca naaraṇaṃ nakusalañca dhammaṃ paṭicca nasaraṇo nakusalo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1629]='*84. Nasaraṇaṃ  naakusalaṃ dhammaṃ paṭicca nasaraṇo naakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā  ekaṃ. (Sabbattha ekaṃ.)*';
P_HTM[1630]='*85. Nasaraṇaṃ naabyākataṃ dhammaṃ paṭicca nasaraṇo naabyākato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1631]='*Naaraṇaṃ naabyākataṃ dhammaṃ paṭicca naaraṇo naabyākato dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1632]='*Hetuyā dve, ārammaṇe dve…pe… avigate dve.*';
P_HTM[1633]='*(Sahajātavārepi…pe… pañhāvārepi sabbattha vitthāro.)*';
P_HTM[1634]='*100-2. Saraṇaduka-vedanādittikāni*';
