P_HTM[1636]='*Hetupaccayo*';
P_HTM[1637]='*86. Nasaraṇaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1638]='*87. Nasaraṇaṃ navipākaṃ dhammaṃ paṭicca….*';
P_HTM[1639]='*Nasaraṇaṃ navipākadhammadhammaṃ paṭicca….*';
P_HTM[1640]='*Nasaraṇaṃ nanevavipākanavipākadhammadhammaṃ paṭicca….*';
P_HTM[1641]='*88. Nasaraṇaṃ  naupādinnupādāniyaṃ dhammaṃ paṭicca….*';
P_HTM[1642]='*Nasaraṇaṃ naanupādinnupādāniyaṃ dhammaṃ paṭicca….*';
P_HTM[1643]='*Nasaraṇaṃ naanupādinnaanupādāniyaṃ dhammaṃ paṭicca….*';
P_HTM[1644]='*100-22. Saraṇaduka-sanidassanattikaṃ*';
P_HTM[1645]='*89. Nasaraṇaṃ  nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo nasanidassanasappaṭigho  dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1646]='*Naaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca naaraṇo nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo nasanidassanasappaṭigho ca naaraṇo nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1647]='*Nasaraṇaṃ nasanidassanasappaṭighañca naaraṇaṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nasaraṇo nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1648]='*Hetuyā pañca.*';
P_HTM[1649]='*90. Nasaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1650]='*Naaraṇaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca naaraṇo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naaraṇaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naaraṇaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanasappaṭigho  ca naaraṇo naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1651]='*Nasaraṇaṃ  naanidassanasappaṭighañca naaraṇaṃ naanidassanasappaṭighañca dhammaṃ paṭicca nasaraṇo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1652]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca.*';
P_HTM[1653]='*(Sahajātavārepi…pe… pañhāvārepi sabbattha vitthāretabbaṃ.)*';
P_HTM[1654]='*91. Nasaraṇaṃ  naanidassanaappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1655]='*Hetuyā ekaṃ. (Sabbattha vitthāro.)*';
P_HTM[1656]='*Dhammapaccanīye dukatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[1657]='*Dhammapaccanīye tikadukapaṭṭhānaṃ*';
