P_HTM[1659]='*1-7. Paṭiccavārādi*';
P_HTM[1660]='*Hetupaccayo*';
P_HTM[1661]='*1. Nakusalaṃ  nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo  nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1662]='*2. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1663]='*3. Naabyākataṃ  nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Cha.*';
P_HTM[1664]='*4. Nakusalaṃ  nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1665]='*5. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1666]='*6. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca nakusalo  nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1667]='*Hetuyā  ekūnatiṃsa, ārammaṇe catuvīsa…pe… avigate ekūnatiṃsa (sabbattha vitthāro).*';
P_HTM[1668]='*7. Nakusalaṃ  nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu ca naabyākato nanahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu ca naakusalo nanahetu ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1669]='*Naakusalaṃ nanahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1670]='*Naabyākataṃ nanahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1671]='*Nakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca nakusalo nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1672]='*Naakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
