P_HTM[1774]='*55. Nasaṃkiliṭṭhasaṃkilesikaṃ  nahetuṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhaasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca….*';
