P_HTM[1788]='*68. Naajjhattaṃ nahetuṃ dhammaṃ paṭicca…pe… nabahiddhā nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1789]='*Naajjhattārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… nabahiddhārammaṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1790]='*22-1-6. Sanidassanattika-hetvādidukāni*';
P_HTM[1791]='*69. Nasanidassanasappaṭighaṃ  nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati  hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1792]='*Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho  nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Naanidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1793]='*Naanidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1794]='*Nasanidassanasappaṭighaṃ nahetuñca naanidassanaappaṭighaṃ nahetuñca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1795]='*Nasanidassanasappaṭighaṃ nahetuñca naanidassanasappaṭighaṃ nahetuñca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā… cha. (Saṃkhittaṃ.)*';
P_HTM[1796]='*Hetuyā  tiṃsa, ārammaṇe nava. (Sabbattha vitthāro.)*';
P_HTM[1797]='*70. Nasanidassanasappaṭighaṃ nanahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanahetu dhammo uppajjati hetupaccayā… (nava).*';
P_HTM[1798]='*Nasanidassanasappaṭighaṃ  nasahetukaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1799]='*Nasanidassanasappaṭighaṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1800]='*71. Nasanidassanasappaṭighaṃ nahetusampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1801]='*Nasanidassanasappaṭighaṃ nahetuvippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1802]='*72. Nasanidassanasappaṭighaṃ nahetuñceva naahetukañca dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naahetukañceva nanahetuñca dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca….*';
P_HTM[1803]='*Nasanidassanasappaṭighaṃ nahetuvippayuttañceva nanahetuñca dhammaṃ paṭicca….*';
P_HTM[1804]='*Nasanidassanasappaṭighaṃ  nahetuṃ nasahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1805]='*Nasanidassanasappaṭighaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1806]='*22-7-13. Sanidassanattika-cūḷantaradukāni*';
P_HTM[1807]='*73. Nasanidassanasappaṭighaṃ naappaccayaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naasaṅkhataṃ dhammaṃ paṭicca….*';
P_HTM[1808]='*74. Nasanidassanasappaṭighaṃ nasanidassanaṃ  dhammaṃ paṭicca….*';
P_HTM[1809]='*75. Nasanidassanasappaṭighaṃ nasappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[1810]='*Nasanidassanasappaṭighaṃ naappaṭighaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1811]='*76. Nasanidassanasappaṭighaṃ  narūpiṃ dhammaṃ paṭicca… nasanidassanasappaṭighaṃ naarūpiṃ dhammaṃ paṭicca….*';
P_HTM[1812]='*77. Nasanidassanasappaṭighaṃ nalokiyaṃ dhammaṃ paṭicca….*';
P_HTM[1813]='*Nasanidassanasappaṭighaṃ nalokuttaraṃ dhammaṃ paṭicca….*';
P_HTM[1814]='*78. Nasanidassanasappaṭighaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca….*';
P_HTM[1815]='*22-14-54. Sanidassanattika-āsavādigocchakāni*';
P_HTM[1816]='*79. Nasanidassanasappaṭighaṃ noāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1817]='*80. Nasanidassanasappaṭighaṃ nosaññojanaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ noganthaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nooghaṃ dhammaṃ paṭicca…pe…. Nasanidassanasappaṭighaṃ noyogaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nonīvaraṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ noparāmāsaṃ dhammaṃ paṭicca….*';
P_HTM[1818]='*22-55-68. Sanidassanattika-mahantaradukāni*';
P_HTM[1819]='*81. Nasanidassanasappaṭighaṃ nasārammaṇaṃ dhammaṃ paṭicca….*';
P_HTM[1820]='*82. Nasanidassanasappaṭighaṃ  nacittaṃ dhammaṃ paṭicca…. (Nanocittapadaṃ na labbhati.)*';
P_HTM[1821]='*83. Nasanidassanasappaṭighaṃ nacetasikaṃ dhammaṃ paṭicca….*';
P_HTM[1822]='*84. Nasanidassanasappaṭighaṃ nacittasampayuttaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca….*';
P_HTM[1823]='*85. Nasanidassanasappaṭighaṃ nacittasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasahabhuṃ dhammaṃ  paṭicca…pe… nasanidassanasappaṭighaṃ nacittānuparivattiṃ dhammaṃ paṭicca …pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[1824]='*86. Nasanidassanasappaṭighaṃ naajjhattikaṃ dhammaṃ paṭicca….*';
P_HTM[1825]='*Nasanidassanasappaṭighaṃ nabāhiraṃ dhammaṃ paṭicca….*';
P_HTM[1826]='*87. Nasanidassanasappaṭighaṃ naupādā dhammaṃ paṭicca….*';
P_HTM[1827]='*88. Nasanidassanasappaṭighaṃ naupādinnaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naanupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[1828]='*22-69-82. Sanidassanattika-upādānādidukāni*';
P_HTM[1829]='*89. Nasanidassanasappaṭighaṃ noupādānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nokilesaṃ dhammaṃ paṭicca….*';
P_HTM[1830]='*22-83. Sanidassanattika-piṭṭhidukaṃ*';
P_HTM[1831]='*90. Nasanidassanasappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[1832]='*Hetuyā tiṃsa, ārammaṇe nava…pe… aññamaññe pañcavīsa…pe… avigate tiṃsa. (Piṭṭhidukaṃ vitthāretabbaṃ.)*';
P_HTM[1833]='*91. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ  paṭicca naanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaraṇo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1834]='*Naanidassanasappaṭighaṃ  nasaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho nasaraṇo  dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1835]='*Naanidassanaappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1836]='*Nasanidassanasappaṭighaṃ nasaraṇañca naanidassanaappaṭighaṃ nasaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1837]='*Nasanidassanasappaṭighaṃ nasaraṇañca naanidassanasappaṭighaṃ nasaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1838]='*Hetuyā tiṃsa, ārammaṇe nava…pe… avigate tiṃsa. (Sabbattha vitthāro.)*';
P_HTM[1839]='*92. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1840]='*93. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo dhammo  uppajjati hetupaccayā. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1841]='*94. Nasanidassanasappaṭighaṃ  naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca  nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1842]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sahajātavārepi paccayavārepi nissayavārepi saṃsaṭṭhavārepi sampayuttavārepi sabbattha nava.)*';
P_HTM[1843]='*Dhammapaccanīye tikadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[1844]='*Dhammapaccanīye tikatikapaṭṭhānaṃ*';
P_HTM[1845]='*1-1. Kusalattika-vedanāttikaṃ*';
P_HTM[1846]='*1-7. Paṭiccavārādi*';
P_HTM[1847]='*Hetupaccayo*';
P_HTM[1848]='*1. Nakusalaṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1849]='*2. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto  dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1850]='*3. Naabyākataṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1851]='*4. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya  vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya  sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1852]='*5. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1853]='*6. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1854]='*Hetuyā ekūnatiṃsa, ārammaṇe catuvīsa…pe… avigate ekūnatiṃsa. (Sahajātavārepi…pe… pañhāvārepi vitthāro.)*';
P_HTM[1855]='*Dukkhāyavedanāyasampayuttapadaṃ*';
P_HTM[1856]='*Hetupaccayo*';
P_HTM[1857]='*7. Nakusalaṃ  nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naabyākato nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naakusalo nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1858]='*Naakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1859]='*Naabyākataṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1860]='*Nakusalaṃ nadukkhāya vedanāya sampayuttañca naabyākataṃ nadukkhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… pañca.*';
