P_HTM[1938]='*39. Nasukhāya  vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1939]='*Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo  ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1940]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya  vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1941]='*40. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca  dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ  nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1942]='*Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā…pe… satta. (Saṃkhittaṃ.)*';
P_HTM[1943]='*Hetuyā ekūnapaññāsa, ārammaṇe ekūnapaññāsa…pe… avigate ekūnapaññāsa.*';
P_HTM[1944]='*41. Nasukhāya  vedanāya sampayuttaṃ naakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto naakusalo dhammo uppajjati hetupaccayā…. (Saṃkhittaṃ.) Hetuyā ekūnapaññāsa.*';
P_HTM[1945]='*42. Nasukhāya vedanāya sampayuttaṃ naabyākataṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto naabyākato dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā  aṭṭhacattālīsa. (Sabbattha vitthāro.)*';
P_HTM[1946]='*2-2. Vedanāttika-vipākattikaṃ*';
P_HTM[1947]='*43. Nasukhāya vedanāya sampayuttaṃ navipākaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto navipāko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1948]='*Hetuyā ekūnapaññāsa…pe… avigate ekūnapaññāsa. (Saṃkhittaṃ.)*';
P_HTM[1949]='*3-1. Vipākattika-kusalattikaṃ*';
P_HTM[1950]='*44. Navipākaṃ  nakusalaṃ dhammaṃ paṭicca…pe… navipākadhammadhammaṃ naakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1951]='*Nanevavipākanavipākadhammadhammaṃ naabyākataṃ dhammaṃ paṭicca….*';
P_HTM[1952]='*4-1. Upādinnattika-kusalattikaṃ*';
P_HTM[1953]='*45. Naupādinnupādāniyaṃ nakusalaṃ *[ito paṭṭhāya yāva ajjhattārammaṇattikā sabbapotthakesu akusalābyākatapadāni na dissanti, vedanāttika sanidassanattikesu viya nanu tehipi bhavitabbaṃ]* dhammaṃ paṭicca…pe… naanupādinnupādāniyaṃ nakusalaṃ dhammaṃ paṭicca…pe… naanupādinnaanupādāniyaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1954]='*5-1. Saṃkiliṭṭhattika-kusalattikaṃ*';
P_HTM[1955]='*46. Nasaṃkiliṭṭhasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhaasaṃkilesikaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1956]='*6-21-1. Vitakkādittikāni-kusalattikaṃ*';
P_HTM[1957]='*47. Nasavitakkasavicāraṃ  nakusalaṃ dhammaṃ paṭicca…pe… naavitakkavicāramattaṃ nakusalaṃ dhammaṃ paṭicca…pe… naavitakkaavicāraṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1958]='*48. Napītisahagataṃ  nakusalaṃ dhammaṃ paṭicca…pe… nasukhasahagataṃ nakusalaṃ dhammaṃ paṭicca…pe… naupekkhāsahagataṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1959]='*49. Nadassanena pahātabbaṃ nakusalaṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanevadassanena nabhāvanāya pahātabbaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1960]='*50. Nadassanena pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanevadassanena nabhāvanāya pahātabbahetukaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1961]='*51. Naācayagāmiṃ  nakusalaṃ dhammaṃ paṭicca…pe… naapacayagāmiṃ nakusalaṃ dhammaṃ paṭicca…pe… nanevācayagāmināpacayagāmiṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1962]='*52. Nasekkhaṃ  nakusalaṃ dhammaṃ paṭicca…pe… naasekkhaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanevāsekkhanāsekkhaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1963]='*53. Naparittaṃ nakusalaṃ dhammaṃ paṭicca…pe… namahaggataṃ nakusalaṃ dhammaṃ paṭicca…pe… naappamāṇaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1964]='*54. Naparittārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… namahaggatārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… naappamāṇārammaṇaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1965]='*55. Nahīnaṃ nakusalaṃ dhammaṃ paṭicca…pe… namajjhimaṃ nakusalaṃ dhammaṃ paṭicca…pe… napaṇītaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1966]='*56. Namicchattaniyataṃ nakusalaṃ dhammaṃ paṭicca…pe… nasammattaniyataṃ nakusalaṃ dhammaṃ paṭicca…pe… naaniyataṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1967]='*57. Namaggārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… namaggahetukaṃ nakusalaṃ dhammaṃ paṭicca…pe… namaggādhipatiṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1968]='*58. Naanuppannaṃ  nakusalaṃ dhammaṃ paṭicca…pe… nauppādiṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1969]='*59. Naatītaṃ nakusalaṃ dhammaṃ paṭicca…pe… naanāgataṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1970]='*60. Naatītārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… naanāgatārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… napaccuppannārammaṇaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1971]='*61. Naajjhattaṃ  nakusalaṃ dhammaṃ paṭicca…pe… nabahiddhā nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1972]='*62. Naajjhattārammaṇaṃ nakusalaṃ dhammaṃ paṭicca…pe… nabahiddhārammaṇaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1973]='*22-1. Sanidassanattika-kusalattikaṃ*';
P_HTM[1974]='*63. Nasanidassanasappaṭighaṃ  nakusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca naanidassanasappaṭigho nakusalo dhammo  uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakusalo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1975]='*Naanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca naanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakusalo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1976]='*Naanidassanaappaṭighaṃ nakusalaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakusalo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1977]='*Nasanidassanasappaṭighaṃ nakusalañca naanidassanaappaṭighaṃ nakusalañca dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1978]='*Naanidassanasappaṭighaṃ nakusalañca naanidassanaappaṭighaṃ nakusalañca dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā… cha (saṃkhittaṃ). Hetuyā tiṃsa, ārammaṇe nava…pe… avigate tiṃsa. (Sabbattha vitthāro.)*';
P_HTM[1979]='*64. Nasanidassanasappaṭighaṃ naakusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naakusalo dhammo uppajjati hetupaccayā. Hetuyā tiṃsa, ārammaṇe nava…pe… avigate tiṃsa. (Sabbattha vitthāro.)*';
P_HTM[1980]='*65. Nasanidassanasappaṭighaṃ naabyākataṃ dhammaṃ paṭicca nasanidassanasappaṭigho naabyākato dhammo uppajjati hetupaccayā.*';
P_HTM[1981]='*Hetuyā. Nava (sabbattha nava.)*';
P_HTM[1982]='*22-2-21. Sanidassanattika-vedanādittikāni*';
P_HTM[1983]='*66. Nasanidassanasappaṭighaṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1984]='*Nasanidassanasappaṭighaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1985]='*Nasanidassanasappaṭighaṃ naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1986]='*67. Nasanidassanasappaṭighaṃ navipākaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ navipākadhammadhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1987]='*Nasanidassanasappaṭighaṃ nanevavipākanavipākadhammadhammaṃ paṭicca… hetuyā nava.*';
P_HTM[1988]='*68. Nasanidassanasappaṭighaṃ naupādinnupādāniyaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1989]='*Nasanidassanasappaṭighaṃ naanupādinnupādāniyaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1990]='*Nasanidassanasappaṭighaṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1991]='*69. Nasanidassanasappaṭighaṃ nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1992]='*Nasanidassanasappaṭighaṃ naasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1993]='*Nasanidassanasappaṭighaṃ naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca… hetuyā tiṃsa.*';
P_HTM[1994]='*70. Nasanidassanasappaṭighaṃ  nasavitakkasavicāraṃ dhammaṃ paṭicca…pe….*';
P_HTM[1995]='*Nasanidassanasappaṭighaṃ naavitakkavicāramattaṃ dhammaṃ paṭicca….*';
P_HTM[1996]='*Nasanidassanasappaṭighaṃ naavitakkaavicāraṃ dhammaṃ paṭicca…pe….*';
P_HTM[1997]='*71. Nasanidassanasappaṭighaṃ napītisahagataṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nasukhasahagataṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naupekkhāsahagataṃ dhammaṃ paṭicca….*';
P_HTM[1998]='*72. Nasanidassanasappaṭighaṃ  nadassanena pahātabbaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[1999]='*Nasanidassanasappaṭighaṃ nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[2000]='*73. Nasanidassanasappaṭighaṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2001]='*Nasanidassanasappaṭighaṃ nanevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2002]='*74. Nasanidassanasappaṭighaṃ naācayagāmiṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ  naapacayagāmiṃ dhammaṃ paṭicca….*';
P_HTM[2003]='*Nasanidassanasappaṭighaṃ nanevācayagāmināpacayagāmiṃ dhammaṃ paṭicca….*';
P_HTM[2004]='*75. Nasanidassanasappaṭighaṃ nasekkhaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naasekkhaṃ dhammaṃ paṭicca….*';
P_HTM[2005]='*Nasanidassanasappaṭighaṃ nanevasekkhanāsekkhaṃ dhammaṃ paṭicca…pe….*';
P_HTM[2006]='*76. Nasanidassanasappaṭighaṃ naparittaṃ dhammaṃ paṭicca….*';
P_HTM[2007]='*Nasanidassanasappaṭighaṃ namahaggataṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naappamāṇaṃ dhammaṃ paṭicca….*';
P_HTM[2008]='*77. Nasanidassanasappaṭighaṃ naparittārammaṇaṃ dhammaṃ paṭicca…pe… sanidassanasappaṭighaṃ namahaggatārammaṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naappamāṇārammaṇaṃ dhammaṃ paṭicca….*';
P_HTM[2009]='*78. Nasanidassanasappaṭighaṃ nahīnaṃ dhammaṃ paṭicca….*';
P_HTM[2010]='*Nasanidassanasappaṭighaṃ namajjhimaṃ dhammaṃ paṭicca….*';
P_HTM[2011]='*Nasanidassanasappaṭighaṃ napaṇītaṃ dhammaṃ paṭicca….*';
P_HTM[2012]='*79. Nasanidassanasappaṭighaṃ  namicchattaniyataṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ  nasammattaniyataṃ dhammaṃ paṭicca….*';
P_HTM[2013]='*Nasanidassanasappaṭighaṃ naaniyataṃ dhammaṃ paṭicca…pe….*';
P_HTM[2014]='*80. Nasanidassanasappaṭighaṃ  namaggārammaṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ namaggahetukaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ namaggādhipatiṃ dhammaṃ paṭicca….*';
P_HTM[2015]='*81. Nasanidassanasappaṭighaṃ naanuppannaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nauppādiṃ dhammaṃ paṭicca….*';
P_HTM[2016]='*82. Nasanidassanasappaṭighaṃ naatītaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naanāgataṃ dhammaṃ paṭicca….*';
P_HTM[2017]='*83. Nasanidassanasappaṭighaṃ naatītārammaṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naanāgatārammaṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ napaccuppannārammaṇaṃ dhammaṃ paṭicca….*';
P_HTM[2018]='*84. Nasanidassanasappaṭighaṃ naajjhattaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nabahiddhā dhammaṃ paṭicca….*';
P_HTM[2019]='*85. Nasanidassanasappaṭighaṃ  naajjhattārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naajjhattārammaṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naajjhattārammaṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho naajjhattārammaṇo dhammo uppajjati hetupaccayā.*';
P_HTM[2020]='*Hetuyā tiṃsa…pe… avigate tiṃsa. (Sabbattha vitthāro.)*';
P_HTM[2021]='*86. Nasanidassanasappaṭighaṃ nabahiddhārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nabahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ  nabahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[2022]='*Naanidassanasappaṭighaṃ nabahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[2023]='*Naanidassanaappaṭighaṃ nabahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[2024]='*Nasanidassanasappaṭighaṃ  nabahiddhārammaṇañca naanidassanaappaṭighaṃ nabahiddhārammaṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[2025]='*Naanidassanasappaṭighaṃ nabahiddhārammaṇañca naanidassanaappaṭighaṃ nabahiddhārammaṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā… cha. (Saṃkhittaṃ.)*';
P_HTM[2026]='*Hetuyā tiṃsa, ārammaṇe nava…pe… avigate tiṃsa.*';
P_HTM[2027]='*(Sahajātavārepi paccayavārepi nissayavārepi saṃsaṭṭhavārepi sampayuttavārepi pañhāvārepi vitthāro.)*';
P_HTM[2028]='*Dhammapaccanīye tikatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[2029]='*Dhammapaccanīye dukadukapaṭṭhānaṃ*';
P_HTM[2030]='*1-1-5. Hetuduka-sahetukādidukāni*';
P_HTM[2031]='*1. Nahetuṃ  nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2032]='*Hetuyā tīṇi, ārammaṇe ekaṃ…pe… avigate tīṇi.*';
P_HTM[2033]='*2. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati nahetupaccayā. (1)*';
P_HTM[2034]='*Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo  uppajjati naārammaṇapaccayā. (Saṃkhittaṃ.)*';
P_HTM[2035]='*Nahetuyā ekaṃ, naārammaṇe tīṇi, naadhipatiyā tīṇi.*';
P_HTM[2036]='*Hetu-ārammaṇapaccayā*';
P_HTM[2037]='*3. Nanahetu nasahetuko dhammo nahetussa nasahetukassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[2038]='*Nahetu nasahetuko dhammo nahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu nasahetuko dhammo nanahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[2039]='*Hetuyā ekaṃ, ārammaṇe cattāri…pe… avigate cattāri.*';
P_HTM[2040]='*4. Nahetuṃ  naahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ naahetukaṃ dhammaṃ paṭicca nanahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu naahetuko ca nanahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2041]='*Nanahetuṃ naahetukaṃ dhammaṃ paṭicca nanahetu naahetuko dhammo uppajjati hetupaccayā. Nanahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. Nanahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu naahetuko ca nanahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2042]='*Nahetuṃ naahetukañca nanahetuṃ naahetukañca dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ  naahetukañca nanahetuṃ naahetukañca dhammaṃ paṭicca nanahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ naahetukañca nanahetuṃ naahetukañca dhammaṃ paṭicca nahetu naahetuko ca nanahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2043]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[2044]='*5. Nahetuṃ nahetusampayuttaṃ dhammaṃ paṭicca nahetu nahetusampayutto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2045]='*6. Nahetuṃ nahetuvippayuttaṃ dhammaṃ paṭicca nahetu nahetuvippayutto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2046]='*Nanahetuṃ nahetuvippayuttaṃ dhammaṃ paṭicca nanahetu nahetuvippayutto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2047]='*Nahetuṃ nahetuvippayuttañca nanahetuṃ nahetuvippayuttañca dhammaṃ paṭicca nahetu nahetuvippayutto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2048]='*Hetuyā nava. (Sabbattha vitthāro.)*';
P_HTM[2049]='*7. Nahetuṃ  nahetuñceva naahetukañca dhammaṃ paṭicca nahetu nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. (Yāva pañhāvārepi ekaṃ.)*';
P_HTM[2050]='*Nanahetuṃ naahetukañceva nana ca hetuṃ dhammaṃ paṭicca nanahetu naahetuko ceva nana ca hetu dhammo uppajjati hetupaccayā.*';
P_HTM[2051]='*Nahetuṃ  nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca nahetu nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā.*';
P_HTM[2052]='*Nanahetuṃ nahetuvippayuttañceva nana ca hetuṃ dhammaṃ paṭicca nanahetu nahetuvippayutto ceva nana ca hetu dhammo uppajjati hetupaccayā.*';
P_HTM[2053]='*Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā.*';
P_HTM[2054]='*Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[2055]='*1-6. Hetuduka-cūḷantaradukaṃ*';
P_HTM[2056]='*8. Nahetuṃ naappaccayaṃ dhammaṃ paṭicca nahetu naappaccayo dhammo uppajjati hetupaccayā. Nahetuṃ naappaccayaṃ dhammaṃ paṭicca nanahetu naappaccayo dhammo uppajjati hetupaccayā. Nahetuṃ naappaccayaṃ dhammaṃ paṭicca nahetu naappaccayo ca nanahetu naappaccayo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2057]='*Nanahetuṃ naappaccayaṃ dhammaṃ paṭicca nanahetu naappaccayo dhammo uppajjati hetupaccayā. Nanahetuṃ naappaccayaṃ dhammaṃ paṭicca nahetu naappaccayo dhammo uppajjati hetupaccayā. Nanahetuṃ naappaccayaṃ dhammaṃ paṭicca nahetu naappaccayo ca nanahetu  naappaccayo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2058]='*Nahetuṃ  naappaccayañca nanahetuṃ naappaccayañca dhammaṃ paṭicca nahetu naappaccayo dhammo uppajjati hetupaccayā. Nahetuṃ naappaccayañca nanahetuṃ naappaccayañca dhammaṃ paṭicca nanahetu naappaccayo dhammo uppajjati hetupaccayā. Nahetuṃ naappaccayañca nanahetuṃ naappaccayañca dhammaṃ paṭicca nahetu naappaccayo ca nanahetu naappaccayo ca dhammā uppajjanti hetupaccayā. (3).*';
P_HTM[2059]='*Hetuyā  nava.*';
P_HTM[2060]='*Nahetuṃ naasaṅkhataṃ dhammaṃ paṭicca….*';
P_HTM[2061]='*Nahetuṃ nasanidassanaṃ dhammaṃ paṭicca….*';
P_HTM[2062]='*Nahetuṃ nasappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[2063]='*Nahetuṃ naappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[2064]='*Nahetuṃ narūpiṃ dhammaṃ paṭicca….*';
P_HTM[2065]='*Nahetuṃ naarūpiṃ dhammaṃ paṭicca….*';
P_HTM[2066]='*Nahetuṃ nalokiyaṃ dhammaṃ paṭicca…pe… nahetuṃ nalokuttaraṃ dhammaṃ paṭicca….*';
P_HTM[2067]='*Nahetuṃ nakenaci viññeyyaṃ dhammaṃ paṭicca…pe… nahetuṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca….*';
P_HTM[2068]='*1-13-18. Hetuduka-āsavādigocchakāni*';
P_HTM[2069]='*9. Nahetuṃ noāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2070]='*Nahetuṃ nanoāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2071]='*Nahetuṃ nasāsavaṃ dhammaṃ paṭicca…pe… nahetuṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2072]='*Nahetuṃ naāsavasampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2073]='*Nahetuṃ naāsavavippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2074]='*Nahetuṃ noāsavañceva  naanāsavañca dhammaṃ paṭicca….*';
P_HTM[2075]='*Nahetuṃ naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[2076]='*Nahetuṃ  naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca….*';
P_HTM[2077]='*Nahetuṃ naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[2078]='*Nahetuṃ āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca…pe… nahetuṃ āsavavippayuttaṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2079]='*1-19-53. Hetuduka-saññojanādidukāni*';
P_HTM[2080]='*10. Nahetuṃ nosaññojanaṃ dhammaṃ paṭicca…pe… nahetuṃ noganthaṃ dhammaṃ paṭicca….*';
P_HTM[2081]='*Nahetuṃ nooghaṃ dhammaṃ paṭicca…pe… nahetuṃ noyogaṃ dhammaṃ paṭicca….*';
P_HTM[2082]='*Nahetuṃ  nonīvaraṇaṃ dhammaṃ paṭicca….*';
P_HTM[2083]='*Nahetuṃ noparāmāsaṃ dhammaṃ paṭicca….*';
P_HTM[2084]='*1-54-81. Hetuduka-mahantaradukaṃ*';
P_HTM[2085]='*11. Nahetuṃ nasārammaṇaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[2086]='*Nahetuṃ nacittaṃ dhammaṃ paṭicca….*';
P_HTM[2087]='*Nahetuṃ nacetasikaṃ dhammaṃ paṭicca….*';
P_HTM[2088]='*Nahetuṃ nocittasampayuttaṃ dhammaṃ paṭicca…pe… nahetuṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca…pe… nahetuṃ nacittasamuṭṭhānaṃ dhammaṃ paṭicca….*';
P_HTM[2089]='*Nahetuṃ nacittasahabhuṃ dhammaṃ paṭicca…pe… nahetuṃ nacittānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[2090]='*Nahetuṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nahetuṃ nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca…pe… nahetuṃ nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[2091]='*Nahetuṃ naajjhattikaṃ dhammaṃ paṭicca….*';
P_HTM[2092]='*Nahetuṃ nabāhiraṃ dhammaṃ paṭicca….*';
P_HTM[2093]='*Nahetuṃ naupādādhammaṃ paṭicca….*';
P_HTM[2094]='*Nahetuṃ  naupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[2095]='*Nahetuṃ naanupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[2096]='*Nahetuṃ  noupādānaṃ dhammaṃ paṭicca…pe… nahetuṃ nokilesaṃ dhammaṃ paṭicca…pe….*';
P_HTM[2097]='*1-82. Hetuduka-piṭṭhidukaṃ*';
P_HTM[2098]='*12. Nahetuṃ nadassanena pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[2099]='*Nahetuṃ nanadassanena pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[2100]='*13. Nahetuṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe… nahetuṃ nanabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe… nahetuṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nahetuṃ nanadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nahetuṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2101]='*Nahetuṃ nanabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2102]='*14. Nahetuṃ  nasavitakkaṃ dhammaṃ paṭicca…pe… nahetuṃ naavitakkaṃ dhammaṃ paṭicca…pe… nahetuṃ nasavicāraṃ dhammaṃ paṭicca…pe… nahetuṃ naavicāraṃ dhammaṃ paṭicca…pe… nahetuṃ nasappītikaṃ dhammaṃ paṭicca…pe… nahetuṃ naappītikaṃ dhammaṃ paṭicca…pe… nahetuṃ napītisahagataṃ dhammaṃ paṭicca…pe… nahetuṃ nanapītisahagataṃ dhammaṃ paṭicca…pe… nahetuṃ nasukhasahagataṃ dhammaṃ paṭicca…pe… nahetuṃ nanasukhasahagataṃ dhammaṃ paṭicca…pe… nahetuṃ naupekkhāsahagataṃ dhammaṃ paṭicca…pe… nahetuṃ nanaupekkhāsahagataṃ dhammaṃ paṭicca…pe….*';
P_HTM[2103]='*15. Nahetuṃ nakāmāvacaraṃ dhammaṃ paṭicca…pe… nahetuṃ nanakāmāvacaraṃ dhammaṃ paṭicca…pe… nahetuṃ narūpāvacaraṃ dhammaṃ paṭicca…pe… nahetuṃ nanarūpāvacaraṃ dhammaṃ paṭicca…pe… nahetuṃ naarūpāvacaraṃ dhammaṃ paṭicca…pe… nahetuṃ nanaarūpāvacaraṃ dhammaṃ paṭicca…pe….*';
P_HTM[2104]='*16. Nahetuṃ  napariyāpannaṃ dhammaṃ paṭicca…pe… nahetuṃ naapariyāpannaṃ dhammaṃ paṭicca…pe… nahetuṃ naniyyānikaṃ dhammaṃ paṭicca…pe… nahetuṃ naaniyyānikaṃ dhammaṃ paṭicca…pe… nahetuṃ naniyataṃ dhammaṃ paṭicca…pe… nahetuṃ naaniyataṃ dhammaṃ paṭicca…pe….*';
P_HTM[2105]='*Nahetuṃ nasauttaraṃ dhammaṃ paṭicca…pe…. Nahetuṃ naanuttaraṃ dhammaṃ paṭicca…pe….*';
P_HTM[2106]='*17. Nahetuṃ nasaraṇaṃ dhammaṃ paṭicca nahetu nasaraṇo dhammo uppajjati  hetupaccayā. (Nava.)*';
P_HTM[2107]='*Nahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ naaraṇaṃ dhammaṃ paṭicca nanahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu naaraṇo ca nanahetu naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2108]='*Nanahetuṃ naaraṇaṃ dhammaṃ paṭicca nanahetu naaraṇo dhammo uppajjati hetupaccayā. Nanahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu naaraṇo dhammo uppajjati hetupaccayā. Nanahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu naaraṇo ca nanahetu naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2109]='*Nahetuṃ naaraṇañca nanahetuṃ naaraṇañca dhammaṃ paṭicca nahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ naaraṇañca nanahetuṃ naaraṇañca dhammaṃ paṭicca nanahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ naaraṇañca nanahetuṃ naaraṇañca dhammaṃ paṭicca nahetu naaraṇo ca nanahetu naaraṇo  ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.) Hetuyā nava. (Sabbattha nava.)*';
P_HTM[2110]='*2-6-1. Sahetukādidukāni-hetudukaṃ*';
P_HTM[2111]='*18. Nasahetukaṃ nahetuṃ dhammaṃ paṭicca nasahetuko nahetu dhammo uppajjati hetupaccayā. Nasahetukaṃ nahetuṃ dhammaṃ paṭicca naahetuko  nahetu dhammo uppajjati hetupaccayā. Nasahetukaṃ nahetuṃ dhammaṃ paṭicca nasahetuko nahetu ca naahetuko nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2112]='*Naahetukaṃ  nahetuṃ dhammaṃ paṭicca naahetuko nahetu dhammo uppajjati hetupaccayā. Naahetukaṃ nahetuṃ dhammaṃ paṭicca nasahetuko nahetu dhammo uppajjati hetupaccayā. Naahetukaṃ nahetuṃ dhammaṃ paṭicca nasahetuko nahetu ca naahetuko nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2113]='*Nasahetukaṃ nahetuñca naahetukaṃ nahetuñca dhammaṃ paṭicca nasahetuko nahetu dhammo uppajjati hetupaccayā. Nasahetukaṃ nahetuñca naahetukaṃ nahetuñca dhammaṃ paṭicca naahetuko nahetu dhammo uppajjati hetupaccayā. Nasahetukaṃ nahetuñca naahetukaṃ nahetuñca dhammaṃ paṭicca nasahetuko nahetu ca naahetuko nahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2114]='*Hetuyā nava. (Sabbattha vitthāro.)*';
P_HTM[2115]='*19. Naahetukaṃ nanahetuṃ dhammaṃ paṭicca naahetuko nanahetu dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2116]='*Hetuyā ekaṃ…pe… avigate ekaṃ. (Sabbattha ekaṃ.)*';
P_HTM[2117]='*20. Nahetusampayuttaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2118]='*Nahetuvippayuttaṃ  nanahetuṃ dhammaṃ paṭicca….*';
P_HTM[2119]='*21. Nahetuñceva naahetukañca nahetuṃ dhammaṃ paṭicca…pe… naahetukañceva nana ca hetuṃ dhammaṃ paṭicca…pe… nahetuñceva nahetuvippayuttañca nahetuṃ dhammaṃ paṭicca…pe… nahetuvippayuttañceva nana ca hetuṃ dhammaṃ paṭicca….*';
P_HTM[2120]='*22. Nahetuṃ  nasahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nahetuṃ naahetukaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2121]='*7-13-1. Cūḷantaradukāni-hetudukaṃ*';
P_HTM[2122]='*23. Naappaccayaṃ nahetuṃ dhammaṃ paṭicca…pe… naasaṅkhataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2123]='*Nasanidassanaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2124]='*Nasappaṭighaṃ  nahetuṃ dhammaṃ paṭicca…pe… naappaṭighaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2125]='*Narūpiṃ nahetuṃ dhammaṃ paṭicca…pe… naarūpiṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2126]='*Nalokiyaṃ nahetuṃ dhammaṃ paṭicca…pe… nalokuttaraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2127]='*Nakenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca…pe… nanakenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2128]='*14-19-1. Āsavagocchaka-hetudukaṃ*';
P_HTM[2129]='*24. Noāsavaṃ nahetuṃ dhammaṃ paṭicca…pe… nanoāsavaṃ nahetuṃ dhammaṃ  paṭicca….*';
P_HTM[2130]='*Nasāsavaṃ nahetuṃ dhammaṃ paṭicca…pe… naanāsavaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2131]='*Naāsavasampayuttaṃ nahetuṃ dhammaṃ paṭicca…pe… naāsavavippayuttaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2132]='*Naāsavañceva naanāsavaṃ nahetuṃ dhammaṃ paṭicca…pe… naanāsavañceva nano ca āsavaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2133]='*Naāsavañceva naāsavavippayuttañca nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2134]='*Naāsavavippayuttañceva nano ca āsavaṃ nahetuṃ dhammaṃ paṭicca…pe… āsavavippayuttaṃ nasāsavaṃ nahetuṃ dhammaṃ paṭicca…pe… āsavavippayuttaṃ naanāsavaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2135]='*20-54-1. Saññojanādidukāni-hetudukaṃ*';
P_HTM[2136]='*25. Nosaññojanaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2137]='*26. Noganthaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2138]='*27. Nooghaṃ  nahetuṃ dhammaṃ paṭicca…pe… noyogaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2139]='*28. Nonīvaraṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2140]='*29. Noparāmāsaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2141]='*55-68-1. Mahantaradukāni-hetudukaṃ*';
P_HTM[2142]='*30. Nasārammaṇaṃ  nahetuṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[2143]='*31. Nacittaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2144]='*Nacetasikaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2145]='*Nacittasampayuttaṃ nahetuṃ dhammaṃ paṭicca…pe… nacittasaṃsaṭṭhaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2146]='*Nacittasamuṭṭhānaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2147]='*32. Nacittasahabhuṃ nahetuṃ dhammaṃ paṭicca…pe… nacittānuparivattiṃ nahetuṃ dhammaṃ paṭicca…pe… nacittasaṃsaṭṭhasamuṭṭhānaṃ nahetuṃ dhammaṃ paṭicca…pe… nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ  nahetuṃ dhammaṃ paṭicca…pe… nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2148]='*33. Naajjhattikaṃ nahetuṃ dhammaṃ paṭicca…pe… nabāhiraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2149]='*Noupādā nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2150]='*34. Naupādinnaṃ nahetuṃ dhammaṃ paṭicca…pe… naanupādinnaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2151]='*69-82-1. Upādānādidukāni-hetudukaṃ*';
P_HTM[2152]='*35. Noupādānaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2153]='*36. Nokilesaṃ nahetuṃ dhammaṃ paṭicca…pe… nanokilesaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2154]='*83-1. Piṭṭhiduka-hetudukaṃ*';
P_HTM[2155]='*37. Nadassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nanadassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca  …pe… nanabhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nadassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nanadassanena  pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nanabhāvanāya pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2156]='*38. Nasavitakkaṃ nahetuṃ dhammaṃ paṭicca…pe… naavitakkaṃ nahetuṃ dhammaṃ paṭicca…pe… nasavicāraṃ nahetuṃ dhammaṃ paṭicca…pe… naavicāraṃ nahetuṃ dhammaṃ paṭicca…pe… nasappītikaṃ nahetuṃ dhammaṃ paṭicca…pe… naappītikaṃ nahetuṃ dhammaṃ paṭicca…pe… napītisahagataṃ nahetuṃ dhammaṃ paṭicca…pe… nanapītisahagataṃ nahetuṃ dhammaṃ paṭicca…pe… nasukhasahagataṃ  nahetuṃ dhammaṃ paṭicca…pe… nanasukhasahagataṃ nahetuṃ dhammaṃ paṭicca…pe… naupekkhāsahagataṃ nahetuṃ dhammaṃ paṭicca…pe… nanaupekkhāsahagataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2157]='*39. Nakāmāvacaraṃ nahetuṃ dhammaṃ paṭicca…pe… nanakāmāvacaraṃ nahetuṃ dhammaṃ paṭicca…pe… narūpāvacaraṃ nahetuṃ dhammaṃ paṭicca…pe… nanarūpāvacaraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2158]='*40. Naarūpāvacaraṃ nahetuṃ dhammaṃ paṭicca…pe… nanaarūpāvacaraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2159]='*Napariyāpannaṃ nahetuṃ dhammaṃ paṭicca…pe… naapariyāpannaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2160]='*41. Naniyyānikaṃ nahetuṃ dhammaṃ paṭicca…pe… naaniyyānikaṃ nahetuṃ dhammaṃ paṭicca…pe… naniyataṃ nahetuṃ dhammaṃ paṭicca…pe… naaniyataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2161]='*Nasauttaraṃ nahetuṃ dhammaṃ paṭicca…pe… naanuttaraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[2162]='*42. Nasaraṇaṃ nahetuṃ dhammaṃ paṭicca nasaraṇo nahetu dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2163]='*Naaraṇaṃ nahetuṃ dhammaṃ paṭicca naaraṇo nahetu dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetuṃ dhammaṃ paṭicca nasaraṇo nahetu dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetuṃ dhammaṃ paṭicca nasaraṇo nahetu ca naaraṇo nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2164]='*Nasaraṇaṃ nahetuñca naaraṇaṃ nahetuñca dhammaṃ paṭicca nasaraṇo nahetu dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2165]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[2166]='*43. Nasaraṇaṃ  nanahetuṃ dhammaṃ paṭicca nasaraṇo nanahetu dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2167]='*Naaraṇaṃ nanahetuṃ dhammaṃ paṭicca naaraṇo nanahetu dhammo uppajjati hetupaccayā. (1).*';
P_HTM[2168]='*Hetuyā dve…pe… avigate dve. (Sabbattha vitthāro.)*';
P_HTM[2169]='*100-2-6. Saraṇaduka-sahetukādidukāni*';
P_HTM[2170]='*44. Nasaraṇaṃ nasahetukaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naahetukaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nahetusampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2171]='*Nasaraṇaṃ nahetuvippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2172]='*45. Nasaraṇaṃ nahetuñceva naahetukañca dhammaṃ paṭicca…pe… nasaraṇaṃ naahetukañceva nana ca hetuṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca…pe… nasaraṇaṃ nahetuvippayuttañceva nana ca hetuṃ dhammaṃ paṭicca….*';
P_HTM[2173]='*Nasaraṇaṃ nahetuṃ nasahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2174]='*Nasaraṇaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2175]='*100-7-13. Saraṇaduka-cūḷantaradukāni*';
P_HTM[2176]='*46. Nasaraṇaṃ naappaccayaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naasaṅkhataṃ  dhammaṃ paṭicca….*';
P_HTM[2177]='*Nasaraṇaṃ nasanidassanaṃ dhammaṃ paṭicca….*';
P_HTM[2178]='*Nasaraṇaṃ nasappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[2179]='*Nasaraṇaṃ naappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[2180]='*Nasaraṇaṃ narūpiṃ dhammaṃ paṭicca….*';
P_HTM[2181]='*Nasaraṇaṃ naarūpiṃ dhammaṃ paṭicca….*';
P_HTM[2182]='*Nasaraṇaṃ  nalokuttaraṃ dhammaṃ paṭicca….*';
P_HTM[2183]='*Nasaraṇaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca….*';
P_HTM[2184]='*100-14-19. Saraṇaduka-āsavagocchakaṃ*';
P_HTM[2185]='*47. Nasaraṇaṃ  noāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2186]='*Nasaraṇaṃ nanoāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2187]='*Nasaraṇaṃ nasāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2188]='*Nasaraṇaṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2189]='*Nasaraṇaṃ naāsavasampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2190]='*Nasaraṇaṃ naāsavavippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[2191]='*Nasaraṇaṃ naāsavañceva naanāsavañca dhammaṃ paṭicca….*';
P_HTM[2192]='*Nasaraṇaṃ naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[2193]='*Nasaraṇaṃ naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca…pe… nasaraṇaṃ naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[2194]='*Nasaraṇaṃ naāsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2195]='*Nasaraṇaṃ naāsavavippayuttaṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[2196]='*100-20-54. Saraṇaduka-saññojanādidukāni*';
P_HTM[2197]='*48. Nasaraṇaṃ nosaññojanaṃ dhammaṃ paṭicca….*';
P_HTM[2198]='*49. Nasaraṇaṃ noganthaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nooghaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ noyogaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nonīvaraṇaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ  noparāmāsaṃ dhammaṃ paṭicca….*';
P_HTM[2199]='*100-55-68. Saraṇaduka-mahantaradukāni*';
P_HTM[2200]='*50. Nasaraṇaṃ  nasārammaṇaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[2201]='*Nasaraṇaṃ nacittaṃ dhammaṃ paṭicca….*';
P_HTM[2202]='*Nasaraṇaṃ nacetasikaṃ dhammaṃ paṭicca….*';
P_HTM[2203]='*Nasaraṇaṃ nacittasampayuttaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca….*';
P_HTM[2204]='*Nasaraṇaṃ  nacittasamuṭṭhānaṃ dhammaṃ paṭicca….*';
P_HTM[2205]='*Nasaraṇaṃ nacittasahabhuṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nacittānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[2206]='*51. Nasaraṇaṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[2207]='*Nasaraṇaṃ naajjhattikaṃ dhammaṃ paṭicca….*';
P_HTM[2208]='*Nasaraṇaṃ nabāhiraṃ dhammaṃ paṭicca….*';
P_HTM[2209]='*Nasaraṇaṃ naupādā dhammaṃ paṭicca….*';
P_HTM[2210]='*Nasaraṇaṃ naupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[2211]='*Nasaraṇaṃ naanupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[2212]='*100-69-82. Saraṇaduka-upādānādidukāni*';
P_HTM[2213]='*52. Nasaraṇaṃ naupādānaṃ dhammaṃ paṭicca….*';
P_HTM[2214]='*53. Nasaraṇaṃ nokilesaṃ dhammaṃ paṭicca….*';
P_HTM[2215]='*100-83. Saraṇaduka-dassanādidukāni*';
P_HTM[2216]='*54. Nasaraṇaṃ nadassanena pahātabbaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanadassanena pahātabbaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanabhāvanāya pahātabbaṃ dhammaṃ paṭicca  …pe… nasaraṇaṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca …pe… nasaraṇaṃ nanadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2217]='*Nasaraṇaṃ nanabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[2218]='*55. Nasaraṇaṃ nasavitakkaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naavitakkaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nasavicāraṃ dhammaṃ paṭicca….*';
P_HTM[2219]='*Nasaraṇaṃ naavicāraṃ dhammaṃ paṭicca….*';
P_HTM[2220]='*56. Nasaraṇaṃ nasappītikaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naappītikaṃ dhammaṃ paṭicca…pe… nasaraṇaṃ napītisahagataṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanapītisahagataṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nasukhasahagataṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanasukhasahagataṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naupekkhāsahagataṃ dhammaṃ paṭicca….*';
P_HTM[2221]='*57. Nasaraṇaṃ  nanaupekkhāsahagataṃ dhammaṃ paṭicca….*';
P_HTM[2222]='*Nasaraṇaṃ nakāmāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[2223]='*Nasaraṇaṃ nanakāmāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[2224]='*58. Nasaraṇaṃ narūpāvacaraṃ dhammaṃ paṭicca…pe… nasaraṇaṃ nanarūpāvacaraṃ dhammaṃ paṭicca…pe… nasaraṇaṃ naarūpāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[2225]='*Nasaraṇaṃ nanaarūpāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[2226]='*Nasaraṇaṃ napariyāpannaṃ dhammaṃ paṭicca….*';
P_HTM[2227]='*Nasaraṇaṃ naapariyāpannaṃ dhammaṃ paṭicca….*';
P_HTM[2228]='*59. Nasaraṇaṃ naniyyānikaṃ dhammaṃ paṭicca….*';
P_HTM[2229]='*Nasaraṇaṃ naaniyyānikaṃ dhammaṃ paṭicca….*';
P_HTM[2230]='*Nasaraṇaṃ  naniyataṃ dhammaṃ paṭicca….*';
P_HTM[2231]='*Nasaraṇaṃ naaniyataṃ dhammaṃ paṭicca….*';
P_HTM[2232]='*60. Nasaraṇaṃ nasauttaraṃ dhammaṃ paṭicca nasaraṇo nasauttaro dhammo  uppajjati hetupaccayā.*';
P_HTM[2233]='*Nasaraṇaṃ naanuttaraṃ dhammaṃ paṭicca nasaraṇo naanuttaro dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2234]='*Naaraṇaṃ naanuttaraṃ dhammaṃ paṭicca naaraṇo naanuttaro dhammo uppajjati hetupaccayā. Naaraṇaṃ naanuttaraṃ dhammaṃ paṭicca nasaraṇo naanuttaro dhammo uppajjati hetupaccayā. Naaraṇaṃ naanuttaraṃ dhammaṃ paṭicca nasaraṇo naanuttaro ca naaraṇo naanuttaro ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2235]='*Nasaraṇaṃ naanuttarañca naaraṇaṃ naanuttarañca dhammaṃ paṭicca nasaraṇo naanuttaro dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[2236]='*Hetuyā pañca. (Sabbattha vitthāro. Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2237]='*Dhammapaccanīye dukadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[2238]='*Paccanīyapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[2239]='*Dhammānulomapaccanīye tikapaṭṭhānaṃ*';
P_HTM[2240]='*1. Kusalattikaṃ*';
P_HTM[2241]='*1-6. Paṭiccavārādi*';
P_HTM[2242]='*Paccayacatukkaṃ*';
P_HTM[2243]='*Hetupaccayo*';
P_HTM[2244]='*1. Kusalaṃ  dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā – kusale khandhe paṭicca cittasamuṭṭhānaṃ rūpaṃ. Kusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā – kusalaṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… kusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati hetupaccayā – kusalaṃ ekaṃ khandhaṃ paṭicca tayo khandhā…pe… kusalaṃ dhammaṃ paṭicca naakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā – kusalaṃ ekaṃ khandhaṃ paṭicca tayo khandhā…pe… kusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā – kusale khandhe paṭicca cittasamuṭṭhānaṃ rūpaṃ. (5)*';
P_HTM[2245]='*2. Akusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā – akusale khandhe paṭicca cittasamuṭṭhānaṃ rūpaṃ. Akusalaṃ dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā – akusalaṃ ekaṃ  khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… akusalaṃ dhammaṃ paṭicca  naabyākato dhammo uppajjati hetupaccayā. Akusalaṃ dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Akusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2246]='*3. Abyākataṃ  dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā – vipākābyākataṃ kiriyābyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… paṭisandhikkhaṇe…pe… ekaṃ mahābhūtaṃ paṭicca tayo mahābhūtā…pe… dve mahābhūte paṭicca dve mahābhūtā, mahābhūte paṭicca cittasamuṭṭhānaṃ rūpaṃ. Abyākataṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā – vipākābyākataṃ…pe… paṭisandhikkhaṇe…pe… mahābhūtaṃ…pe… abyākataṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā – vipākābyākataṃ kiriyābyākataṃ…pe…. (3) (Saṃkhittaṃ.)*';
P_HTM[2247]='*4. Kusalañca abyākatañca dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā – kusale khandhe ca mahābhūte ca paṭicca cittasamuṭṭhānaṃ rūpaṃ. Kusalañca abyākatañca dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Kusalañca abyākatañca dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2248]='*Akusalañca  abyākatañca dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Akusalañca abyākatañca dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Akusalañca abyākatañca dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. (3) (Cittasamuṭṭhānarūpameva ettha vattati, ekūnavīsati pañhā kātabbā.)*';
P_HTM[2249]='*Ārammaṇapaccayo*';
P_HTM[2250]='*5. Kusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati ārammaṇapaccayā. Kusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati ārammaṇapaccayā. Kusalaṃ dhammaṃ paṭicca naakusalo ca naabyākato ca dhammā uppajjanti ārammaṇapaccayā. (3)*';
P_HTM[2251]='*Akusalaṃ  dhammaṃ paṭicca nakusalo dhammo uppajjati ārammaṇapaccayā. Akusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati ārammaṇapaccayā. Akusalaṃ dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti ārammaṇapaccayā. (3)*';
P_HTM[2252]='*Abyākataṃ dhammaṃ paṭicca nakusalo dhammo uppajjati ārammaṇapaccayā. Abyākataṃ dhammaṃ paṭicca naakusalo dhammo uppajjati ārammaṇapaccayā. Abyākataṃ  dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti ārammaṇapaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2253]='*Hetuyā ekūnavīsa, ārammaṇe nava, adhipatiyā ekūnavīsa, anantare nava, samanantare nava, sahajāte ekūnavīsa…pe… avigate ekūnavīsa.*';
P_HTM[2254]='*Paccanīyaṃ*';
P_HTM[2255]='*Nahetu-naārammaṇapaccayā*';
P_HTM[2256]='*6. Akusalaṃ dhammaṃ paṭicca nakusalo dhammo uppajjati nahetupaccayā. Akusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati nahetupaccayā. Akusalaṃ dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti nahetupaccayā. (3)*';
P_HTM[2257]='*Abyākataṃ dhammaṃ paṭicca nakusalo dhammo uppajjati nahetupaccayā. Abyākataṃ dhammaṃ paṭicca naakusalo dhammo uppajjati nahetupaccayā. Abyākataṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti nahetupaccayā. (3)*';
P_HTM[2258]='*7. Kusalaṃ dhammaṃ paṭicca nakusalo dhammo uppajjati naārammaṇapaccayā. Kusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati naārammaṇapaccayā. Kusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti naārammaṇapaccayā. (3)*';
P_HTM[2259]='*Akusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati naārammaṇapaccayā. Akusalaṃ dhammaṃ  paṭicca nakusalo dhammo uppajjati naārammaṇapaccayā. Akusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti naārammaṇapaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2260]='*Nahetuyā cha, naārammaṇe pannarasa, naadhipatiyā ekūnavīsa…pe… novigate pannarasa.*';
P_HTM[2261]='*(Paccanīyaṃ vitthāretabbaṃ. Sahajātavārampi paccayavārampi vitthāretabbaṃ. Paccayavārepi  hetuyā chabbīsa, ārammaṇe aṭṭhārasa…pe… avigate chabbīsa. Nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2262]='*1. Kusalattikaṃ*';
P_HTM[2263]='*7. Pañhāvāro*';
P_HTM[2264]='*Paccayacatukkaṃ*';
P_HTM[2265]='*Hetu-ārammaṇapaccayā*';
P_HTM[2266]='*8. Kusalo  dhammo nakusalassa dhammassa hetupaccayena paccayo. Kusalo dhammo naakusalassa dhammassa hetupaccayena paccayo. Kusalo dhammo naabyākatassa dhammassa hetupaccayena paccayo. Kusalo dhammo naakusalassa ca naabyākatassa ca dhammassa hetupaccayena paccayo. Kusalo dhammo nakusalassa ca naakusalassa ca dhammassa hetupaccayena paccayo. (5)*';
P_HTM[2267]='*9. Akusalo dhammo naakusalassa dhammassa hetupaccayena paccayo. Akusalo dhammo nakusalassa dhammassa hetupaccayena paccayo. Akusalo dhammo naabyākatassa dhammassa hetupaccayena paccayo. Akusalo dhammo nakusalassa ca naabyākatassa ca dhammassa hetupaccayena paccayo. Akusalo dhammo nakusalassa ca naakusalassa ca dhammassa hetupaccayena paccayo. (5)*';
P_HTM[2268]='*Abyākato  dhammo nakusalassa dhammassa hetupaccayena paccayo. Abyākato dhammo naakusalassa dhammassa hetupaccayena paccayo. Abyākato dhammo nakusalassa ca naakusalassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[2269]='*10. Kusalo dhammo nakusalassa dhammassa ārammaṇapaccayena paccayo…. (Cha pañhā.)*';
P_HTM[2270]='*Akusalo dhammo naakusalassa dhammassa ārammaṇapaccayena paccayo …. (Cha pañhā.)*';
P_HTM[2271]='*Abyākato dhammo naabyākatassa dhammassa ārammaṇapaccayena paccayo…. (Cha pañhā, saṃkhittaṃ.)*';
P_HTM[2272]='*11. Hetuyā terasa, ārammaṇe aṭṭhārasa, adhipatiyā sattarasa, anantare soḷasa, samanantare soḷasa, sahajāte ekūnavīsa, aññamaññe nava, nissaye chabbīsa, upanissaye aṭṭhārasa, purejāte cha, pacchājāte nava, āsevane nava, kamme terasa, vipāke tīṇi, āhāre terasa…pe… magge terasa, sampayutte nava, vippayutte dvādasa…pe… avigate chabbīsa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[2273]='*2. Vedanāttikaṃ*';
P_HTM[2274]='*1-6. Paṭiccavārādi*';
P_HTM[2275]='*Paccayacatukkaṃ*';
P_HTM[2276]='*Hetupaccayo*';
P_HTM[2277]='*12. Sukhāya  vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā – sukhāya vedanāya sampayutte khandhe paṭicca sukhavedanā cittasamuṭṭhānañca rūpaṃ; paṭisandhikkhaṇe…pe… (mahābhūtā natthi). Sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā – sukhāya vedanāya sampayuttaṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Sukhāya  vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca naadukkhamasukhāya  vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[2278]='*13. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca dhammā  uppajjanti hetupaccayā. Dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto  ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[2279]='*14. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca  nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (7) (Saṃkhittaṃ.)*';
P_HTM[2280]='*Hetuyā ekavīsa, ārammaṇe ekavīsa…pe… avigate ekavīsa.*';
P_HTM[2281]='*Paccanīyaṃ*';
P_HTM[2282]='*Nahetupaccayo*';
P_HTM[2283]='*15. Sukhāya  vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto dhammo uppajjati nahetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2284]='*Nahetuyā ekavīsa, naārammaṇe ekavīsa…pe… navippayutte cuddasa…pe… novigate ekavīsa.*';
P_HTM[2285]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2286]='*2. Vedanāttikaṃ*';
P_HTM[2287]='*7. Pañhāvāro*';
P_HTM[2288]='*Paccayacatukkaṃ*';
P_HTM[2289]='*Hetupaccayo*';
P_HTM[2290]='*16. Sukhāya vedanāya sampayutto dhammo nasukhāya vedanāya sampayuttassa dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto  dhammo nadukkhāya vedanāya sampayuttassa dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto dhammo naadukkhamasukhāya vedanāya sampayuttassa dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto dhammo nasukhāya vedanāya sampayuttassa ca naadukkhamasukhāya vedanāya sampayuttassa ca dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto dhammo nadukkhāya vedanāya  sampayuttassa ca naadukkhamasukhāya vedanāya sampayuttassa ca dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto dhammo nasukhāya vedanāya sampayuttassa ca nadukkhāya vedanāya sampayuttassa ca dhammassa hetupaccayena paccayo. Sukhāya vedanāya sampayutto dhammo nasukhāya vedanāya sampayuttassa ca nadukkhāya vedanāya sampayuttassa ca naadukkhamasukhāya vedanāya sampayuttassa ca dhammassa hetupaccayena paccayo. (7) (Saṃkhittaṃ.)*';
P_HTM[2291]='*Hetuyā ekavīsa, ārammaṇe ekavīsa…pe… avigate ekavīsa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[2292]='*3. Vipākattikaṃ*';
P_HTM[2293]='*1-6. Paṭiccavārādi*';
P_HTM[2294]='*Paccayacatukkaṃ*';
P_HTM[2295]='*Hetu-ārammaṇapaccayā*';
P_HTM[2296]='*17. Vipākaṃ dhammaṃ paṭicca navipāko dhammo uppajjati hetupaccayā. Vipākaṃ dhammaṃ paṭicca navipākadhammadhammo uppajjati hetupaccayā. Vipākaṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Vipākaṃ dhammaṃ paṭicca navipākadhammadhammo ca nanevavipākanavipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Vipākaṃ dhammaṃ paṭicca navipāko ca navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (Pañca pañhā.)*';
P_HTM[2297]='*18. Vipākadhammadhammaṃ paṭicca navipākadhammadhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ paṭicca navipāko dhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ paṭicca nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ paṭicca navipāko ca nanevavipākanavipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Vipākadhammadhammaṃ paṭicca navipāko ca navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (Pañca pañhā.)*';
P_HTM[2298]='*19. Nevavipākanavipākadhammadhammaṃ  paṭicca nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ paṭicca  navipāko dhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ paṭicca navipākadhammadhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ paṭicca navipākadhammadhammo ca nanevavipākanavipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Nevavipākanavipākadhammadhammaṃ paṭicca navipāko ca navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (Pañca pañhā.)*';
P_HTM[2299]='*20. Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipāko dhammo uppajjati hetupaccayā. Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipākadhammadhammo uppajjati hetupaccayā. Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipākadhammadhammo ca nanevavipākanavipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipāko ca navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2300]='*Vipākadhammadhammañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipāko dhammo uppajjati hetupaccayā. Vipākadhammadhammañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipākadhammadhammo uppajjati hetupaccayā. Vipākadhammadhammañca nevavipākanavipākadhammadhammañca  dhammaṃ paṭicca navipāko ca navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2301]='*21. Vipākaṃ dhammaṃ paṭicca navipākadhammadhammo uppajjati ārammaṇapaccayā… tīṇi.*';
P_HTM[2302]='*Vipākadhammadhammaṃ paṭicca navipāko dhammo uppajjati ārammaṇapaccayā… tīṇi.*';
P_HTM[2303]='*Nevavipākanavipākadhammadhammaṃ paṭicca nanevavipākanavipākadhammadhammo uppajjati ārammaṇapaccayā… (pañca pañhā).*';
P_HTM[2304]='*Vipākañca nevavipākanavipākadhammadhammañca dhammaṃ paṭicca navipākadhammadhammo uppajjati ārammaṇapaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2305]='*22. Hetuyā  tevīsa, ārammaṇe cuddasa…pe… avigate tevīsa. (Saṃkhittaṃ.)*';
P_HTM[2306]='*Nahetuyā aṭṭhārasa, naārammaṇe pannarasa.*';
P_HTM[2307]='*(Sahajātavārampi  paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi vitthāretabbaṃ.)*';
P_HTM[2308]='*3. Vipākattikaṃ*';
P_HTM[2309]='*7. Pañhāvāro*';
P_HTM[2310]='*Paccayacatukkaṃ*';
P_HTM[2311]='*Hetu-ārammaṇapaccayā*';
P_HTM[2312]='*23. Vipāko dhammo navipākassa dhammassa hetupaccayena paccayo. Vipāko dhammo navipākadhammadhammassa hetupaccayena paccayo. Vipāko dhammo nanevavipākanavipākadhammadhammassa hetupaccayena paccayo. Vipāko dhammo navipākadhammadhammassa ca nanevavipākanavipākadhammadhammassa ca dhammassa hetupaccayena paccayo. Vipāko dhammo navipākassa ca navipākadhammadhammassa ca dhammassa hetupaccayena paccayo. (5)*';
P_HTM[2313]='*24. Vipāko  dhammo navipākassa dhammassa ārammaṇapaccayena paccayo. Vipāko dhammo navipākadhammadhammassa ārammaṇapaccayena paccayo. Vipāko dhammo nanevavipākanavipākadhammadhammassa ārammaṇapaccayena paccayo. Vipāko dhammo navipākassa ca nanevavipākanavipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. Vipāko dhammo navipākadhammadhammassa ca nanevavipākanavipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. Vipāko dhammo navipākassa ca navipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. (6)*';
P_HTM[2314]='*Vipākadhammadhammo navipākadhammadhammassa ārammaṇapaccayena paccayo. Vipākadhammadhammo navipākassa dhammassa ārammaṇapaccayena paccayo. Vipākadhammadhammo nanevavipākanavipākadhammadhammassa  ārammaṇapaccayena paccayo. Vipākadhammadhammo navipākassa ca nanevavipākanavipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. Vipākadhammadhammo navipākadhammadhammassa ca nanevavipākanavipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. Vipākadhammadhammo navipākassa ca navipākadhammadhammassa ca dhammassa ārammaṇapaccayena paccayo. (6)*';
P_HTM[2315]='*Nevavipākanavipākadhammadhammo nanevavipākanavipākadhammadhammassa ārammaṇapaccayena paccayo…pe… cha. (Saṃkhittaṃ.)*';
P_HTM[2316]='*25. Hetuyā  terasa, ārammaṇe aṭṭhārasa, adhipatiyā sattarasa, anantare soḷasa…pe… purejāte cha, pacchājāte nava, āsevane cha, kamme cuddasa, vipāke pañca, indriye aṭṭhārasa…pe… vippayutte dvādasa…pe… avigate chabbīsa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[2317]='*4. Upādinnattikaṃ*';
P_HTM[2318]='*1-6. Paṭiccavārādi*';
P_HTM[2319]='*Paccayacatukkaṃ*';
P_HTM[2320]='*Hetupaccayo*';
P_HTM[2321]='*26. Upādinnupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ dhammaṃ paṭicca naanupādinnupādāniyo dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ dhammaṃ paṭicca naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo ca naanupādinnaanupādāniyo ca dhammā uppajjanti hetupaccayā. Upādinnupādāniyaṃ dhammaṃ paṭicca naanupādinnupādāniyo ca naanupādinnaanupādāniyo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2322]='*Anupādinnupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo dhammo uppajjati hetupaccayā. Anupādinnupādāniyaṃ dhammaṃ paṭicca naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā. Anupādinnupādāniyaṃ  dhammaṃ paṭicca naupādinnupādāniyo ca naanupādinnaanupādāniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2323]='*Anupādinnaanupādāniyaṃ dhammaṃ paṭicca naanupādinnaanupādāniyo  dhammo uppajjati hetupaccayā. Anupādinnaanupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo dhammo uppajjati hetupaccayā. Anupādinnaanupādāniyaṃ dhammaṃ paṭicca naanupādinnupādāniyo dhammo uppajjati hetupaccayā. Anupādinnaanupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo ca naanupādinnaanupādāniyo ca dhammā uppajjanti hetupaccayā. Anupādinnaanupādāniyaṃ dhammaṃ paṭicca naupādinnupādāniyo ca naanupādinnupādāniyo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2324]='*Anupādinnupādāniyañca anupādinnaanupādāniyañca dhammaṃ paṭicca naupādinnupādāniyo dhammo uppajjati hetupaccayā. Anupādinnupādāniyañca anupādinnaanupādāniyañca dhammaṃ paṭicca naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā. Anupādinnupādāniyañca anupādinnaanupādāniyañca dhammaṃ paṭicca naupādinnupādāniyo ca naanupādinnaanupādāniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2325]='*Upādinnupādāniyañca anupādinnupādāniyañca dhammaṃ paṭicca naupādinnupādāniyo dhammo uppajjati hetupaccayā. Upādinnupādāniyañca anupādinnupādāniyañca dhammaṃ paṭicca naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā. Upādinnupādāniyañca anupādinnupādāniyañca dhammaṃ paṭicca naupādinnupādāniyo  ca naanupādinnaanupādāniyo  ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2326]='*27. Hetuyā ekūnavīsa, ārammaṇe nava, adhipatiyā ekādasa…pe… sahajāte ekūnavīsa. (Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi vitthāretabbaṃ.)*';
P_HTM[2327]='*4. Upādinnattikaṃ*';
P_HTM[2328]='*7. Pañhāvāro*';
P_HTM[2329]='*Paccayacatukkaṃ*';
P_HTM[2330]='*Hetu-ārammaṇapaccayā*';
P_HTM[2331]='*28. Upādinnupādāniyo  dhammo naupādinnupādāniyassa dhammassa hetupaccayena paccayo. Upādinnupādāniyo dhammo naanupādinnupādāniyassa dhammassa hetupaccayena paccayo…pe….*';
P_HTM[2332]='*29. Upādinnupādāniyo dhammo naupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Upādinnupādāniyo dhammo naanupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Upādinnupādāniyo dhammo naanupādinnaanupādāniyassa dhammassa ārammaṇapaccayena paccayo. Upādinnupādāniyo dhammo naupādinnupādāniyassa ca naanupādinnaanupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. Upādinnupādāniyo dhammo naanupādinnupādāniyassa ca naanupādinnaanupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. (5)*';
P_HTM[2333]='*Anupādinnupādāniyo dhammo naanupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Anupādinnupādāniyo dhammo naupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Anupādinnupādāniyo  dhammo naanupādinnaanupādāniyassa dhammassa ārammaṇapaccayena paccayo. Anupādinnupādāniyo  dhammo naupādinnupādāniyassa ca naanupādinnaanupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. Anupādinnupādāniyo dhammo naanupādinnupādāniyassa ca naanupādinnaanupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. (5)*';
P_HTM[2334]='*Anupādinnaanupādāniyo dhammo naanupādinnaanupādāniyassa dhammassa ārammaṇapaccayena paccayo…pe… pañca. (Saṃkhittaṃ.)*';
P_HTM[2335]='*30. Hetuyā terasa, ārammaṇe pannarasa, adhipatiyā ekādasa. (Pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2336]='*5. Saṃkiliṭṭhattikaṃ*';
P_HTM[2337]='*1-7. Paṭiccavārādi*';
P_HTM[2338]='*1. Paccayānulomaṃ*';
P_HTM[2339]='*Hetupaccayo*';
P_HTM[2340]='*31. Saṃkiliṭṭhasaṃkilesikaṃ  dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā. Saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko ca naasaṃkiliṭṭhaasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhasaṃkilesiko ca naasaṃkiliṭṭhaasaṃkilesiko ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2341]='*Asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā. Asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko ca naasaṃkiliṭṭhaasaṃkilesiko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2342]='*Asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā. Asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko ca naasaṃkiliṭṭhaasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko ca naasaṃkiliṭṭhasaṃkilesiko ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2343]='*Asaṃkiliṭṭhasaṃkilesikañca  asaṃkiliṭṭhaasaṃkilesikañca dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2344]='*Saṃkiliṭṭhasaṃkilesikañca asaṃkiliṭṭhasaṃkilesikañca dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā…pe… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2345]='*Hetuyā ekūnavīsa, ārammaṇe nava…pe… avigate ekūnavīsa. (Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi vitthāretabbaṃ. Pañhāvāre na sadisaṃ.)*';
P_HTM[2346]='*32. Hetuyā terasa, ārammaṇe pannarasa, adhipatiyā pannarasa, anantare soḷasa…pe… purejāte cha, pacchājāte nava, āsevane aṭṭha, kamme terasa, vipāke aṭṭha, āhāre terasa…pe… magge terasa, vippayutte dvādasa…pe… avigate chabbīsa.*';
P_HTM[2347]='*6. Vitakkattikaṃ*';
P_HTM[2348]='*1-7. Paṭiccavārādi*';
P_HTM[2349]='*1. Paccayānulomaṃ*';
P_HTM[2350]='*Hetupaccayo*';
P_HTM[2351]='*33. Savitakkasavicāraṃ dhammaṃ paṭicca nasavitakkasavicāro dhammo uppajjati hetupaccayā. Savitakkasavicāraṃ dhammaṃ paṭicca naavitakkavicāramatto dhammo uppajjati hetupaccayā. Savitakkasavicāraṃ dhammaṃ paṭicca naavitakkaavicāro dhammo uppajjati hetupaccayā. Savitakkasavicāraṃ dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkaavicāro ca dhammā uppajjanti hetupaccayā. Savitakkasavicāraṃ dhammaṃ paṭicca naavitakkavicāramatto ca naavitakkaavicāro ca dhammā uppajjanti hetupaccayā. Savitakkasavicāraṃ dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkavicāramatto ca dhammā uppajjanti hetupaccayā. Savitakkasavicāraṃ  dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkavicāramatto ca naavitakkaavicāro  ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[2352]='*34. Avitakkavicāramattaṃ  dhammaṃ paṭicca naavitakkavicāramatto dhammo uppajjati hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca nasavitakkasavicāro dhammo uppajjati hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca naavitakkaavicāro dhammo uppajjati hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkaavicāro ca dhammā uppajjanti hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca naavitakkavicāramatto ca naavitakkaavicāro ca dhammā uppajjanti hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkavicāramatto ca dhammā uppajjanti hetupaccayā. Avitakkavicāramattaṃ dhammaṃ paṭicca nasavitakkasavicāro ca naavitakkavicāramatto ca naavitakkaavicāro ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[2353]='*Avitakkaavicāraṃ dhammaṃ paṭicca naavitakkaavicāro dhammo uppajjati hetupaccayā…pe… satta.*';
P_HTM[2354]='*Savitakkasavicārañca avitakkaavicārañca dhammaṃ paṭicca nasavitakkasavicāro dhammo uppajjati hetupaccayā…pe… satta.*';
P_HTM[2355]='*Avitakkavicāramattañca avitakkaavicārañca dhammaṃ paṭicca nasavitakkasavicāro dhammo uppajjati hetupaccayā…pe… satta.*';
P_HTM[2356]='*Savitakkasavicārañca avitakkavicāramattañca dhammaṃ paṭicca nasavitakkasavicāro dhammo  uppajjati hetupaccayā…pe… satta.*';
P_HTM[2357]='*Savitakkasavicārañca avitakkavicāramattañca avitakkaavicārañca dhammaṃ paṭicca nasavitakkasavicāro dhammo uppajjati hetupaccayā…pe… satta. (Saṃkhittaṃ.)*';
P_HTM[2358]='*Hetuyā ekūnapaññāsa, ārammaṇe ekūnapaññāsa…pe… avigate ekūnapaññāsa. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2359]='*7. Pītittikaṃ*';
P_HTM[2360]='*1-7. Paṭiccavārādi*';
P_HTM[2361]='*1. Paccayānulomaṃ*';
P_HTM[2362]='*Hetupaccayo*';
P_HTM[2363]='*35. Pītisahagataṃ  dhammaṃ paṭicca napītisahagato dhammo uppajjati hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca nasukhasahagato dhammo uppajjati hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati  hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca napītisahagato ca naupekkhāsahagato ca dhammā uppajjanti hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca nasukhasahagato ca naupekkhāsahagato ca dhammā uppajjanti hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca napītisahagato ca nasukhasahagato ca dhammā uppajjanti hetupaccayā. Pītisahagataṃ dhammaṃ paṭicca napītisahagato ca nasukhasahagato ca naupekkhāsahagato ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[2364]='*Sukhasahagataṃ dhammaṃ paṭicca nasukhasahagato dhammo uppajjati hetupaccayā…pe… satta.*';
P_HTM[2365]='*Upekkhāsahagataṃ  dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati hetupaccayā…pe… satta.*';
P_HTM[2366]='*Pītisahagatañca sukhasahagatañca dhammaṃ paṭicca napītisahagato dhammo uppajjati hetupaccayā…pe… satta. (Saṃkhittaṃ.)*';
P_HTM[2367]='*Hetuyā aṭṭhavīsa, ārammaṇe catuvīsa…pe… avigate aṭṭhavīsa.*';
P_HTM[2368]='*(Sahajātavārampi…pe… sampayuttavārampi pañhāvārampi sabbattha vitthāretabbaṃ).*';
P_HTM[2369]='*8. Dassanattikaṃ*';
P_HTM[2370]='*1-7. Paṭiccavārādi*';
P_HTM[2371]='*1. Paccayānulomaṃ*';
P_HTM[2372]='*Hetupaccayo*';
P_HTM[2373]='*36. Dassanena  pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nanevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo ca nanevadassanena nabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo ca nabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2374]='*Bhāvanāya pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[2375]='*Nevadassanena  nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nadassanena  pahātabbo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2376]='*Dassanena pahātabbañca nevadassanena nabhāvanāya pahātabbañca dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2377]='*Bhāvanāya pahātabbañca nevadassanena nabhāvanāya pahātabbañca dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2378]='*Hetuyā ekūnavīsa…pe… avigate ekūnavīsa. (Sahajātavārampi…pe… sampayuttavārampi pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2379]='*9. Dassanahetuttikaṃ*';
P_HTM[2380]='*1-7. Paṭiccavārādi*';
P_HTM[2381]='*37. Dassanena  pahātabbahetukaṃ dhammaṃ paṭicca nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2382]='*Hetuyā chabbīsa…pe… avigate chabbīsa. (Vitthāretabbaṃ.)*';
P_HTM[2383]='*10. Ācayagāmittikaṃ*';
P_HTM[2384]='*1-7. Paṭiccavārādi*';
P_HTM[2385]='*1. Paccayānulomaṃ*';
P_HTM[2386]='*Hetupaccayo*';
P_HTM[2387]='*38. Ācayagāmiṃ dhammaṃ paṭicca naācayagāmī dhammo uppajjati hetupaccayā. Ācayagāmiṃ dhammaṃ paṭicca naapacayagāmī dhammo uppajjati hetupaccayā. Ācayagāmiṃ dhammaṃ paṭicca nanevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā. Ācayagāmiṃ dhammaṃ paṭicca naapacayagāmī ca nanevācayagāmināpacayagāmī ca dhammā uppajjanti hetupaccayā. Ācayagāmiṃ dhammaṃ paṭicca naācayagāmī ca naapacayagāmī  ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2388]='*Apacayagāmiṃ dhammaṃ paṭicca naapacayagāmī dhammo uppajjati hetupaccayā. Apacayagāmiṃ dhammaṃ paṭicca naācayagāmī dhammo uppajjati hetupaccayā. Apacayagāmiṃ dhammaṃ paṭicca nanevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā. Apacayagāmiṃ dhammaṃ paṭicca naācayagāmī ca nanevācayagāmināpacayagāmī ca dhammā uppajjanti hetupaccayā. Apacayagāmiṃ dhammaṃ paṭicca naācayagāmī ca naapacayagāmī ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2389]='*Nevācayagāmināpacayagāmiṃ  dhammaṃ paṭicca naācayagāmī dhammo uppajjati hetupaccayā. Nevācayagāmināpacayagāmiṃ dhammaṃ paṭicca naapacayagāmī dhammo uppajjati hetupaccayā. Nevācayagāmināpacayagāmiṃ dhammaṃ paṭicca naācayagāmī ca naapacayagāmī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2390]='*Ācayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naācayagāmī dhammo uppajjati hetupaccayā. Ācayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naapacayagāmī dhammo uppajjati hetupaccayā. Ācayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naācayagāmī ca naapacayagāmī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2391]='*Apacayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naācayagāmī  dhammo uppajjati hetupaccayā. Apacayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naapacayagāmī dhammo uppajjati hetupaccayā. Apacayagāmiñca nevācayagāmināpacayagāmiñca dhammaṃ paṭicca naācayagāmī ca naapacayagāmī ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2392]='*Hetuyā ekūnavīsa. (Sabbattha vitthāro.)*';
P_HTM[2393]='*11. Sekkhattikaṃ*';
P_HTM[2394]='*1-7. Paṭiccavārādi*';
P_HTM[2395]='*1. Paccayānulomaṃ*';
P_HTM[2396]='*Hetupaccayo*';
P_HTM[2397]='*39. Sekkhaṃ dhammaṃ paṭicca nasekkho dhammo uppajjati hetupaccayā. Sekkhaṃ dhammaṃ paṭicca naasekkho dhammo uppajjati hetupaccayā. Sekkhaṃ dhammaṃ paṭicca nanevasekkhanāsekkho dhammo uppajjati hetupaccayā. Sekkhaṃ dhammaṃ paṭicca naasekkho ca nanevasekkhanāsekkho ca dhammā uppajjanti hetupaccayā. Sekkhaṃ dhammaṃ paṭicca nasekkho ca naasekkho ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2398]='*Asekkhaṃ  dhammaṃ paṭicca naasekkho dhammo uppajjati hetupaccayā. Asekkhaṃ dhammaṃ paṭicca nasekkho dhammo uppajjati hetupaccayā. Asekkhaṃ dhammaṃ paṭicca nanevasekkhanāsekkho dhammo uppajjati hetupaccayā. Asekkhaṃ dhammaṃ paṭicca nasekkho ca nanevasekkhanāsekkho ca dhammā uppajjanti hetupaccayā. Asekkhaṃ dhammaṃ paṭicca nasekkho ca naasekkho ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2399]='*Nevasekkhanāsekkhaṃ  dhammaṃ paṭicca nasekkho dhammo uppajjati hetupaccayā. Nevasekkhanāsekkhaṃ dhammaṃ paṭicca naasekkho dhammo uppajjati hetupaccayā. Nevasekkhanāsekkhaṃ dhammaṃ paṭicca nasekkho ca naasekkho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2400]='*Sekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca nasekkho dhammo uppajjati hetupaccayā. Sekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca naasekkho dhammo uppajjati hetupaccayā. Sekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca nasekkho ca naasekkho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2401]='*Asekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca nasekkho dhammo uppajjati hetupaccayā. Asekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca naasekkho dhammo uppajjati hetupaccayā. Asekkhañca nevasekkhanāsekkhañca dhammaṃ paṭicca nasekkho ca naasekkho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2402]='*Hetuyā ekūnavīsa. (Sabbattha vitthāro.)*';
P_HTM[2403]='*12. Parittattikaṃ*';
P_HTM[2404]='*1-7. Paṭiccavārādi*';
P_HTM[2405]='*1. Paccayānulomaṃ*';
P_HTM[2406]='*Hetupaccayo*';
P_HTM[2407]='*40. Parittaṃ  dhammaṃ paṭicca naparitto dhammo uppajjati hetupaccayā. Parittaṃ dhammaṃ paṭicca namahaggato dhammo uppajjati hetupaccayā. Parittaṃ dhammaṃ paṭicca naappamāṇo dhammo uppajjati hetupaccayā. Parittaṃ dhammaṃ paṭicca naparitto ca naappamāṇo ca dhammā uppajjanti hetupaccayā. Parittaṃ dhammaṃ paṭicca namahaggato ca naappamāṇo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2408]='*Mahaggataṃ dhammaṃ paṭicca namahaggato dhammo uppajjati hetupaccayā. Mahaggataṃ dhammaṃ paṭicca naparitto dhammo uppajjati hetupaccayā. Mahaggataṃ dhammaṃ paṭicca naappamāṇo dhammo uppajjati hetupaccayā. Mahaggataṃ dhammaṃ paṭicca naparitto ca naappamāṇo ca dhammā uppajjanti hetupaccayā. Mahaggataṃ dhammaṃ paṭicca namahaggato ca naappamāṇo ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2409]='*Appamāṇaṃ dhammaṃ paṭicca naappamāṇo dhammo uppajjati hetupaccayā. Appamāṇaṃ dhammaṃ paṭicca naparitto dhammo uppajjati hetupaccayā. Appamāṇaṃ dhammaṃ paṭicca  namahaggato dhammo uppajjati hetupaccayā. Appamāṇaṃ dhammaṃ paṭicca namahaggato ca naappamāṇo ca dhammā uppajjanti hetupaccayā. Appamāṇaṃ dhammaṃ paṭicca naparitto ca namahaggato ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2410]='*Parittañca appamāṇañca dhammaṃ paṭicca namahaggato dhammo uppajjati hetupaccayā. Parittañca appamāṇañca dhammaṃ paṭicca  naappamāṇo dhammo uppajjati hetupaccayā. Parittañca appamāṇañca  dhammaṃ paṭicca namahaggato ca naappamāṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2411]='*Parittañca mahaggatañca dhammaṃ paṭicca naparitto dhammo uppajjati hetupaccayā. Parittañca mahaggatañca dhammaṃ paṭicca namahaggato dhammo uppajjati hetupaccayā. Parittañca mahaggatañca dhammaṃ paṭicca naappamāṇo dhammo uppajjati hetupaccayā. Parittañca mahaggatañca dhammaṃ paṭicca naparitto ca naappamāṇo ca dhammā uppajjanti hetupaccayā. Parittañca mahaggatañca dhammaṃ paṭicca namahaggato ca naappamāṇo ca dhammā uppajjanti hetupaccayā. (5) (Saṃkhittaṃ.)*';
P_HTM[2412]='*Hetuyā tevīsa, ārammaṇe cuddasa. (Sabbattha vitthāretabbaṃ.)*';
P_HTM[2413]='*13. Parittārammaṇattikaṃ*';
P_HTM[2414]='*1-7. Paṭiccavārādi*';
P_HTM[2415]='*41. Parittārammaṇaṃ dhammaṃ paṭicca naparittārammaṇo dhammo uppajjati hetupaccayā….*';
P_HTM[2416]='*Hetuyā ekavīsa…pe… avigate ekavīsa.*';
P_HTM[2417]='*14. Hīnattikaṃ*';
P_HTM[2418]='*1-7. Paṭiccavārādi*';
P_HTM[2419]='*42. Hīnaṃ dhammaṃ paṭicca nahīno dhammo uppajjati hetupaccayā. (Saṃkiliṭṭhasaṃkilesikattikasadisaṃ.)*';
P_HTM[2420]='*Hetuyā  ekūnavīsa…pe… avigate ekūnavīsa.*';
P_HTM[2421]='*15. Micchattattikaṃ*';
P_HTM[2422]='*1-7. Paṭiccavārādi*';
P_HTM[2423]='*1. Paccayānulomaṃ*';
P_HTM[2424]='*Hetupaccayo*';
P_HTM[2425]='*43. Micchattaniyataṃ  dhammaṃ paṭicca namicchattaniyato dhammo uppajjati hetupaccayā. Micchattaniyataṃ dhammaṃ paṭicca nasammattaniyato dhammo uppajjati hetupaccayā. Micchattaniyataṃ dhammaṃ paṭicca naaniyato dhammo uppajjati hetupaccayā. Micchattaniyataṃ dhammaṃ paṭicca nasammattaniyato ca naaniyato ca dhammā uppajjanti hetupaccayā. Micchattaniyataṃ dhammaṃ paṭicca namicchattaniyato ca nasammattaniyato ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2426]='*Sammattaniyataṃ dhammaṃ paṭicca nasammattaniyato dhammo uppajjati hetupaccayā. Sammattaniyataṃ dhammaṃ paṭicca namicchattaniyato dhammo uppajjati hetupaccayā. Sammattaniyataṃ dhammaṃ paṭicca naaniyato dhammo uppajjati hetupaccayā. Sammattaniyataṃ dhammaṃ paṭicca namicchattaniyato ca naaniyato ca dhammā uppajjanti hetupaccayā. Sammattaniyataṃ dhammaṃ paṭicca namicchattaniyato ca nasammattaniyato ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[2427]='*Aniyataṃ dhammaṃ paṭicca namicchattaniyato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2428]='*Micchattaniyatañca aniyatañca dhammaṃ paṭicca namicchattaniyato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2429]='*Sammattaniyatañca  aniyatañca dhammaṃ paṭicca namicchattaniyato dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2430]='*Hetuyā ekūnavīsa. (Sabbattha vitthāretabbaṃ.)*';
P_HTM[2431]='*16. Maggārammaṇattikaṃ*';
P_HTM[2432]='*1-7. Paṭiccavārādi*';
P_HTM[2433]='*44. Maggārammaṇaṃ  dhammaṃ paṭicca namaggārammaṇo dhammo uppajjati hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggahetuko dhammo uppajjati hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggādhipati dhammo uppajjati hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggārammaṇo ca namaggādhipati ca dhammā uppajjanti hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggahetuko ca namaggādhipati ca dhammā uppajjanti hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggārammaṇo ca namaggahetuko ca dhammā uppajjanti hetupaccayā. Maggārammaṇaṃ dhammaṃ paṭicca namaggārammaṇo ca namaggahetuko ca namaggādhipati ca dhammā uppajjanti hetupaccayā. (7) (Saṃkhittaṃ.)*';
P_HTM[2434]='*Hetuyā pañcatiṃsa…pe… avigate pañcatiṃsa. (Sabbattha vitthāretabbaṃ.)*';
P_HTM[2435]='*17. Uppannattikaṃ*';
P_HTM[2436]='*7. Pañhāvāro*';
P_HTM[2437]='*45. Uppanno  dhammo naanuppannassa dhammassa hetupaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[2438]='*Hetuyā tīṇi, ārammaṇe nava.*';
P_HTM[2439]='*18. Atītattikaṃ*';
P_HTM[2440]='*7. Pañhāvāro*';
P_HTM[2441]='*46. Paccuppanno  dhammo naatītassa dhammassa hetupaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[2442]='*Hetuyā tīṇi, ārammaṇe nava.*';
P_HTM[2443]='*19. Atītārammaṇattikaṃ*';
P_HTM[2444]='*1-7. Paṭiccavārādi*';
P_HTM[2445]='*47. Atītārammaṇaṃ  dhammaṃ paṭicca naatītārammaṇo dhammo uppajjati hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca naanāgatārammaṇo dhammo uppajjati hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca napaccuppannārammaṇo dhammo uppajjati hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca naatītārammaṇo ca napaccuppannārammaṇo ca dhammā uppajjanti hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca naanāgatārammaṇo ca napaccuppannārammaṇo ca dhammā uppajjanti hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca naatītārammaṇo ca naanāgatārammaṇo ca dhammā uppajjanti hetupaccayā. Atītārammaṇaṃ dhammaṃ paṭicca naatītārammaṇo ca naanāgatārammaṇo ca napaccuppannārammaṇo ca dhammā uppajjanti hetupaccayā. (7) (Saṃkhittaṃ.)*';
P_HTM[2446]='*Hetuyā ekavīsa…pe… avigate ekavīsa.*';
P_HTM[2447]='*20. Ajjhattattikaṃ*';
P_HTM[2448]='*1-7. Paṭiccavārādi*';
P_HTM[2449]='*48. Ajjhattaṃ dhammaṃ paṭicca nabahiddhā dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2450]='*Bahiddhā dhammaṃ paṭicca naajjhatto dhammo uppajjati hetupaccayā … hetuyā dve. (Sabbattha vitthāro.)*';
P_HTM[2451]='*21. Ajjhattārammaṇattikaṃ*';
P_HTM[2452]='*1-7. Paṭiccavārādi*';
P_HTM[2453]='*49. Ajjhattārammaṇaṃ  dhammaṃ paṭicca naajjhattārammaṇo dhammo uppajjati hetupaccayā.*';
P_HTM[2454]='*Hetuyā cha.*';
P_HTM[2455]='*22. Sanidassanattikaṃ*';
P_HTM[2456]='*1-7. Paṭiccavārādi*';
P_HTM[2457]='*1. Paccayānulomaṃ*';
P_HTM[2458]='*Hetupaccayo*';
P_HTM[2459]='*50. Anidassanasappaṭighaṃ  dhammaṃ paṭicca naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Anidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Anidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[2460]='*Anidassanaappaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho dhammo uppajjati hetupaccayā… cha.*';
P_HTM[2461]='*Anidassanasappaṭighañca anidassanaappaṭighañca dhammaṃ paṭicca nasanidassanasappaṭigho  dhammo uppajjati hetupaccayā… cha. (Saṃkhittaṃ.)*';
P_HTM[2462]='*Hetuyā aṭṭhārasa, ārammaṇe tīṇi…pe… avigate aṭṭhārasa. (Sabbattha vitthāro. Sahajātavārampi…pe… sampayuttavārampi vitthāretabbaṃ.)*';
P_HTM[2463]='*Hetu-ārammaṇapaccayā*';
P_HTM[2464]='*51. Anidassanaappaṭigho dhammo naanidassanaappaṭighassa dhammassa hetupaccayena paccayo. Anidassanaappaṭigho dhammo nasanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Anidassanaappaṭigho dhammo naanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Anidassanaappaṭigho  dhammo nasanidassanasappaṭighassa ca naanidassanaappaṭighassa ca dhammassa hetupaccayena paccayo. Naanidassanaappaṭigho dhammo naanidassanasappaṭighassa ca naanidassanaappaṭighassa ca dhammassa hetupaccayena paccayo. Anidassanaappaṭigho dhammo nasanidassanasappaṭighassa ca naanidassanasappaṭighassa ca dhammassa hetupaccayena paccayo. (6)*';
P_HTM[2465]='*Sanidassanasappaṭigho dhammo nasanidassanasappaṭighassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2466]='*52. Hetuyā cha, ārammaṇe nava. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[2467]='*Dhammānulomapaccanīye tikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[2468]='*Dhammānulomapaccanīye dukapaṭṭhānaṃ*';
P_HTM[2469]='*1. Hetudukaṃ*';
P_HTM[2470]='*1-7. Paṭiccavārādi*';
P_HTM[2471]='*1. Paccayānulomaṃ*';
P_HTM[2472]='*Hetupaccayo*';
P_HTM[2473]='*1. Hetuṃ  dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā – hetuṃ dhammaṃ paṭicca sampayuttakā khandhā cittasamuṭṭhānañca rūpaṃ; paṭisandhikkhaṇe…pe… hetuṃ dhammaṃ paṭicca nanahetu dhammo uppajjati hetupaccayā. Hetuṃ dhammaṃ paṭicca nahetu ca nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2474]='*Nahetuṃ dhammaṃ paṭicca nanahetu dhammo uppajjati hetupaccayā. Nahetuṃ dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Nahetuṃ dhammaṃ paṭicca nahetu ca nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2475]='*Hetuñca nahetuñca dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Hetuñca nahetuñca dhammaṃ  paṭicca nanahetu dhammo uppajjati hetupaccayā. Hetuñca nahetuñca dhammaṃ paṭicca nahetu ca nanahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2476]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2477]='*Hetu-ārammaṇapaccayā*';
P_HTM[2478]='*2. Hetu  dhammo nahetussa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[2479]='*Hetu dhammo nahetussa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2480]='*Nahetu dhammo nanahetussa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2481]='*Hetu ca nahetu ca dhammā nahetussa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2482]='*3. Hetuyā tīṇi, ārammaṇe nava…pe… avigate nava. (Pañhāvārampi evaṃ vitthāretabbaṃ.)*';
P_HTM[2483]='*2. Sahetukadukaṃ*';
P_HTM[2484]='*1-7. Paṭiccavārādi*';
P_HTM[2485]='*4. Sahetukaṃ dhammaṃ paṭicca nasahetuko dhammo uppajjati hetupaccayā. Sahetukaṃ dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā. Sahetukaṃ dhammaṃ paṭicca nasahetuko ca naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2486]='*Ahetukaṃ dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā. Ahetukaṃ dhammaṃ paṭicca nasahetuko dhammo uppajjati hetupaccayā. Ahetukaṃ dhammaṃ paṭicca nasahetuko ca naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2487]='*Sahetukañca ahetukañca dhammaṃ paṭicca nasahetuko dhammo uppajjati hetupaccayā. Sahetukañca  ahetukañca dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā. Sahetukañca ahetukañca dhammaṃ paṭicca nasahetuko ca naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2488]='*Hetuyā nava, ārammaṇe cha…pe… avigate nava. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2489]='*3. Hetusampayuttadukaṃ*';
P_HTM[2490]='*1-7. Paṭiccavārādi*';
P_HTM[2491]='*5. Hetusampayuttaṃ  dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā. Hetusampayuttaṃ dhammaṃ paṭicca nahetuvippayutto dhammo uppajjati hetupaccayā. Hetusampayuttaṃ dhammaṃ paṭicca nahetusampayutto ca nahetuvippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2492]='*Hetuvippayuttaṃ dhammaṃ paṭicca nahetuvippayutto dhammo uppajjati hetupaccayā. Hetuvippayuttaṃ dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā. Hetuvippayuttaṃ dhammaṃ paṭicca nahetusampayutto ca nahetuvippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2493]='*Hetusampayuttañca hetuvippayuttañca dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā. Hetusampayuttañca hetuvippayuttañca dhammaṃ paṭicca nahetuvippayutto dhammo uppajjati hetupaccayā. Hetusampayuttañca hetuvippayuttañca dhammaṃ paṭicca nahetusampayutto ca nahetuvippayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2494]='*Hetuyā nava. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2495]='*4. Hetusahetukadukaṃ*';
P_HTM[2496]='*1-7. Paṭiccavārādi*';
P_HTM[2497]='*6. Hetuñceva  sahetukañca dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Hetuñceva sahetukañca dhammaṃ  paṭicca naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Hetuñceva sahetukañca dhammaṃ paṭicca nahetu ceva naahetuko ca naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2498]='*Sahetukañceva na ca hetuṃ dhammaṃ paṭicca naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Sahetukañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Sahetukañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2499]='*Hetuñceva sahetukañca sahetukañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Hetuñceva sahetukañca sahetukañceva na ca hetuñca dhammaṃ paṭicca naahetuko ceva  nanahetu ca dhammo uppajjati hetupaccayā. Hetuñceva sahetukañca sahetukañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2500]='*Hetuyā nava. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2501]='*5. Hetuhetusampayuttadukaṃ*';
P_HTM[2502]='*1-7. Paṭiccavārādi*';
P_HTM[2503]='*7. Hetuñceva hetusampayuttañca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Hetuñceva hetusampayuttañca dhammaṃ paṭicca nahetuvippayutto ceva nanahetu ca  dhammo  uppajjati hetupaccayā. Hetuñceva hetusampayuttañca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetuvippayutto ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2504]='*Hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā. Hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetuvippayutto ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2505]='*Hetuñceva hetusampayuttañca hetusampayuttañceva na ca hetuñca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Hetuñceva hetusampayuttañca hetusampayuttañceva na ca hetuñca dhammaṃ paṭicca nahetuvippayutto ceva nanahetu dhammo ca uppajjati hetupaccayā. Hetuñceva hetusampayuttañca hetusampayuttañceva na ca hetuñca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetuvippayutto ceva nanahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2506]='*Hetuyā nava. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2507]='*6. Nahetusahetukadukaṃ*';
P_HTM[2508]='*1-7. Paṭiccavārādi*';
P_HTM[2509]='*8. Nahetuṃ  sahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2510]='*Hetuyā  nava. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2511]='*Hetugocchakaṃ niṭṭhitaṃ.*';
P_HTM[2512]='*7-8. Sappaccayadukādi*';
P_HTM[2513]='*1-7. Paṭiccavārādi*';
P_HTM[2514]='*9. Sappaccayaṃ  dhammaṃ paṭicca naappaccayo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā ekaṃ.*';
P_HTM[2515]='*10. Sappaccayo dhammo naappaccayassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[2516]='*Appaccayo dhammo naappaccayassa dhammassa ārammaṇapaccayena paccayo. (Saṅkhataṃ sappaccayasadisaṃ.)*';
P_HTM[2517]='*9. Sanidassanadukaṃ*';
P_HTM[2518]='*1-7. Paṭiccavārādi*';
P_HTM[2519]='*11. Anidassanaṃ dhammaṃ paṭicca naanidassano dhammo uppajjati hetupaccayā. Anidassanaṃ dhammaṃ paṭicca nasanidassano dhammo uppajjati hetupaccayā. Anidassanaṃ dhammaṃ paṭicca nasanidassano ca naanidassano ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2520]='*Hetuyā tīṇi. (Sabbattha vitthāro.)*';
P_HTM[2521]='*10. Sappaṭighadukaṃ*';
P_HTM[2522]='*1-7. Paṭiccavārādi*';
P_HTM[2523]='*12. Sappaṭighaṃ dhammaṃ paṭicca nasappaṭigho dhammo uppajjati hetupaccayā. Sappaṭighaṃ dhammaṃ paṭicca naappaṭigho dhammo uppajjati hetupaccayā. Sappaṭighaṃ dhammaṃ paṭicca nasappaṭigho ca naappaṭigho  ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2524]='*Appaṭighaṃ dhammaṃ paṭicca naappaṭigho dhammo uppajjati hetupaccayā. Appaṭighaṃ dhammaṃ paṭicca  nasappaṭigho dhammo uppajjati hetupaccayā. Appaṭighaṃ dhammaṃ paṭicca nasappaṭigho ca naappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2525]='*Sappaṭighañca  appaṭighañca dhammaṃ paṭicca nasappaṭigho dhammo uppajjati hetupaccayā. Sappaṭighañca appaṭighañca dhammaṃ paṭicca naappaṭigho dhammo uppajjati hetupaccayā. Sappaṭighañca appaṭighañca dhammaṃ paṭicca nasappaṭigho ca naappaṭigho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2526]='*Hetuyā nava. (Sabbattha vitthāro.)*';
P_HTM[2527]='*11. Rūpīdukaṃ*';
P_HTM[2528]='*1-7. Paṭiccavārādi*';
P_HTM[2529]='*13. Rūpiṃ dhammaṃ paṭicca narūpī dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2530]='*Hetuyā nava. (Sabbattha vitthāro.)*';
P_HTM[2531]='*12. Lokiyadukaṃ*';
P_HTM[2532]='*1-7. Paṭiccavārādi*';
P_HTM[2533]='*14. Lokiyaṃ dhammaṃ paṭicca nalokuttaro dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2534]='*Lokuttaraṃ dhammaṃ paṭicca nalokuttaro dhammo uppajjati hetupaccayā. Lokuttaraṃ dhammaṃ paṭicca nalokiyo dhammo uppajjati hetupaccayā. (Lokuttaraṃ dhammaṃ paṭicca nalokiyo ca nalokuttaro ca dhammā uppajjanti hetupaccayā.) *[ayaṃ saṅkhyā vicāretabbā, nalokiyanalokuttaradhammo nāma natthi]* (3)*';
P_HTM[2535]='*Lokiyañca lokuttarañca dhammaṃ paṭicca nalokuttaro dhammo uppajjati  hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[2536]='*Hetuyā pañca. (Sabbattha pañca.)*';
P_HTM[2537]='*13. Kenaciviññeyyadukaṃ*';
P_HTM[2538]='*1-7. Paṭiccavārādi*';
P_HTM[2539]='*15. Kenaci  viññeyyaṃ dhammaṃ paṭicca nakenaci viññeyyo dhammo uppajjati hetupaccayā. Kenaci viññeyyaṃ dhammaṃ paṭicca nanakenaci viññeyyo dhammo uppajjati hetupaccayā. Kenaci viññeyyaṃ dhammaṃ paṭicca nakenaci viññeyyo ca nanakenaci viññeyyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2540]='*Nakenaci viññeyyaṃ dhammaṃ paṭicca nanakenaci viññeyyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2541]='*Kenaci  viññeyyañca nakenaci viññeyyañca dhammaṃ paṭicca nakenaci viññeyyo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.) Hetuyā nava. (Sabbattha nava.)*';
P_HTM[2542]='*Cūḷantaradukaṃ niṭṭhitaṃ.*';
P_HTM[2543]='*14. Āsavadukaṃ*';
P_HTM[2544]='*1-7. Paṭiccavārādi*';
P_HTM[2545]='*16. Āsavaṃ dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Āsavaṃ dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā. Āsavaṃ dhammaṃ paṭicca noāsavo ca nanoāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2546]='*Noāsavaṃ dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā. Noāsavaṃ dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Noāsavaṃ dhammaṃ paṭicca noāsavo ca nanoāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2547]='*Āsavañca  noāsavañca dhammaṃ paṭicca  noāsavo dhammo uppajjati hetupaccayā. Āsavañca noāsavañca dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā. Āsavañca noāsavañca dhammaṃ paṭicca noāsavo ca nanoāsavo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.) Hetuyā nava. (Sabbattha nava.)*';
P_HTM[2548]='*15. Sāsavadukaṃ*';
P_HTM[2549]='*1-7. Paṭiccavārādi*';
P_HTM[2550]='*17. Sāsavaṃ dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2551]='*Anāsavaṃ dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. Anāsavaṃ dhammaṃ paṭicca nasāsavo dhammo uppajjati hetupaccayā. Anāsavaṃ dhammaṃ paṭicca nasāsavo ca naanāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2552]='*Sāsavañca anāsavañca dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[2553]='*Hetuyā pañca. (Sabbattha vitthāro.)*';
P_HTM[2554]='*16. Āsavasampayuttadukaṃ*';
P_HTM[2555]='*1-7. Paṭiccavārādi*';
P_HTM[2556]='*18. Āsavasampayuttaṃ  dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Āsavasampayuttaṃ dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Āsavasampayuttaṃ dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2557]='*Āsavavippayuttaṃ dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ  dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ  dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2558]='*Āsavasampayuttañca āsavavippayuttañca dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Āsavasampayuttañca āsavavippayuttañca dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Āsavasampayuttañca āsavavippayuttañca dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[2559]='*Hetuyā nava. (Sabbattha nava.)*';
P_HTM[2560]='*17. Āsavasāsavadukaṃ*';
P_HTM[2561]='*1-7. Paṭiccavārādi*';
P_HTM[2562]='*19. Āsavañceva sāsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā. Āsavañceva sāsavañca dhammaṃ paṭicca naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā. Āsavañceva sāsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca naanāsavo ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2563]='*Sāsavañceva no ca āsavaṃ dhammaṃ paṭicca naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2564]='*Āsavañceva sāsavañca sāsavañceva no ca āsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava. (Sabbattha nava.)*';
P_HTM[2565]='*18. Āsavaāsavasampayuttadukaṃ*';
P_HTM[2566]='*1-7. Paṭiccavārādi*';
P_HTM[2567]='*20. Āsavañceva  āsavasampayuttañca dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2568]='*Āsavasampayuttañceva no ca āsavaṃ dhammaṃ paṭicca naāsavavippayutto ceva nano ca āsavo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2569]='*Āsavañceva āsavasampayuttañca āsavavippayuttañceva no ca āsavañca dhammaṃ paṭicca noāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.) Hetuyā nava. (Sabbattha nava).*';
P_HTM[2570]='*19. Āsavavippayuttasāsavadukaṃ*';
P_HTM[2571]='*1-7. Paṭiccavārādi*';
P_HTM[2572]='*21. Āsavavippayuttaṃ sāsavaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2573]='*Āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2574]='*Āsavavippayuttaṃ sāsavañca āsavavippayuttaṃ anāsavañca dhammaṃ paṭicca āsavavippayutto nanoanāsavo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2575]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[2576]='*Āsavagocchakaṃ niṭṭhitaṃ.*';
P_HTM[2577]='*20-49. Saññojanadukādi*';
P_HTM[2578]='*1-7. Paṭiccavārādi*';
P_HTM[2579]='*22. Saññojanaṃ  dhammaṃ paṭicca nosaññojano dhammo uppajjati hetupaccayā…pe… ganthaṃ dhammaṃ paṭicca nogantho dhammo uppajjati  hetupaccayā…pe… oghaṃ dhammaṃ paṭicca noogho dhammo uppajjati hetupaccayā…pe… yogaṃ dhammaṃ paṭicca noyogo dhammo uppajjati hetupaccayā…pe… nīvaraṇaṃ dhammaṃ paṭicca nonīvaraṇo dhammo uppajjati hetupaccayā.*';
P_HTM[2580]='*50-54. Parāmāsadukāni*';
P_HTM[2581]='*1-7. Paṭiccavārādi*';
P_HTM[2582]='*23. Parāmāsaṃ dhammaṃ paṭicca noparāmāso dhammo uppajjati hetupaccayā. (Āsavagocchakasadisaṃ.)*';
P_HTM[2583]='*55. Sārammaṇadukaṃ*';
P_HTM[2584]='*1-7. Paṭiccavārādi*';
P_HTM[2585]='*24. Sārammaṇaṃ  dhammaṃ paṭicca nasārammaṇo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2586]='*Anārammaṇaṃ dhammaṃ paṭicca naanārammaṇo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2587]='*Sārammaṇañca anārammaṇañca dhammaṃ paṭicca nasārammaṇo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2588]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[2589]='*56. Cittadukaṃ*';
P_HTM[2590]='*1-7. Paṭiccavārādi*';
P_HTM[2591]='*25. Cittaṃ  dhammaṃ paṭicca nocitto dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[2592]='*Nocittaṃ dhammaṃ paṭicca nanocitto dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2593]='*Cittañca nocittañca dhammaṃ paṭicca nocitto dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ. Pañca).*';
P_HTM[2594]='*57-68. Cetasikadukādi*';
P_HTM[2595]='*1-7. Paṭiccavārādi*';
P_HTM[2596]='*26. Cetasikaṃ dhammaṃ paṭicca nacetasiko dhammo uppajjati hetupaccayā.*';
P_HTM[2597]='*27. Cittasampayuttaṃ dhammaṃ paṭicca nacittasampayutto dhammo uppajjati hetupaccayā…pe….*';
P_HTM[2598]='*Cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā.*';
P_HTM[2599]='*28. Cittasamuṭṭhānaṃ dhammaṃ  paṭicca nacittasamuṭṭhāno dhammo uppajjati hetupaccayā.*';
P_HTM[2600]='*29. Cittasahabhuṃ dhammaṃ paṭicca nacittasahabhū dhammo uppajjati hetupaccayā…pe… cittānuparivattiṃ dhammaṃ paṭicca nacittānuparivattī dhammo uppajjati hetupaccayā…pe… cittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā…pe… cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā…pe… cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā.*';
P_HTM[2601]='*30. Ajjhattikaṃ  dhammaṃ paṭicca naajjhattiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2602]='*Bāhiraṃ  dhammaṃ paṭicca nabāhiro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2603]='*Ajjhattikañca bāhirañca dhammaṃ paṭicca naajjhattiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2604]='*31. Upādā dhammaṃ paṭicca noupādā dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2605]='*Noupādā dhammaṃ paṭicca nanoupādā dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2606]='*Upādā ca noupādā ca dhammaṃ paṭicca noupādā dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2607]='*32. Upādinnaṃ dhammaṃ paṭicca naupādinno dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2608]='*Anupādinnaṃ dhammaṃ paṭicca naanupādinno dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2609]='*Upādinnañca anupādinnañca dhammaṃ paṭicca naupādinno dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[2610]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[2611]='*Mahantaradukaṃ niṭṭhitaṃ.*';
P_HTM[2612]='*69-74. Upādānagocchakaṃ*';
P_HTM[2613]='*33. Upādānaṃ dhammaṃ paṭicca noupādāno dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2614]='*75-82. Kilesagocchakaṃ*';
P_HTM[2615]='*34. Kilesaṃ dhammaṃ paṭicca nokileso dhammo  uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2616]='*83. Dassanenapahātabbadukaṃ*';
P_HTM[2617]='*35. Dassanena  pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nanadassanena pahātabbo  dhammo uppajjati hetupaccayā. Dassanena pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo ca nanadassanena pahātabbo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2618]='*Nadassanena pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2619]='*Dassanena pahātabbañca nadassanena pahātabbañca dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[2620]='*Hetuyā pañca…pe… avigate pañca.*';
P_HTM[2621]='*84. Bhāvanāyapahātabbadukaṃ*';
P_HTM[2622]='*36. Bhāvanāya pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Bhāvanāya pahātabbaṃ dhammaṃ paṭicca nanabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Bhāvanāya pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo ca nanabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2623]='*Nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2624]='*Bhāvanāya pahātabbañca nabhāvanāya pahātabbañca dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2625]='*Hetuyā pañca.*';
P_HTM[2626]='*85. Dassanenapahātabbahetukadukaṃ*';
P_HTM[2627]='*37. Dassanena  pahātabbahetukaṃ dhammaṃ paṭicca nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā. Dassanena pahātabbahetukaṃ  dhammaṃ paṭicca nanadassanena pahātabbahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2628]='*Hetuyā nava.*';
P_HTM[2629]='*86. Bhāvanāyapahātabbahetukadukaṃ*';
P_HTM[2630]='*38. Bhāvanāya  pahātabbahetukaṃ dhammaṃ paṭicca nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā. Bhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nanabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2631]='*87-88. Savitakkadukādi*';
P_HTM[2632]='*39. Savitakkaṃ dhammaṃ paṭicca nasavitakko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2633]='*Avitakkaṃ dhammaṃ paṭicca naavitakko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā nava.*';
P_HTM[2634]='*40. Savicāraṃ dhammaṃ paṭicca nasavicāro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2635]='*Avicāraṃ dhammaṃ paṭicca naavicāro dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā nava.*';
P_HTM[2636]='*89-92. Sappītikadukādi*';
P_HTM[2637]='*41. Sappītikaṃ  dhammaṃ paṭicca nasappītiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2638]='*Appītikaṃ dhammaṃ paṭicca naappītiko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2639]='*42. Pītisahagataṃ dhammaṃ paṭicca napītisahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2640]='*Napītisahagataṃ  dhammaṃ paṭicca nanapītisahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2641]='*43. Sukhasahagataṃ  dhammaṃ paṭicca nasukhasahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2642]='*Nasukhasahagataṃ dhammaṃ paṭicca nanasukhasahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2643]='*44. Upekkhāsahagataṃ dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2644]='*Naupekkhāsahagataṃ dhammaṃ paṭicca nanaupekkhāsahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2645]='*93-95. Kāmāvacarādidukāni*';
P_HTM[2646]='*45. Kāmāvacaraṃ  dhammaṃ paṭicca nakāmāvacaro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2647]='*Nakāmāvacaraṃ dhammaṃ paṭicca nanakāmāvacaro dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2648]='*46. Rūpāvacaraṃ dhammaṃ paṭicca narūpāvacaro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2649]='*Narūpāvacaraṃ dhammaṃ paṭicca nanarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2650]='*47. Arūpāvacaraṃ dhammaṃ paṭicca naarūpāvacaro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2651]='*Naarūpāvacaraṃ dhammaṃ paṭicca nanaarūpāvacaro dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2652]='*Arūpāvacarañca naarūpāvacarañca dhammaṃ paṭicca naarūpāvacaro dhammo uppajjati hetupaccayā. (1) Hetuyā pañca.*';
P_HTM[2653]='*96. Pariyāpannadukaṃ*';
P_HTM[2654]='*48. Pariyāpannaṃ  dhammaṃ paṭicca naapariyāpanno dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2655]='*Apariyāpannaṃ dhammaṃ paṭicca naapariyāpanno dhammo uppajjati hetupaccayā. Apariyāpannaṃ dhammaṃ paṭicca napariyāpanno dhammo uppajjati hetupaccayā. Apariyāpannaṃ dhammaṃ paṭicca  napariyāpanno ca naapariyāpanno ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2656]='*Pariyāpannañca apariyāpannañca dhammaṃ paṭicca naapariyāpanno dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.) Hetuyā pañca.*';
P_HTM[2657]='*97. Niyyānikadukaṃ*';
P_HTM[2658]='*49. Niyyānikaṃ dhammaṃ paṭicca naniyyāniko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2659]='*Aniyyānikaṃ dhammaṃ paṭicca naniyyāniko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2660]='*Niyyānikañca aniyyānikañca dhammaṃ paṭicca naniyyāniko dhammo uppajjati hetupaccayā. (1) Hetuyā pañca.*';
P_HTM[2661]='*98. Niyatadukaṃ*';
P_HTM[2662]='*50. Niyataṃ dhammaṃ paṭicca naniyato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[2663]='*Aniyataṃ dhammaṃ paṭicca naniyato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2664]='*Niyatañca aniyatañca dhammaṃ paṭicca naniyato dhammo uppajjati hetupaccayā. (1) Hetuyā pañca.*';
P_HTM[2665]='*99. Sauttaradukaṃ*';
P_HTM[2666]='*51. Sauttaraṃ dhammaṃ paṭicca naanuttaro dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2667]='*Anuttaraṃ dhammaṃ paṭicca naanuttaro dhammo uppajjati hetupaccayā. Anuttaraṃ dhammaṃ paṭicca nasauttaro dhammo uppajjati hetupaccayā. Anuttaraṃ dhammaṃ paṭicca nasauttaro ca naanuttaro ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2668]='*Sauttarañca  anuttarañca dhammaṃ paṭicca  naanuttaro dhammo uppajjati hetupaccayā. (1) Hetuyā pañca.*';
P_HTM[2669]='*100. Saraṇadukaṃ*';
P_HTM[2670]='*1-6. Paṭiccavārādi*';
P_HTM[2671]='*52. Saraṇaṃ dhammaṃ paṭicca nasaraṇo dhammo uppajjati hetupaccayā. Saraṇaṃ dhammaṃ paṭicca naaraṇo dhammo uppajjati hetupaccayā. Saraṇaṃ dhammaṃ paṭicca nasaraṇo ca naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2672]='*Araṇaṃ dhammaṃ paṭicca naaraṇo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2673]='*Saraṇañca araṇañca dhammaṃ paṭicca nasaraṇo dhammo uppajjati hetupaccayā. (1) Hetuyā pañca, ārammaṇe dve…pe… avigate pañca.*';
P_HTM[2674]='*Paccanīyaṃ*';
P_HTM[2675]='*Nahetupaccayo*';
P_HTM[2676]='*53. Saraṇaṃ dhammaṃ paṭicca nasaraṇo dhammo uppajjati nahetupaccayā. (1)*';
P_HTM[2677]='*Araṇaṃ dhammaṃ paṭicca nanaaraṇo dhammo uppajjati nahetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2678]='*Nahetuyā dve, na ārammaṇe tīṇi…pe… novigate tīṇi.*';
P_HTM[2679]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ vitthāretabbaṃ.)*';
P_HTM[2680]='*100. Saraṇadukaṃ*';
P_HTM[2681]='*7. Pañhāvāro*';
P_HTM[2682]='*54. Saraṇo dhammo nasaraṇassa dhammassa hetupaccayena paccayo. Saraṇo dhammo naaraṇassa dhammassa  hetupaccayena paccayo. Saraṇo dhammo nasaraṇassa ca naaraṇassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[2683]='*Araṇo dhammo nasaraṇassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[2684]='*55. Saraṇo  dhammo nasaraṇassa dhammassa ārammaṇapaccayena paccayo. Saraṇo dhammo naaraṇassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[2685]='*Hetuyā cattāri, ārammaṇe cattāri, adhipatiyā pañca, anantare cattāri…pe… avigate satta.*';
P_HTM[2686]='*Paccanīyuddhāro*';
P_HTM[2687]='*56. Saraṇo  dhammo nasaraṇassa dhammassa ārammaṇapaccayena paccayo, sahajātapaccayena paccayo, upanissayapaccayena paccayo, pacchājātapaccayena paccayo, kammapaccayena paccayo.*';
P_HTM[2688]='*Saraṇo dhammo naaraṇassa dhammassa ārammaṇapaccayena paccayo, sahajātapaccayena paccayo, upanissayapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[2689]='*57. Nahetuyā satta, naārammaṇe satta, naadhipatiyā satta, naanantare satta…pe… noavigate cattāri.*';
P_HTM[2690]='*Hetupaccayā naārammaṇe cattāri. (Saṃkhittaṃ.)*';
P_HTM[2691]='*Nahetupaccayā ārammaṇe cattāri. (Saṃkhittaṃ.)*';
P_HTM[2692]='*(Yathā kusalattike pañhāvāraṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[2693]='*Dhammānulomapaccanīye dukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[2694]='*Dhammānulomapaccanīye dukatikapaṭṭhānaṃ*';
P_HTM[2695]='*1-1. Hetuduka-kusalattikaṃ*';
P_HTM[2696]='*1. Kusalapadaṃ*';
P_HTM[2697]='*1-7. Paṭiccavārādi*';
P_HTM[2698]='*1. Hetuṃ  kusalaṃ dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā. Nahetuṃ kusalaṃ dhammaṃ paṭicca nanahetu nakusalo dhammo uppajjati hetupaccayā. Hetuṃ kusalañca nahetuṃ kusalañca dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā… tīṇi (cittasamuṭṭhānameva, ārammaṇaṃ natthi).*';
P_HTM[2699]='*Hetuyā tīṇi, adhipatiyā tīṇi…pe… avigate tīṇi.*';
P_HTM[2700]='*(Sahajātavārampi…pe… nissayavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2701]='*2. Hetu kusalo dhammo nahetussa nakusalassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[2702]='*Hetu kusalo dhammo nahetussa nakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2703]='*Nahetu kusalo dhammo nanahetussa nakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2704]='*Hetu  kusalo ca nahetu kusalo ca dhammā nahetussa nakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2705]='*3. Hetuyā  ekaṃ, ārammaṇe nava, adhipatiyā nava…pe… avigate tīṇi. (Pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2706]='*2. Akusalapadaṃ*';
P_HTM[2707]='*1-7. Paṭiccavārādi*';
P_HTM[2708]='*4. Hetuṃ  akusalaṃ dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2709]='*Nahetuṃ akusalaṃ dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2710]='*Hetuṃ akusalañca nahetuṃ akusalañca dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.) Hetuyā tīṇi, adhipatiyā tīṇi…pe… avigate tīṇi.*';
P_HTM[2711]='*(Sahajātavārampi…pe… nissayavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2712]='*5. Hetu akusalo dhammo nahetussa naakusalassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[2713]='*Hetu akusalo dhammo nahetussa naakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2714]='*Nahetu akusalo dhammo nanahetussa naakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[2715]='*Hetu akusalo ca nahetu akusalo ca dhammā nahetussa naakusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[2716]='*6. Hetuyā ekaṃ, ārammaṇe nava, adhipatiyā ekaṃ…pe… avigate tīṇi.*';
P_HTM[2717]='*3. Abyākatapadaṃ*';
P_HTM[2718]='*3. Paccayavāro*';
P_HTM[2719]='*7. Nahetuṃ  abyākataṃ dhammaṃ paccayā nanahetu naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Nissayavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2720]='*1-2. Hetuduka-vedanāttikaṃ*';
P_HTM[2721]='*8. Hetuṃ  sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2722]='*Nahetuṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2723]='*Hetuṃ sukhāya vedanāya sampayuttañca nahetuṃ sukhāya vedanāya sampayuttañca dhammaṃ paṭicca nahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.) Hetuyā tīṇi, ārammaṇe tīṇi…pe… avigate tīṇi.*';
P_HTM[2724]='*(Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[2725]='*9. Hetuṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi. (Sabbattha vitthāro.)*';
P_HTM[2726]='*10. Hetuṃ adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi. (Sabbattha vitthāro.)*';
P_HTM[2727]='*1-3. Hetuduka-vipākattikaṃ*';
P_HTM[2728]='*11. Hetuṃ  vipākaṃ dhammaṃ paṭicca nahetu navipāko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2729]='*Hetuṃ vipākadhammadhammaṃ paṭicca nahetu navipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2730]='*Nahetuṃ nevavipākanavipākadhammadhammaṃ paṭicca nanahetu nanevavipākanavipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2731]='*1-4. Hetuduka-upādinnattikaṃ*';
P_HTM[2732]='*12. Hetuṃ  upādinnupādāniyaṃ dhammaṃ paṭicca nahetu naupādinnupādāniyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2733]='*Nahetuṃ  anupādinnaanupādāniyaṃ dhammaṃ paṭicca nanahetu naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā.*';
P_HTM[2734]='*Hetuṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca nahetu naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2735]='*1-5. Hetuduka-saṃkiliṭṭhattikaṃ*';
P_HTM[2736]='*13. Hetuṃ saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nahetu nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2737]='*Nahetuṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nanahetu naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2738]='*Hetuṃ  asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nahetu naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2739]='*1-6. Hetuduka-vitakkattikaṃ*';
P_HTM[2740]='*14. Hetuṃ savitakkasavicāraṃ dhammaṃ paṭicca nahetu nasavitakkasavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2741]='*Hetuṃ avitakkavicāramattaṃ dhammaṃ paṭicca nahetu naavitakkavicāramatto dhammo uppajjati  hetupaccayā… hetuyā tīṇi.*';
P_HTM[2742]='*Nahetuṃ avitakkaavicāraṃ dhammaṃ paṭicca nanahetu naavitakkaavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2743]='*1-7. Hetuduka-pītittikaṃ*';
P_HTM[2744]='*15. Hetuṃ pītisahagataṃ dhammaṃ paṭicca nahetu napītisahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2745]='*Hetuṃ sukhasahagataṃ dhammaṃ paṭicca nahetu nasukhasahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2746]='*Hetuṃ upekkhāsahagataṃ dhammaṃ paṭicca nahetu naupekkhāsahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2747]='*1-8. Hetuduka-dassanattikaṃ*';
P_HTM[2748]='*16. Hetuṃ  dassanena pahātabbaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2749]='*Hetuṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca nahetu nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2750]='*Nahetuṃ  nevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paccayā nanahetu nanevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2751]='*1-9. Hetuduka-dassanahetuttikaṃ*';
P_HTM[2752]='*17. Hetuṃ dassanena pahātabbahetukaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2753]='*Hetuṃ bhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu nabhāvanāya pahātabbahetuko  dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2754]='*Hetuṃ nevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu nanevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2755]='*1-10. Hetuduka-ācayagāmittikaṃ*';
P_HTM[2756]='*18. Hetuṃ ācayagāmiṃ dhammaṃ paṭicca nahetu naācayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2757]='*Hetuṃ apacayagāmiṃ dhammaṃ paṭicca nahetu naapacayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2758]='*Nahetuṃ nevācayagāmināpacayagāmiṃ dhammaṃ paccayā nanahetu nanevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2759]='*1-11. Hetuduka-sekkhattikaṃ*';
P_HTM[2760]='*19. Hetuṃ sekkhaṃ dhammaṃ paṭicca nahetu nasekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2761]='*Hetuṃ  asekkhaṃ dhammaṃ paṭicca nahetu naasekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2762]='*Nahetuṃ  nevasekkhanāsekkhaṃ dhammaṃ paccayā nanahetu nanevasekkhanāsekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2763]='*1-12. Hetuduka-parittattikaṃ*';
P_HTM[2764]='*20. Nahetuṃ parittaṃ dhammaṃ paṭicca nanahetu naparitto dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2765]='*Hetuṃ mahaggataṃ dhammaṃ paṭicca nahetu namahaggato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2766]='*Hetuṃ appamāṇaṃ  dhammaṃ paṭicca nahetu naappamāṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2767]='*1-13. Hetuduka-parittārammaṇattikaṃ*';
P_HTM[2768]='*21. Hetuṃ parittārammaṇaṃ dhammaṃ paṭicca nahetu naparittārammaṇo dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2769]='*Hetuṃ mahaggatārammaṇaṃ dhammaṃ paṭicca nahetu namahaggatārammaṇo dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2770]='*Hetuṃ appamāṇārammaṇaṃ dhammaṃ paṭicca nahetu naappamāṇārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2771]='*1-14. Hetuduka-hīnattikaṃ*';
P_HTM[2772]='*22. Hetuṃ hīnaṃ dhammaṃ paṭicca nahetu nahīno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2773]='*Nahetuṃ majjhimaṃ dhammaṃ paccayā nanahetu namajjhimo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2774]='*Hetuṃ paṇītaṃ dhammaṃ paṭicca nahetu napaṇīto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2775]='*1-15. Hetuduka-micchattaniyatattikaṃ*';
P_HTM[2776]='*23. Hetuṃ  micchattaniyataṃ dhammaṃ paṭicca nahetu namicchattaniyato dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2777]='*Hetuṃ sammattaniyataṃ dhammaṃ paṭicca nahetu nasammattaniyato dhammo uppajjati hetupaccayā … (tīṇi).*';
P_HTM[2778]='*Nahetuṃ aniyataṃ dhammaṃ paccayā nanahetu naaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2779]='*1-16. Hetuduka-maggārammaṇattikaṃ*';
P_HTM[2780]='*24. Hetuṃ maggārammaṇaṃ dhammaṃ paṭicca nahetu namaggārammaṇo dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2781]='*Hetuṃ maggahetukaṃ dhammaṃ paṭicca nahetu namaggahetuko dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2782]='*Hetuṃ maggādhipatiṃ dhammaṃ paṭicca nahetu namaggādhipati dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2783]='*1-17. Hetuduka-uppannattikaṃ*';
P_HTM[2784]='*25. Hetu anuppanno dhammo nahetussa naanuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava, adhipatiyā upanissaye nava.*';
P_HTM[2785]='*Hetu uppādī dhammo nahetussa nauppādissa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava.*';
P_HTM[2786]='*1-18. Hetuduka-atītattikaṃ*';
P_HTM[2787]='*26. Hetu atīto dhammo nahetussa naatītassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava.*';
P_HTM[2788]='*Hetu  anāgato dhammo nahetussa naanāgatassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava.*';
P_HTM[2789]='*1-19. Hetuduka-atītārammaṇattikaṃ*';
P_HTM[2790]='*27. Hetuṃ  atītārammaṇaṃ dhammaṃ paṭicca nahetu naatītārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2791]='*Hetuṃ anāgatārammaṇaṃ dhammaṃ paṭicca nahetu naanāgatārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2792]='*Hetuṃ paccuppannārammaṇaṃ dhammaṃ paṭicca nahetu napaccuppannārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2793]='*1-20. Hetuduka-ajjhattārammaṇattikaṃ*';
P_HTM[2794]='*28. Hetuṃ ajjhattārammaṇaṃ dhammaṃ paṭicca nahetu naajjhattārammaṇo dhammo uppajjati hetupaccayā… (tīṇi).*';
P_HTM[2795]='*Hetuṃ bahiddhārammaṇaṃ dhammaṃ paṭicca nahetu nabahiddhārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2796]='*1-21. Hetuduka-sanidassanattikaṃ*';
P_HTM[2797]='*29. Nahetu sanidassanasappaṭigho dhammo nanahetussa nasanidassanasappaṭighassa dhammassa ārammaṇapaccayena paccayo…pe… nahetu sanidassanasappaṭigho dhammo nahetussa nasanidassanasappaṭighassa ca nanahetussa nasanidassanasappaṭighassa ca dhammassa ārammaṇapaccayena paccayo. Ārammaṇe tīṇi, adhipatiyā upanissaye purejāte atthiyā avigate tīṇi.*';
P_HTM[2798]='*Nahetuṃ  anidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ…pe… avigate ekaṃ.*';
P_HTM[2799]='*Hetuṃ  anidassanaappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuṃ anidassanaappaṭighañca nahetuṃ anidassanaappaṭighañca dhammaṃ paṭicca nahetu naanidassanaappaṭigho dhammo uppajjati hetupaccayā. (3) Hetuyā tīṇi.*';
P_HTM[2800]='*2-1. Sahetukaduka-kusalattikaṃ*';
P_HTM[2801]='*30. Sahetukaṃ  kusalaṃ dhammaṃ paṭicca nasahetuko nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2802]='*Sahetukaṃ akusalaṃ dhammaṃ paṭicca nasahetuko naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2803]='*Ahetukaṃ abyākataṃ dhammaṃ paccayā naahetuko naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2804]='*3-1. Hetusampayuttaduka-kusalattikaṃ*';
P_HTM[2805]='*31. Hetusampayuttaṃ kusalaṃ dhammaṃ paṭicca nahetusampayutto nakusalo  dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2806]='*Hetusampayuttaṃ akusalaṃ dhammaṃ paṭicca nahetusampayutto naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2807]='*Hetuvippayuttaṃ abyākataṃ dhammaṃ paccayā nahetuvippayutto naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2808]='*4-5-1. Hetusahetukādidukāni-kusalattikaṃ*';
P_HTM[2809]='*32. Hetu ceva sahetuko ca kusalo dhammo nahetussa ceva naahetukassa ca nakusalassa dhammassa ārammaṇapaccayena paccayo. Hetu ceva sahetuko ca kusalo dhammo naahetukassa ceva nana ca hetussa nakusalassa dhammassa ārammaṇapaccayena paccayo. Hetu ceva sahetuko  ca kusalo dhammo nahetussa ceva naahetukassa ca nakusalassa ca naahetukassa ceva nana ca hetussa nakusalassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[2810]='*Sahetuko ceva na ca hetu kusalo dhammo naahetukassa ceva nana ca hetussa nakusalassa dhammassa ārammaṇapaccayena paccayo. Sahetuko ceva na ca hetu kusalo dhammo nahetussa ceva naahetukassa ca nakusalassa dhammassa ārammaṇapaccayena paccayo. Sahetuko  ceva na ca hetu kusalo dhammo nahetussa ceva naahetukassa ca nakusalassa ca naahetukassa ceva nana ca hetussa nakusalassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[2811]='*Hetu ceva sahetuko kusalo ca sahetuko ceva na ca hetu kusalo  ca dhammā nahetussa ceva naahetukassa nakusalassa dhammassa ārammaṇapaccayena paccayo. Hetu ceva sahetuko kusalo ca sahetuko ceva na ca hetu kusalo ca dhammā naahetukassa ceva nana ca hetussa nakusalassa dhammassa ārammaṇapaccayena paccayo. Hetu ceva sahetuko kusalo ca sahetuko ceva na ca hetu kusalo ca dhammā nahetussa ceva naahetukassa nakusalassa ca naahetukassa ceva nana hetussa nakusalassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[2812]='*Ārammaṇe nava.*';
P_HTM[2813]='*33. Hetu ceva sahetuko ca akusalo dhammo nahetussa ceva naahetukassa naakusalassa ca dhammassa ārammaṇapaccayena paccayo. (Etena upāyena nava pañhā kātabbā.)*';
P_HTM[2814]='*34. Hetu ceva sahetuko ca abyākato dhammo nahetussa ceva naahetukassa ca naabyākatassa dhammassa ārammaṇapaccayena paccayo. (Nava pañhā kātabbā.) (Saṃkhittaṃ, hetuhetusampayuttadukaṃ hetusahetukadukasadisaṃ. Saṃkhittaṃ. Nava pañhā.)*';
P_HTM[2815]='*6-1. Nahetusahetukaduka-kusalattikaṃ*';
P_HTM[2816]='*35. Nahetuṃ  sahetukaṃ kusalaṃ dhammaṃ paṭicca nahetu nasahetuko nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2817]='*Nahetuṃ sahetukaṃ akusalaṃ dhammaṃ paṭicca nahetu nasahetuko naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2818]='*Nahetuṃ ahetukaṃ abyākataṃ dhammaṃ paccayā nahetu naahetuko naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2819]='*Hetugocchakaṃ niṭṭhitaṃ.*';
P_HTM[2820]='*7-8-1. Sappaccayādidukāni-kusalattikaṃ*';
P_HTM[2821]='*36. Sappaccayaṃ  kusalaṃ dhammaṃ paṭicca naappaccayo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2822]='*Sappaccayaṃ akusalaṃ dhammaṃ paṭicca naappaccayo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2823]='*Sappaccayaṃ abyākataṃ dhammaṃ paccayā naappaccayo naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ…pe… (saṃkhittaṃ sappaccayasadisaṃ).*';
P_HTM[2824]='*9-10-1. Sanidassanādidukāni-kusalattikaṃ*';
P_HTM[2825]='*37. Anidassanaṃ kusalaṃ dhammaṃ paṭicca naanidassano nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Akusalaṃ kusalasadisaṃ.)*';
P_HTM[2826]='*Anidassanaṃ abyākataṃ dhammaṃ paccayā nasanidassano naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2827]='*Appaṭighaṃ  kusalaṃ dhammaṃ paṭicca naappaṭigho nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2828]='*Appaṭighaṃ akusalaṃ dhammaṃ paṭicca naappaṭigho naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2829]='*Abyākato ekaṃ.*';
P_HTM[2830]='*11-1. Rūpīduka-kusalattikaṃ*';
P_HTM[2831]='*38. Arūpiṃ  kusalaṃ dhammaṃ paṭicca naarūpī nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2832]='*Arūpiṃ akusalaṃ dhammaṃ paṭicca naarūpī naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2833]='*Rūpiṃ abyākataṃ dhammaṃ paccayā narūpī naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2834]='*12-1. Lokiyaduka-kusalattikaṃ*';
P_HTM[2835]='*39. Lokiyaṃ kusalaṃ dhammaṃ paṭicca nalokuttaro nakusalo dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[2836]='*Lokiyaṃ  akusalaṃ dhammaṃ paṭicca nalokuttaro naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2837]='*Lokiyaṃ abyākataṃ dhammaṃ paccayā nalokiyo naabyākato dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[2838]='*13-1. Kenaciviññeyyaduka-kusalattikaṃ*';
P_HTM[2839]='*40. Kenaci viññeyyaṃ kusalaṃ dhammaṃ paṭicca nakenaci viññeyyo nakusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2840]='*Kenaci  viññeyyaṃ akusalaṃ dhammaṃ paṭicca nakenaci viññeyyo naakusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2841]='*Kenaci viññeyyaṃ abyākataṃ dhammaṃ paccayā nakenaci viññeyyo naabyākato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2842]='*Cūḷantaradukaṃ niṭṭhitaṃ.*';
P_HTM[2843]='*14-1. Āsavaduka-kusalattikaṃ*';
P_HTM[2844]='*41. Noāsavaṃ  kusalaṃ dhammaṃ paṭicca noāsavo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2845]='*Āsavaṃ akusalaṃ dhammaṃ paṭicca noāsavo naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2846]='*Noāsavaṃ abyākataṃ dhammaṃ paccayā nanoāsavo naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2847]='*15-1. Sāsavaduka-kusalattikaṃ*';
P_HTM[2848]='*42. Sāsavaṃ kusalaṃ dhammaṃ paṭicca naanāsavo nakusalo dhammo uppajjati hetupaccayā. Anāsavaṃ kusalaṃ dhammaṃ paṭicca naanāsavo nakusalo dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[2849]='*Sāsavaṃ akusalaṃ dhammaṃ paṭicca naanāsavo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2850]='*Sāsavaṃ  abyākataṃ dhammaṃ paccayā nasāsavo naabyākato dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[2851]='*16-1. Āsavasampayuttaduka-kusalattikaṃ*';
P_HTM[2852]='*43. Āsavavippayuttaṃ  kusalaṃ dhammaṃ paṭicca naāsavasampayutto nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2853]='*Āsavasampayuttaṃ akusalaṃ dhammaṃ paṭicca naāsavasampayutto naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2854]='*Āsavavippayuttaṃ abyākataṃ dhammaṃ paccayā naāsavasampayutto naabyākato dhammo uppajjati hetupaccayā … hetuyā tīṇi.*';
P_HTM[2855]='*17-18-1. Āsavasāsavādidukāni-kusalattikaṃ*';
P_HTM[2856]='*44. Sāsavañceva no ca āsavaṃ kusalaṃ dhammaṃ paṭicca naāsavo ceva naanāsavo ca nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2857]='*Āsavañceva sāsavañca akusalaṃ dhammaṃ paṭicca noāsavo ceva naanāsavo ca naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2858]='*Sāsavañceva no ca āsavaṃ abyākataṃ dhammaṃ paccayā naanāsavo ceva nano ca āsavo naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2859]='*(Āsavaāsavasampayuttadukaṃ āsavasāsavadukasadisaṃ.)*';
P_HTM[2860]='*19-1. Āsavavippayuttasāsavaduka-kusalattikaṃ*';
P_HTM[2861]='*45. Āsavavippayuttaṃ sāsavaṃ kusalaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo nakusalo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[2862]='*Āsavavippayuttaṃ anāsavaṃ kusalaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo nakusalo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[2863]='*Āsavavippayuttaṃ  sāsavaṃ akusalaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2864]='*Āsavavippayuttaṃ sāsavaṃ abyākataṃ dhammaṃ paccayā āsavavippayutto nasāsavo naabyākato dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ  sāsavaṃ abyākataṃ dhammaṃ paccayā āsavavippayutto naanāsavo naabyākato dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[2865]='*Āsavagocchakaṃ niṭṭhitaṃ.*';
P_HTM[2866]='*20-54-1. Saññojanādidukāni-kusalattikaṃ*';
P_HTM[2867]='*46. Nosaññojanaṃ kusalaṃ dhammaṃ paṭicca nosaññojano nakusalo dhammo uppajjati hetupaccayā…pe… noganthaṃ kusalaṃ dhammaṃ paṭicca nogantho nakusalo dhammo uppajjati hetupaccayā…pe… nooghaṃ kusalaṃ dhammaṃ paṭicca noogho nakusalo dhammo uppajjati hetupaccayā…pe… noyogaṃ kusalaṃ dhammaṃ paṭicca noyogo nakusalo dhammo uppajjati hetupaccayā…pe… nonīvaraṇaṃ kusalaṃ dhammaṃ paṭicca nonīvaraṇo nakusalo dhammo uppajjati hetupaccayā…pe… noparāmāsaṃ kusalaṃ dhammaṃ paṭicca noparāmāso nakusalo dhammo uppajjati hetupaccayā.*';
P_HTM[2868]='*55-1. Sārammaṇaduka-kusalattikaṃ*';
P_HTM[2869]='*47. Sārammaṇaṃ kusalaṃ dhammaṃ paṭicca nasārammaṇo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2870]='*Sārammaṇaṃ akusalaṃ dhammaṃ paṭicca nasārammaṇo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2871]='*Anārammaṇaṃ abyākataṃ dhammaṃ paccayā naanārammaṇo naabyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2872]='*56-1. Cittaduka-kusalattikaṃ*';
P_HTM[2873]='*48. Cittaṃ  kusalaṃ dhammaṃ paṭicca nacitto nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2874]='*Cittaṃ  akusalaṃ dhammaṃ paṭicca nacitto naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2875]='*Nocittaṃ abyākataṃ dhammaṃ paccayā nanocitto naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2876]='*57-1. Cetasikaduka-kusalattikaṃ*';
P_HTM[2877]='*49. Cetasikaṃ kusalaṃ dhammaṃ paṭicca nacetasiko nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2878]='*Cetasikaṃ akusalaṃ dhammaṃ paṭicca nacetasiko naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2879]='*Acetasikaṃ abyākataṃ dhammaṃ paccayā naacetasiko naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2880]='*58-1. Cittasampayuttaduka-kusalattikaṃ*';
P_HTM[2881]='*50. Cittasampayuttaṃ kusalaṃ dhammaṃ paṭicca nacittasampayutto nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2882]='*Cittasampayuttaṃ akusalaṃ dhammaṃ paṭicca nacittasampayutto naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2883]='*59-1. Cittasaṃsaṭṭhaduka-kusalattikaṃ*';
P_HTM[2884]='*51. Cittasaṃsaṭṭhaṃ  kusalaṃ dhammaṃ paṭicca nacittasaṃsaṭṭho nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2885]='*Cittasaṃsaṭṭhaṃ akusalaṃ dhammaṃ paṭicca nacittasaṃsaṭṭho naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2886]='*60-1. Cittasamuṭṭhānaduka-kusalattikaṃ*';
P_HTM[2887]='*52. Cittasamuṭṭhānaṃ kusalaṃ dhammaṃ paṭicca nanocittasamuṭṭhāno nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2888]='*Cittasamuṭṭhānaṃ  akusalaṃ dhammaṃ paṭicca nanocittasamuṭṭhāno naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2889]='*61-1. Cittasahabhūduka-kusalattikaṃ*';
P_HTM[2890]='*53. Cittasahabhuṃ kusalaṃ dhammaṃ paṭicca nocittasahabhū nakusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2891]='*Cittasahabhuṃ akusalaṃ dhammaṃ paṭicca nocittasahabhū naakusalo dhammo uppajjati hetupaccayā… hetuyā nava. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2892]='*62-1. Cittānuparivattiduka-kusalattikaṃ*';
P_HTM[2893]='*54. Cittānuparivattiṃ  kusalaṃ dhammaṃ paṭicca nocittānuparivattī nakusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[2894]='*Cittānuparivattiṃ akusalaṃ dhammaṃ paṭicca nocittānuparivattī naakusalo dhammo uppajjati hetupaccayā… hetuyā nava. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2895]='*63-1. Cittasaṃsaṭṭhasamuṭṭhānaduka-kusalattikaṃ*';
P_HTM[2896]='*55. Cittasaṃsaṭṭhasamuṭṭhānaṃ  kusalaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhāno nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2897]='*Cittasaṃsaṭṭhasamuṭṭhānaṃ akusalaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhāno naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2898]='*64-1. Cittasaṃsaṭṭhasamuṭṭhānasahabhūduka-kusalattikaṃ*';
P_HTM[2899]='*56. Cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ kusalaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānasahabhū nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2900]='*Cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ akusalaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānasahabhū naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva paccayavasena.)*';
P_HTM[2901]='*65-1. Cittasaṃsaṭṭhasamuṭṭhānānuparivattiduka-kusalattikaṃ*';
P_HTM[2902]='*57. Cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ  kusalaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānānuparivattī nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2903]='*Cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ akusalaṃ dhammaṃ paṭicca  nocittasaṃsaṭṭhasamuṭṭhānānuparivattī naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva.)*';
P_HTM[2904]='*66-1. Ajjhattikaduka-kusalattikaṃ*';
P_HTM[2905]='*58. Ajjhattikaṃ kusalaṃ dhammaṃ paṭicca naajjhattiko nakusalo dhammo uppajjati hetupaccayā. Bāhiraṃ kusalaṃ dhammaṃ paṭicca naajjhattiko nakusalo dhammo uppajjati hetupaccayā. Ajjhattikaṃ kusalañca bāhiraṃ kusalañca dhammaṃ paṭicca naajjhattiko nakusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[2906]='*Ajjhattikaṃ  akusalaṃ dhammaṃ paṭicca naajjhattiko naakusalo dhammo uppajjati hetupaccayā. Bāhiraṃ akusalaṃ dhammaṃ paṭicca naajjhattiko naakusalo dhammo uppajjati hetupaccayā. Ajjhattikaṃ akusalañca bāhiraṃ akusalañca dhammaṃ paṭicca naajjhattiko naakusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva.)*';
P_HTM[2907]='*67-1. Upādāduka-kusalattikaṃ*';
P_HTM[2908]='*59. Noupādā kusalaṃ dhammaṃ paṭicca nanoupādā nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2909]='*Noupādā akusalaṃ dhammaṃ paṭicca nanoupādā naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Abyākatamūlaṃ ekaṃyeva.)*';
P_HTM[2910]='*68-1. Upādinnaduka-kusalattikaṃ*';
P_HTM[2911]='*60. Anupādinnaṃ kusalaṃ dhammaṃ paṭicca naupādinno nakusalo dhammo  uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2912]='*Anupādinnaṃ  akusalaṃ dhammaṃ paṭicca naupādinno naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ ekaṃyeva.)*';
P_HTM[2913]='*Mahantaradukaṃ niṭṭhitaṃ.*';
P_HTM[2914]='*69-82-1. Dvigocchakāni-kusalattikaṃ*';
P_HTM[2915]='*61. Noupādānaṃ kusalaṃ dhammaṃ paṭicca noupādāno nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2916]='*Upādānaṃ  akusalaṃ dhammaṃ paṭicca noupādāno naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[2917]='*Nokilesaṃ kusalaṃ dhammaṃ paṭicca nokileso nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Saṃkhittaṃ.)*';
P_HTM[2918]='*83-1. Dassanenapahātabbaduka-kusalattikaṃ*';
P_HTM[2919]='*62. Nadassanena pahātabbaṃ kusalaṃ dhammaṃ paṭicca nadassanena pahātabbo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
