P_HTM[2940]='*68. Sappītikaṃ  kusalaṃ dhammaṃ paṭicca nasappītiko nakusalo dhammo uppajjati hetupaccayā. Appītikaṃ kusalaṃ dhammaṃ paṭicca nasappītiko nakusalo dhammo uppajjati hetupaccayā. Sappītikaṃ kusalañca appītikaṃ kusalañca dhammaṃ paṭicca nasappītiko nakusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
