P_HTM[2946]='*70. Sukhasahagataṃ kusalaṃ dhammaṃ paṭicca nasukhasahagato nakusalo dhammo uppajjati hetupaccayā. Nasukhasahagataṃ kusalaṃ dhammaṃ paṭicca nasukhasahagato nakusalo dhammo uppajjati hetupaccayā. Sukhasahagataṃ kusalañca nasukhasahagataṃ kusalañca dhammaṃ paṭicca nasukhasahagato nakusalo dhammo  uppajjati hetupaccayā. Hetuyā tīṇi.*';
