P_HTM[2948]='*92-1. Upekkhāsahagataduka-kusalattikaṃ*';
P_HTM[2949]='*71. Upekkhāsahagataṃ  kusalaṃ dhammaṃ paṭicca naupekkhāsahagato nakusalo dhammo uppajjati hetupaccayā. Naupekkhāsahagataṃ kusalaṃ dhammaṃ paṭicca naupekkhāsahagato nakusalo dhammo uppajjati hetupaccayā. Upekkhāsahagataṃ kusalañca naupekkhāsahagataṃ kusalañca dhammaṃ paṭicca naupekkhāsahagato nakusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[2950]='*Upekkhāsahagataṃ akusalaṃ dhammaṃ paṭicca naupekkhāsahagato naakusalo dhammo uppajjati hetupaccayā. Naupekkhāsahagataṃ akusalaṃ dhammaṃ paṭicca naupekkhāsahagato naakusalo dhammo uppajjati hetupaccayā. Upekkhāsahagataṃ akusalañca naupekkhāsahagataṃ akusalañca dhammaṃ paṭicca naupekkhāsahagato naakusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi. (Abyākatamūlaṃ tīṇiyeva.)*';
