P_HTM[2952]='*72. Kāmāvacaraṃ kusalaṃ dhammaṃ paṭicca nanakāmāvacaro nakusalo dhammo uppajjati hetupaccayā. Nakāmāvacaraṃ kusalaṃ dhammaṃ paṭicca nanakāmāvacaro nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
