P_HTM[2957]='*95-1. Arūpāvacaraduka-kusalattikaṃ*';
P_HTM[2958]='*74. Arūpāvacaraṃ kusalaṃ dhammaṃ paṭicca naarūpāvacaro nakusalo dhammo uppajjati hetupaccayā. Naarūpāvacaraṃ kusalaṃ dhammaṃ paṭicca naarūpāvacaro nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2959]='*Naarūpāvacaraṃ  akusalaṃ dhammaṃ paṭicca naarūpāvacaro naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ dve.)*';
P_HTM[2960]='*96-1. Pariyāpannaduka-kusalattikaṃ*';
P_HTM[2961]='*75. Pariyāpannaṃ kusalaṃ dhammaṃ paṭicca naapariyāpanno nakusalo dhammo uppajjati hetupaccayā. Apariyāpannaṃ kusalaṃ dhammaṃ paṭicca naapariyāpanno nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2962]='*Pariyāpannaṃ akusalaṃ dhammaṃ paṭicca naapariyāpanno naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ dve.)*';
P_HTM[2963]='*97-1. Niyyānikaduka-kusalattikaṃ*';
P_HTM[2964]='*76. Niyyānikaṃ  kusalaṃ dhammaṃ paṭicca naniyyāniko nakusalo dhammo uppajjati hetupaccayā. Aniyyānikaṃ kusalaṃ dhammaṃ paṭicca naniyyāniko nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2965]='*Aniyyānikaṃ akusalaṃ dhammaṃ paṭicca naniyyāniko naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūlaṃ dve.)*';
P_HTM[2966]='*98-1. Niyataduka-kusalattikaṃ*';
P_HTM[2967]='*77. Niyataṃ  kusalaṃ dhammaṃ paṭicca naniyato nakusalo dhammo uppajjati hetupaccayā. Aniyataṃ kusalaṃ dhammaṃ paṭicca naniyato nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2968]='*Niyataṃ akusalaṃ dhammaṃ paṭicca naniyato naakusalo dhammo uppajjati hetupaccayā. Aniyataṃ akusalaṃ dhammaṃ paṭicca naniyato naakusalo dhammo uppajjati hetupaccayā. Hetuyā dve. (Abyākatamūle dve.)*';
P_HTM[2969]='*99-1. Sauttaraduka-kusalattikaṃ*';
P_HTM[2970]='*78. Sauttaraṃ kusalaṃ dhammaṃ paṭicca naanuttaro nakusalo dhammo uppajjati hetupaccayā. Anuttaraṃ kusalaṃ dhammaṃ paṭicca naanuttaro nakusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2971]='*Sauttaraṃ akusalaṃ dhammaṃ paṭicca naanuttaro naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Abyākatamūle dve.)*';
P_HTM[2972]='*100-1. Saraṇaduka-kusalattikaṃ*';
P_HTM[2973]='*79. Araṇaṃ  kusalaṃ dhammaṃ paṭicca nasaraṇo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2974]='*Saraṇaṃ akusalaṃ dhammaṃ paṭicca nasaraṇo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2975]='*Araṇaṃ abyākataṃ dhammaṃ paccayā naaraṇo naabyākato dhammo uppajjati hetupaccayā. Araṇaṃ abyākataṃ dhammaṃ paccayā nasaraṇo naabyākato dhammo uppajjati hetupaccayā. Hetuyā dve. (Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[2976]='*80. Araṇo abyākato dhammo naaraṇassa naabyākatassa dhammassa ārammaṇapaccayena paccayo. Araṇo abyākato dhammo nasaraṇassa naabyākatassa dhammassa ārammaṇapaccayena paccayo. (2)*';
P_HTM[2977]='*Ārammaṇe  dve…pe… avigate dve.*';
P_HTM[2978]='*100-2. Saraṇaduka-vedanāttikaṃ*';
P_HTM[2979]='*81. Saraṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Saraṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Saraṇaṃ sukhāya vedanāya sampayuttaṃ  dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto ca naaraṇo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2980]='*Araṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2981]='*Hetuyā cattāri.*';
P_HTM[2982]='*82. Saraṇaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2983]='*Hetuyā tīṇi.*';
P_HTM[2984]='*Saraṇaṃ  adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā….*';
P_HTM[2985]='*Hetuyā cattāri.*';
P_HTM[2986]='*100-3. Saraṇaduka-vipākattikaṃ*';
P_HTM[2987]='*83. Araṇaṃ vipākaṃ dhammaṃ paṭicca nasaraṇo navipāko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2988]='*Saraṇaṃ vipākadhammadhammaṃ paṭicca nasaraṇo navipākadhammadhammo uppajjati hetupaccayā. Araṇaṃ vipākadhammadhammaṃ paṭicca nasaraṇo navipākadhammadhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2989]='*Araṇaṃ  nevavipākanavipākadhammadhammaṃ paṭicca nasaraṇo nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
