P_HTM[2991]='*84. Araṇaṃ upādinnupādāniyaṃ dhammaṃ paṭicca nasaraṇo naupādinnupādāniyo  dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2992]='*Araṇaṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca nasaraṇo naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2993]='*100-5. Saraṇaduka-saṃkiliṭṭhattikaṃ*';
P_HTM[2994]='*85. Saraṇaṃ saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nasaraṇo nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2995]='*Araṇaṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā naaraṇo naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Araṇaṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā nasaraṇo naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[2996]='*Araṇaṃ asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nasaraṇo naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
