P_HTM[3002]='*100-7. Saraṇaduka-pītittikaṃ*';
P_HTM[3003]='*88. Saraṇaṃ  pītisahagataṃ dhammaṃ paṭicca nasaraṇo napītisahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3004]='*Araṇaṃ pītisahagataṃ dhammaṃ paṭicca nasaraṇo napītisahagato dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3005]='*Saraṇaṃ sukhasahagataṃ dhammaṃ paṭicca nasaraṇo nasukhasahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3006]='*Araṇaṃ sukhasahagataṃ dhammaṃ paṭicca nasaraṇo nasukhasahagato dhammo uppajjati hetupaccayā. Ekaṃ.*';
