P_HTM[3008]='*100-8. Saraṇaduka-dassanattikaṃ*';
P_HTM[3009]='*89. Saraṇaṃ dassanena pahātabbaṃ dhammaṃ paṭicca nasaraṇo nadassanena pahātabbo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
