P_HTM[3015]='*Araṇaṃ nevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca naaraṇo nanevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
