P_HTM[3017]='*91. Saraṇaṃ ācayagāmiṃ dhammaṃ paṭicca nasaraṇo naācayagāmī dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[3018]='*Araṇaṃ apacayagāmiṃ dhammaṃ paṭicca nasaraṇo naapacayagāmī dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
