P_HTM[3021]='*92. Araṇaṃ sekkhaṃ dhammaṃ paṭicca nasaraṇo nasekkho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3022]='*Araṇaṃ  asekkhaṃ dhammaṃ paṭicca nasaraṇo naasekkho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3023]='*Araṇaṃ  nevasekkhanāsekkhaṃ dhammaṃ paccayā nasaraṇo nanevasekkhanāsekkho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3024]='*100-12. Saraṇaduka-parittattikaṃ*';
P_HTM[3025]='*93. Araṇaṃ  parittaṃ dhammaṃ paṭicca nasaraṇo naparitto dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3026]='*Araṇaṃ mahaggataṃ dhammaṃ paṭicca nasaraṇo namahaggato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3027]='*Araṇaṃ appamāṇaṃ dhammaṃ paṭicca nasaraṇo naappamāṇo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3028]='*100-13. Saraṇaduka-parittārammaṇattikaṃ*';
P_HTM[3029]='*94. Saraṇaṃ parittārammaṇaṃ dhammaṃ paṭicca nasaraṇo naparittārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ parittārammaṇaṃ dhammaṃ paṭicca nasaraṇo naparittārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3030]='*Saraṇaṃ mahaggatārammaṇaṃ dhammaṃ paṭicca nasaraṇo namahaggatārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ mahaggatārammaṇaṃ dhammaṃ paṭicca nasaraṇo namahaggatārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3031]='*Araṇaṃ appamāṇārammaṇaṃ dhammaṃ paṭicca nasaraṇo naappamāṇārammaṇo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3032]='*100-14. Saraṇaduka-hīnattikaṃ*';
P_HTM[3033]='*95. Saraṇaṃ hīnaṃ dhammaṃ paṭicca nasaraṇo nahīno dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3034]='*Araṇaṃ  majjhimaṃ dhammaṃ paccayā naaraṇo namajjhimo dhammo uppajjati hetupaccayā. Araṇaṃ majjhimaṃ dhammaṃ paccayā nasaraṇo namajjhimo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3035]='*Araṇaṃ paṇītaṃ dhammaṃ paṭicca nasaraṇo napaṇīto dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3036]='*100-15. Saraṇaduka-micchattaniyatattikaṃ*';
P_HTM[3037]='*96. Saraṇaṃ  micchattaniyataṃ dhammaṃ paṭicca nasaraṇo namicchattaniyato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3038]='*Araṇaṃ sammattaniyataṃ dhammaṃ paṭicca nasaraṇo nasammattaniyato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3039]='*Araṇaṃ aniyataṃ dhammaṃ paccayā naaraṇo naaniyato dhammo uppajjati hetupaccayā. Araṇaṃ aniyataṃ dhammaṃ paccayā nasaraṇo naaniyato dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3040]='*100-16. Saraṇaduka-maggārammaṇattikaṃ*';
P_HTM[3041]='*97. Araṇaṃ maggārammaṇaṃ dhammaṃ paṭicca nasaraṇo namaggārammaṇo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3042]='*Araṇaṃ maggahetukaṃ dhammaṃ paṭicca nasaraṇo namaggahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3043]='*Araṇaṃ maggādhipatiṃ dhammaṃ paṭicca nasaraṇo namaggādhipati dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3044]='*100-17. Saraṇaduka-uppannattikaṃ*';
P_HTM[3045]='*98. Saraṇo anuppanno dhammo nasaraṇassa naanuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cattāri.*';
P_HTM[3046]='*Araṇo  uppādī dhammo naaraṇassa nauppādissa dhammassa ārammaṇapaccayena paccayo. Araṇo uppādī dhammo nasaraṇassa nauppādissa dhammassa ārammaṇapaccayena paccayo. Ārammaṇe dve.*';
P_HTM[3047]='*100-18. Saraṇaduka-atītattikaṃ*';
P_HTM[3048]='*99. Saraṇo atīto dhammo nasaraṇassa naatītassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cattāri. (Anāgato atītasadiso.)*';
P_HTM[3049]='*100-19. Saraṇaduka-atītārammaṇattikaṃ*';
P_HTM[3050]='*100. Saraṇaṃ  atītārammaṇaṃ dhammaṃ paṭicca nasaraṇo naatītārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ atītārammaṇaṃ dhammaṃ paṭicca nasaraṇo naatītārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3051]='*Saraṇaṃ anāgatārammaṇaṃ dhammaṃ paṭicca nasaraṇo naanāgatārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ anāgatārammaṇaṃ dhammaṃ paṭicca nasaraṇo naanāgatārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3052]='*Saraṇaṃ paccuppannārammaṇaṃ dhammaṃ paṭicca nasaraṇo napaccuppannārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ paccuppannārammaṇaṃ dhammaṃ paṭicca nasaraṇo napaccuppannārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3053]='*100-21. Saraṇaduka-ajjhattārammaṇattikaṃ*';
P_HTM[3054]='*101. Saraṇaṃ ajjhattārammaṇaṃ dhammaṃ paṭicca nasaraṇo naajjhattārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ ajjhattārammaṇaṃ dhammaṃ paṭicca nasaraṇo naajjhattārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3055]='*Saraṇaṃ  bahiddhārammaṇaṃ dhammaṃ paṭicca nasaraṇo nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ bahiddhārammaṇaṃ dhammaṃ paṭicca nasaraṇo nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3056]='*100-22. Saraṇaduka-sanidassanattikaṃ*';
P_HTM[3057]='*102. Araṇaṃ  anidassanasappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. (Ekaṃ.)*';
P_HTM[3058]='*Saraṇaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Araṇaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Saraṇaṃ anidassanaappaṭighañca araṇaṃ anidassanaappaṭighañca dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. (3)*';
P_HTM[3059]='*Hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[3060]='*Nahetu-naārammaṇapaccayā*';
P_HTM[3061]='*103. Araṇaṃ  anidassanaappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati nahetupaccayā. (1)*';
P_HTM[3062]='*Saraṇaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nasaraṇo naanidassanaappaṭigho dhammo uppajjati naārammaṇapaccayā.*';
P_HTM[3063]='*Nahetuyā ekaṃ, naārammaṇe tīṇi…pe… novigate tīṇi.*';
P_HTM[3064]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[3065]='*104. Saraṇo anidassanaappaṭigho dhammo nasaraṇassa naanidassanaappaṭighassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[3066]='*Araṇo  anidassanaappaṭigho dhammo nasaraṇassa naanidassanaappaṭighassa dhammassa  hetupaccayena paccayo. (1)*';
P_HTM[3067]='*Hetuyā dve, adhipatiyā dve…pe… avigate tīṇi.*';
P_HTM[3068]='*Paccanīyuddhāro*';
P_HTM[3069]='*105. Saraṇo anidassanaappaṭigho dhammo nasaraṇassa naanidassanaappaṭighassa dhammassa sahajātapaccayena paccayo, pacchājātapaccayena paccayo, kammapaccayena paccayo. (Saṃkhittaṃ.) Nahetuyā tīṇi, naārammaṇe tīṇi…pe… noavigate tīṇi.*';
P_HTM[3070]='*(Yathā kusalattike pañhāvāraṃ, evaṃ vitthāretabbaṃ.)*';
P_HTM[3071]='*Dhammānulomapaccanīye dukatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3072]='*Dhammānulomapaccanīye tikadukapaṭṭhānaṃ*';
P_HTM[3073]='*1-1. Kusalattika-hetudukaṃ*';
P_HTM[3074]='*1-7. Paṭiccavārādi*';
P_HTM[3075]='*Paccayacatukkaṃ*';
P_HTM[3076]='*Hetupaccayo*';
P_HTM[3077]='*1. Kusalaṃ  hetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[3078]='*Akusalaṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati  hetupaccayā. Akusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Akusalaṃ hetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Akusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Akusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[3079]='*Abyākataṃ  hetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Abyākataṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Abyākataṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[3080]='*Hetuyā terasa, ārammaṇe nava…pe… avigate terasa.*';
P_HTM[3081]='*Paccanīyaṃ*';
P_HTM[3082]='*Naārammaṇapaccayo*';
P_HTM[3083]='*2. Kusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati naārammaṇapaccayā. (Saṃkhittaṃ.)*';
P_HTM[3084]='*Naārammaṇe nava, naadhipatiyā terasa…pe… navippayutte nava.*';
P_HTM[3085]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ vitthāretabbaṃ.)*';
P_HTM[3086]='*Hetu-ārammaṇapaccayā*';
P_HTM[3087]='*3. Kusalo hetu dhammo nakusalassa nahetussa dhammassa hetupaccayena paccayo. Kusalo hetu dhammo naakusalassa nahetussa dhammassa  hetupaccayena paccayo. Kusalo hetu dhammo naabyākatassa nahetussa dhammassa hetupaccayena paccayo. Kusalo hetu dhammo naakusalassa nahetussa ca naabyākatassa nahetussa ca dhammassa hetupaccayena paccayo. Kusalo hetu dhammo nakusalassa nahetussa ca naakusalassa nahetussa ca dhammassa hetupaccayena paccayo. (5)*';
P_HTM[3088]='*Akusalo hetu dhammo naakusalassa nahetussa dhammassa hetupaccayena paccayo… pañca.*';
P_HTM[3089]='*Abyākato hetu dhammo nakusalassa nahetussa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[3090]='*Kusalo hetu dhammo nakusalassa nahetussa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[3091]='*4. Hetuyā  terasa, ārammaṇe aṭṭhārasa…pe… avigate terasa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[3092]='*5. Kusalaṃ  nahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā. Kusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3093]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[3094]='*1-2. Kusalattika-sahetukadukaṃ*';
P_HTM[3095]='*1-7. Paṭiccavārādi*';
P_HTM[3096]='*Paccayacatukkaṃ*';
P_HTM[3097]='*Hetupaccayo*';
P_HTM[3098]='*6. Kusalaṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā. Kusalaṃ sahetukaṃ dhammaṃ paṭicca naakusalo nasahetuko dhammo uppajjati hetupaccayā. Kusalaṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko ca naakusalo nasahetuko ca dhammā uppajjanti  hetupaccayā. Tīṇi.*';
P_HTM[3099]='*Akusalaṃ sahetukaṃ dhammaṃ paṭicca naakusalo nasahetuko dhammo uppajjati hetupaccayā. Akusalaṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā. Akusalaṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko ca naakusalo nasahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3100]='*Abyākataṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā. Abyākataṃ sahetukaṃ dhammaṃ paṭicca naakusalo nasahetuko dhammo uppajjati hetupaccayā. Abyākataṃ sahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko ca naakusalo nasahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3101]='*Hetuyā  nava, ārammaṇe tīṇi…pe… avigate ekādasa. (Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[3102]='*7. Kusalo sahetuko dhammo nakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Kusalo sahetuko dhammo naakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Kusalo sahetuko dhammo nakusalassa nasahetukassa ca naakusalassa nasahetukassa ca dhammassa hetupaccayena paccayo. Tīṇi.*';
P_HTM[3103]='*Akusalo  sahetuko dhammo naakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Akusalo sahetuko dhammo nakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Akusalo sahetuko dhammo nakusalassa nasahetukassa ca naakusalassa  nasahetukassa ca dhammassa hetupaccayena paccayo. Tīṇi.*';
P_HTM[3104]='*Abyākato sahetuko dhammo nakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Abyākato sahetuko dhammo naakusalassa nasahetukassa dhammassa hetupaccayena paccayo. Abyākato sahetuko dhammo nakusalassa nasahetukassa ca naakusalassa nasahetukassa ca dhammassa hetupaccayena paccayo. Tīṇi. (Saṃkhittaṃ.)*';
P_HTM[3105]='*8. Hetuyā nava, ārammaṇe pannarasa…pe… avigate ekādasa.*';
P_HTM[3106]='*9. Akusalaṃ ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā. Akusalaṃ ahetukaṃ dhammaṃ paṭicca naabyākato naahetuko dhammo uppajjati hetupaccayā. Akusalaṃ ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko ca naabyākato naahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3107]='*Abyākataṃ ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ ahetukaṃ dhammaṃ paṭicca naakusalo naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ  ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko ca naakusalo naahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3108]='*Hetuyā cha, ārammaṇe cha…pe… avigate cha.*';
P_HTM[3109]='*1-3. Kusalattika-hetusampayuttadukaṃ*';
P_HTM[3110]='*10. Kusalaṃ  hetusampayuttaṃ dhammaṃ paṭicca nakusalo nahetusampayutto dhammo uppajjati hetupaccayā. (Sahetukadukasadisaṃ.)*';
P_HTM[3111]='*1-4. Kusalattika-hetusahetukadukaṃ*';
P_HTM[3112]='*11. Kusalaṃ hetuñceva sahetukañca dhammaṃ paṭicca naakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva  sahetukañca dhammaṃ paṭicca naabyākato nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva sahetukañca dhammaṃ paṭicca naakusalo nahetu ceva naahetuko ca naabyākato nahetu ceva naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[3113]='*Akusalaṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3114]='*Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca naakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca naakusalo nahetu ceva naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[3115]='*Hetuyā nava.*';
P_HTM[3116]='*12. Kusalaṃ  sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu  ca dhammo uppajjati hetupaccayā. Kusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naabyākato naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca naabyākato naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3117]='*Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naabyākato naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca naabyākato naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3118]='*Abyākataṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Abyākataṃ  sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Abyākataṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca naakusalo naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3119]='*1-5. Kusalattika-hetuhetusampayuttadukaṃ*';
P_HTM[3120]='*13. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naakusalo nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naabyākato nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naakusalo nahetu ceva nahetuvippayutto ca naabyākato nahetu ceva nahetuvippayutto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3121]='*(Akusalaṃ tīṇi kātabbaṃ, abyākataṃ tīṇi  kātabbaṃ.)*';
P_HTM[3122]='*Hetuyā nava.*';
P_HTM[3123]='*14. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naakusalo nahetuvippayutto ceva  nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naabyākato nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naakusalo nahetuvippayutto ceva nanahetu ca naabyākato nahetuvippayutto ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3124]='*Akusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca… tīṇi. Abyākataṃ… tīṇi. Hetuyā nava.*';
P_HTM[3125]='*1-6. Kusalattika-hetusahetukadukaṃ*';
P_HTM[3126]='*15. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo nahetu nasahetuko dhammo uppajjati hetupaccayā. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca naakusalo nahetu nasahetuko dhammo uppajjati  hetupaccayā. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo nahetu nasahetuko ca naakusalo nahetu nasahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3127]='*Akusalaṃ nahetuṃ sahetukaṃ… tīṇi.*';
P_HTM[3128]='*Abyākataṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo…pe… naakusalo…pe… nakusalo nahetu nasahetuko ca naakusalo nahetu nasahetuko ca dhammā uppajjanti hetupaccayā… tīṇi.*';
P_HTM[3129]='*16. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nakusalo nahetu naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca naakusalo nahetu naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nakusalo nahetu naahetuko ca naakusalo nahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[3130]='*Hetugocchakaṃ niṭṭhitaṃ.*';
P_HTM[3131]='*1-7-8. Kusalattika-sappaccayādidukāni*';
P_HTM[3132]='*17. Abyākato  appaccayo dhammo naabyākatassa naappaccayassa  dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo nakusalassa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo naakusalassa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo naakusalassa naappaccayassa ca naabyākatassa naappaccayassa ca dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo nakusalassa naappaccayassa ca naakusalassa naappaccayassa ca dhammassa ārammaṇapaccayena paccayo. (5)*';
P_HTM[3133]='*Ārammaṇe pañca. (Asaṅkhataṃ appaccayasadisaṃ.)*';
P_HTM[3134]='*1-9. Kusalattika-sanidassanadukaṃ*';
P_HTM[3135]='*18. Abyākato  sanidassano dhammo naabyākatassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. Abyākato sanidassano dhammo nakusalassa nasanidassanassa…pe… (cha pañhā kātabbā).*';
P_HTM[3136]='*Kusalaṃ anidassanaṃ dhammaṃ paṭicca nakusalo naanidassano dhammo uppajjati hetupaccayā. Akusalena tīṇiyeva. Abyākatena tīṇiyeva. Hetuyā nava.*';
P_HTM[3137]='*1-10. Kusalattika-sappaṭighadukaṃ*';
P_HTM[3138]='*19. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca nakusalo nasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca naakusalo nasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca nakusalo nasappaṭigho ca naakusalo nasappaṭigho ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3139]='*Kusalaṃ appaṭighena tīṇi. Akusalaṃ appaṭighena tīṇi. Abyākataṃ appaṭighena tīṇi. Kusalaṃ appaṭighañca abyākataṃ appaṭighañca tīṇi. Akusalaṃ appaṭighañca abyākataṃ  appaṭighañca tīṇi. Hetuyā pannarasa.*';
P_HTM[3140]='*1-11. Kusalattika-rūpīdukaṃ*';
P_HTM[3141]='*20. Abyākataṃ  rūpiṃ dhammaṃ paṭicca nakusalo narūpī dhammo uppajjati hetupaccayā. Abyākataṃ rūpiṃ dhammaṃ paṭicca naakusalo narūpī dhammo uppajjati hetupaccayā. Abyākataṃ rūpiṃ dhammaṃ paṭicca nakusalo narūpī ca naakusalo narūpī ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3142]='*Kusalaṃ arūpiṃ dhammaṃ paṭicca tīṇi. Akusalaṃ arūpiṃ dhammaṃ paṭicca tīṇi. Abyākataṃ arūpiṃ dhammaṃ paṭicca tīṇi. Hetuyā nava.*';
P_HTM[3143]='*1-12. Kusalattika-lokiyadukaṃ*';
P_HTM[3144]='*21. Abyākataṃ lokiyaṃ dhammaṃ paccayā naabyākato nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā nakusalo nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ  dhammaṃ paccayā naakusalo nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā naakusalo nalokiyo ca naabyākato nalokiyo ca dhammā uppajjanti hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā nakusalo nalokiyo ca naakusalo nalokiyo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3145]='*Kusalaṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro dhammo uppajjati hetupaccayā. Kusalaṃ lokuttaraṃ dhammaṃ paṭicca naakusalo nalokuttaro dhammo uppajjati hetupaccayā. Kusalaṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro ca naakusalo nalokuttaro ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3146]='*Abyākataṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro dhammo uppajjati hetupaccayā. Abyākataṃ lokuttaraṃ dhammaṃ paṭicca naakusalo nalokuttaro dhammo uppajjati hetupaccayā. Abyākataṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro ca naakusalo nalokuttaro ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3147]='*1-13. Kusalattika-kenaciviññeyyadukaṃ*';
P_HTM[3148]='*22. Kusalaṃ  kenaci viññeyyaṃ dhammaṃ paṭicca nakusalo nakenaci  viññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naakusalo nakenaci viññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naabyākato nakenaci viññeyyo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā ekūnavīsati.*';
P_HTM[3149]='*23. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca nakusalo nakenaci naviññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca naakusalo nakenaci naviññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca naabyākato nakenaci naviññeyyo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3150]='*(Etena upāyena kenaci naviññeyye ekūnavīsati pañhā kātabbā.)*';
P_HTM[3151]='*1-14-19. Kusalattika-āsavagocchakaṃ*';
P_HTM[3152]='*24. Akusalaṃ  āsavaṃ dhammaṃ paṭicca naakusalo naāsavo dhammo…pe… nakusalo naāsavo dhammo…pe… naabyākato naāsavo dhammo…pe… nakusalo naāsavo ca naabyākato naāsavo ca dhammā…pe… nakusalo naāsavo ca naakusalo naāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca, ārammaṇe tīṇi…pe… avigate pañca.*';
P_HTM[3153]='*Akusalaṃ noāsavaṃ dhammaṃ paṭicca nakusalo nanoāsavo dhammo uppajjati hetupaccayā. Akusalaṃ noāsavaṃ dhammaṃ paṭicca naabyākato nanoāsavo dhammo…pe… nakusalo nanoāsavo ca naabyākato nanoāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[3154]='*25. Abyākataṃ sāsavaṃ dhammaṃ paṭicca…pe… (lokiyadukasadisaṃ).*';
P_HTM[3155]='*26. Akusalaṃ  āsavasampayuttaṃ dhammaṃ paṭicca naakusalo naāsavasampayutto dhammo …pe… nakusalo naāsavasampayutto dhammo…pe… naabyākato naāsavasampayutto dhammo…pe… nakusalo naāsavasampayutto ca naabyākato naāsavasampayutto ca dhammā…pe… nakusalo naāsavasampayutto ca naakusalo naāsavasampayutto ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3156]='*Akusalaṃ āsavavippayuttaṃ dhammaṃ paṭicca nakusalo naāsavavippayutto dhammo…pe… naabyākato naāsavavippayutto dhammo…pe… nakusalo naāsavavippayutto ca naabyākato naāsavavippayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3157]='*27. Akusalaṃ āsavañceva sāsavañca dhammaṃ paṭicca naakusalo naāsavo ceva naanāsavo ca dhammo…pe… nakusalo naāsavo ceva naanāsavo ca dhammo…pe… naabyākato naāsavo ceva naanāsavo ca dhammo…pe… nakusalo naāsavo ceva naanāsavo ca naabyākato naāsavo ceva naanāsavo ca dhammā…pe… nakusalo naāsavo  ceva naanāsavo ca naakusalo naāsavo ceva naanāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3158]='*Akusalaṃ  sāsavañceva no ca āsavaṃ dhammaṃ paṭicca naakusalo naanāsavo ceva nano ca āsavo dhammo…pe… naabyākato naanāsavo ceva nano ca āsavo dhammo…pe… nakusalo naanāsavo ceva nano ca āsavo naabyākato naanāsavo ceva nano āsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3159]='*28. Akusalaṃ āsavañceva āsavasampayuttañca dhammaṃ paṭicca nakusalo naāsavo ceva naāsavavippayutto ca dhammo…pe… naabyākato naāsavo ceva naāsavavippayutto ca dhammo…pe… nakusalo naāsavo ceva naāsavavippayutto ca naabyākato naāsavo ceva naāsavavippayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3160]='*Akusalaṃ āsavasampayuttañceva no ca āsavaṃ dhammaṃ paṭicca nakusalo naāsavavippayutto ceva nano ca āsavo dhammo…pe… naabyākato naāsavavippayutto ceva nano ca āsavo dhammo …pe… nakusalo naāsavavippayutto ceva nanoāsavo ca naabyākato naāsavavippayutto ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3161]='*29. Abyākataṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paṭicca…pe… (lokiyadukasadisaṃ).*';
P_HTM[3162]='*1-20-54. Kusalattika-chagocchakadukāni*';
P_HTM[3163]='*30. Akusalaṃ  saññojanaṃ dhammaṃ paṭicca…pe… ganthaṃ…pe… oghaṃ…pe… yogaṃ…pe… nīvaraṇaṃ…pe… parāmāsaṃ. (Saṃkhittaṃ.)*';
P_HTM[3164]='*1-55. Kusalattika-sārammaṇadukaṃ*';
P_HTM[3165]='*31. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca naakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca  nakusalo nasārammaṇo ca naakusalo nasārammaṇo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3166]='*Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca naakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo ca naakusalo nasārammaṇo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3167]='*Abyākataṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Tīṇi.*';
P_HTM[3168]='*Hetuyā nava.*';
P_HTM[3169]='*32. Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca nakusalo naanārammaṇo  dhammo uppajjati hetupaccayā. Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca naakusalo naanārammaṇo dhammo uppajjati hetupaccayā. Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca nakusalo naanārammaṇo ca naakusalo naanārammaṇo ca dhammā uppajjanti hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi.*';
P_HTM[3170]='*1-56. Kusalattika-cittadukaṃ*';
P_HTM[3171]='*33. Kusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naabyākato nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto ca naabyākato nacitto ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3172]='*Akusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca naabyākato nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naabyākato nacitto ca dhammā uppajjanti hetupaccayā. Akusalaṃ  cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3173]='*Abyākataṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Abyākataṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Abyākataṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Tīṇi. Hetuyā terasa.*';
P_HTM[3174]='*34. Kusalaṃ nocittaṃ dhammaṃ paṭicca naakusalo nanocitto dhammo uppajjati hetupaccayā. Kusalaṃ nocittaṃ dhammaṃ paṭicca naabyākato nanocitto dhammo uppajjati hetupaccayā. Kusalaṃ nocittaṃ dhammaṃ paṭicca naakusalo nanocitto ca naabyākato nanocitto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3175]='*Akusalaṃ  nocittaṃ dhammaṃ paṭicca nakusalo nanocitto dhammo uppajjati hetupaccayā. Akusalaṃ nocittaṃ dhammaṃ paṭicca naabyākato nanocitto dhammo uppajjati hetupaccayā. Akusalaṃ nocittaṃ dhammaṃ paṭicca nakusalo nanocitto ca naabyākato nanocitto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3176]='*Abyākatāni tīṇi. Hetuyā nava.*';
P_HTM[3177]='*1-57. Kusalattika-cetasikadukaṃ*';
P_HTM[3178]='*35. Kusalaṃ  cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naabyākato nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko ca naabyākato nacetasiko ca dhammā uppajjanti hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3179]='*Akusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko  dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca naabyākato nacetasiko dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naabyākato nacetasiko ca dhammā uppajjanti hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3180]='*Abyākataṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko dhammo uppajjati hetupaccayā. Abyākataṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Abyākataṃ cetasikaṃ dhammaṃ paṭicca nakusalo  nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3181]='*Hetuyā terasa. Acetasikāni nava.*';
P_HTM[3182]='*1-58. Kusalattika-cittasampayuttadukaṃ*';
P_HTM[3183]='*36. Kusalaṃ  cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naabyākato nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto ca naabyākato nacittasampayutto ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto ca naakusalo nacittasampayutto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3184]='*Akusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3185]='*Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto ca naakusalo nacittasampayutto  ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā terasa. Cittavippayutte tīṇi.*';
P_HTM[3186]='*1-59. Kusalattika-cittasaṃsaṭṭhadukaṃ*';
P_HTM[3187]='*37. Kusalaṃ  cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naabyākato nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho ca naabyākato nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3188]='*Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naabyākato nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naabyākato nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3189]='*Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā terasa.*';
P_HTM[3190]='*1-60. Kusalattika-cittasamuṭṭhānadukaṃ*';
P_HTM[3191]='*38. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naabyākato nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno ca naabyākato nacittasamuṭṭhāno ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3192]='*Akusalaṃ  cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Akusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naabyākato nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Akusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca nakusalo nacittasamuṭṭhāno ca naabyākato nacittasamuṭṭhāno ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3193]='*Abyākataṃ cittasamuṭṭhānaṃ dhammaṃ  paṭicca nakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava…pe… avigate nava.*';
P_HTM[3194]='*39. Kusalaṃ nocittasamuṭṭhānaṃ dhammaṃ paṭicca nakusalo nanocittasamuṭṭhāno dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3195]='*Akusalaṃ  nocittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nanocittasamuṭṭhāno dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3196]='*Abyākataṃ nocittasamuṭṭhānaṃ dhammaṃ paṭicca nakusalo nanocittasamuṭṭhāno dhammo uppajjati hetupaccayā… tīṇi. Hetuyā terasa…pe… avigate terasa.*';
