P_HTM[3198]='*40. Kusalaṃ cittasahabhuṃ dhammaṃ paṭicca nakusalo nacittasahabhū dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3199]='*Akusalaṃ cittasahabhuṃ dhammaṃ paṭicca naakusalo nacittasahabhū dhammo uppajjati hetupaccayā… pañca.*';
