P_HTM[3201]='*41. Kusalaṃ nocittasahabhuṃ dhammaṃ paṭicca nakusalo nanocittasahabhū dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3202]='*Akusalaṃ nocittasahabhuṃ  dhammaṃ paṭicca naakusalo nanocittasahabhū dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3203]='*Abyākataṃ  nocittasahabhuṃ dhammaṃ paṭicca nakusalo nanocittasahabhū dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.) Hetuyā terasa…pe… avigate terasa.*';
P_HTM[3204]='*1-62-65. Kusalattika-cittānuparivattādidukāni*';
P_HTM[3205]='*42. Kusalaṃ cittānuparivattiṃ dhammaṃ paṭicca… (saṃkhittaṃ.) Hetuyā terasa.*';
P_HTM[3206]='*Kusalaṃ nocittānuparivattiṃ dhammaṃ paṭicca… (saṃkhittaṃ.) Hetuyā terasa. (Ete saṃkhittā, dukattayaṃ cittadukasadisaṃ.)*';
P_HTM[3207]='*1-66-68. Kusalattika-ajjhattikādidukāni*';
P_HTM[3208]='*43. Kusalaṃ  ajjhattikaṃ dhammaṃ paṭicca… (saṃkhittaṃ, cittadukasadisaṃ).*';
P_HTM[3209]='*Kusalaṃ bāhiraṃ dhammaṃ paṭicca naakusalo nabāhiro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3210]='*44. Abyākataṃ upādā dhammaṃ paṭicca nakusalo naupādā dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3211]='*Kusalaṃ noupādā dhammaṃ paṭicca nakusalo nanoupādā dhammo uppajjati hetupaccayā… tīṇi… nava.*';
P_HTM[3212]='*45. Abyākataṃ  upādinnaṃ dhammaṃ paṭicca nakusalo naupādinno dhammo uppajjati hetupaccayā. Abyākataṃ upādinnaṃ dhammaṃ paṭicca naakusalo naupādinno dhammo uppajjati hetupaccayā. Abyākataṃ upādinnaṃ dhammaṃ paṭicca nakusalo naupādinno ca naakusalo naupādinno ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3213]='*1-69-82. Kusalattika-upādānādidukāni*';
P_HTM[3214]='*46. Akusalaṃ upādānaṃ dhammaṃ paṭicca naakusalo noupādāno dhammo uppajjati hetupaccayā.*';
P_HTM[3215]='*Akusalaṃ kilesaṃ dhammaṃ paṭicca naakusalo nokileso dhammo uppajjati hetupaccayā.*';
P_HTM[3216]='*1-83. Kusalattika-piṭṭhidukaṃ*';
P_HTM[3217]='*47. Akusalaṃ  dassanena pahātabbaṃ dhammaṃ paṭicca naakusalo nadassanena pahātabbo dhammo uppajjati hetupaccayā. Akusalaṃ dassanena pahātabbaṃ dhammaṃ paṭicca nakusalo nadassanena pahātabbo dhammo uppajjati hetupaccayā. Akusalaṃ dassanena pahātabbaṃ dhammaṃ paṭicca nakusalo nadassanena pahātabbo ca naakusalo nadassanena pahātabbo ca dhammā uppajjanti hetupaccayā. Hetuyā  tīṇi.*';
P_HTM[3218]='*Abyākataṃ  nadassanena pahātabbaṃ dhammaṃ paccayā naabyākato nanadassanena pahātabbo dhammo uppajjati hetupaccayā. Abyākataṃ nadassanena pahātabbaṃ dhammaṃ paccayā nakusalo nanadassanena pahātabbo dhammo uppajjati hetupaccayā. Abyākataṃ nadassanena pahātabbaṃ dhammaṃ paccayā nakusalo nanadassanena pahātabbo ca naabyākato nanadassanena pahātabbo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3219]='*48. Akusalaṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca naakusalo nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Akusalaṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca nakusalo nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Akusalaṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca nakusalo nabhāvanāya pahātabbo ca naakusalo nabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3220]='*Abyākataṃ nabhāvanāya pahātabbaṃ dhammaṃ paccayā naabyākato nanabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3221]='*49. Akusalaṃ  dassanena pahātabbahetukaṃ dhammaṃ paṭicca naakusalo nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3222]='*Akusalaṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca nakusalo nanadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3223]='*Abyākataṃ  nadassanena pahātabbahetukaṃ dhammaṃ paccayā naabyākato nanadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3224]='*50. Akusalaṃ bhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca naakusalo nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3225]='*Akusalaṃ  nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nakusalo nanabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3226]='*51. Kusalaṃ  savitakkaṃ dhammaṃ paṭicca nakusalo nasavitakko dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3227]='*Kusalaṃ avitakkaṃ dhammaṃ paṭicca naakusalo naavitakko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3228]='*52. Kusalaṃ savicāraṃ dhammaṃ paṭicca nakusalo nasavicāro dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3229]='*Kusalaṃ avicāraṃ dhammaṃ paṭicca naakusalo naavicāro dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3230]='*53. Kusalaṃ sappītikaṃ dhammaṃ paṭicca nakusalo nasappītiko dhammo uppajjati hetupaccayā… hetuyā  terasa.*';
P_HTM[3231]='*Kusalaṃ appītikaṃ dhammaṃ paṭicca naakusalo naappītiko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3232]='*54. Kusalaṃ pītisahagataṃ dhammaṃ paṭicca nakusalo napītisahagato dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3233]='*Kusalaṃ napītisahagataṃ dhammaṃ paṭicca naakusalo nanapītisahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
