P_HTM[4701]='*Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca sanidassanasappaṭigho araṇo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[4702]='*Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca sanidassanasappaṭigho araṇo dhammo uppajjati hetupaccayā… satta.*';
