P_HTM[4709]='*116. Nasanidassanasappaṭigho  naaraṇo dhammo anidassanaappaṭighassa araṇassa dhammassa ārammaṇapaccayena paccayo. Naanidassanasappaṭigho naaraṇo dhammo anidassanaappaṭighassa araṇassa dhammassa ārammaṇapaccayena paccayo. Nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā anidassanaappaṭighassa araṇassa dhammassa ārammaṇapaccayena paccayo.*';
