P_HTM[4715]='*1. Nakusalaṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca akusalo sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca abyākato sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Dve.*';
