P_HTM[4810]='*Nakusalaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca abyākato anidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4811]='*2-1. Vedanāttika-kusalattikaṃ*';
P_HTM[4812]='*27. Nasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā sukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā adukkhamasukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[4813]='*Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā sukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā adukkhamasukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[4814]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā adukkhamasukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paccayā sukhāya vedanāya sampayutto kusalo dhammo uppajjati hetupaccayā. Dve. (Cattāri gaṇitakena dve dve pañhā kātabbā.) Hetuyā cuddasa.*';
P_HTM[4815]='*28. Nasukhāya  vedanāya sampayuttaṃ naakusalaṃ dhammaṃ paccayā sukhāya vedanāya sampayutto akusalo  dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ naakusalaṃ dhammaṃ paccayā dukkhāya vedanāya sampayutto akusalo dhammo uppajjati hetupaccayā. Hetuyā ekavīsa.*';
P_HTM[4816]='*29. Nasukhāya  vedanāya sampayutto naabyākato dhammo sukhāya vedanāya sampayuttassa abyākatassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cuddasa.*';
P_HTM[4817]='*3-1. Vipākattika-kusalattikaṃ*';
P_HTM[4818]='*30. Navipākaṃ nakusalaṃ dhammaṃ paccayā vipākadhammadhammo kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4819]='*Navipākaṃ naakusalaṃ dhammaṃ paccayā vipākadhammadhammo akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4820]='*Navipākaṃ naabyākataṃ dhammaṃ paṭicca nevavipākanavipākadhammadhammo abyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4821]='*4-1. Upādinnattika-kusalattikaṃ*';
P_HTM[4822]='*31. Naanupādinnupādāniyaṃ  nakusalaṃ dhammaṃ paccayā anupādinnupādāniyo kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4823]='*Naanupādinnupādāniyaṃ naakusalaṃ dhammaṃ paccayā anupādinnupādāniyo akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4824]='*Naupādinnupādāniyaṃ naabyākataṃ dhammaṃ paṭicca anupādinnupādāniyo abyākato dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4825]='*5-1. Saṃkiliṭṭhattika-kusalattikaṃ*';
P_HTM[4826]='*32. Nasaṃkiliṭṭhasaṃkilesikaṃ  nakusalaṃ dhammaṃ paccayā asaṃkiliṭṭhasaṃkilesiko kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4827]='*Nasaṃkiliṭṭhasaṃkilesikaṃ naakusalaṃ dhammaṃ paccayā saṃkiliṭṭhasaṃkilesiko akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4828]='*Nasaṃkiliṭṭhasaṃkilesikaṃ naabyākataṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko  abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4829]='*6-1. Vitakkattika-kusalattikaṃ*';
P_HTM[4830]='*33. Nasavitakkasavicāraṃ  nakusalaṃ dhammaṃ paccayā savitakkasavicāro kusalo dhammo uppajjati hetupaccayā… hetuyā pannarasa.*';
P_HTM[4831]='*Nasavitakkasavicāraṃ naakusalaṃ dhammaṃ paccayā savitakkasavicāro akusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4832]='*Nasavitakkasavicāraṃ naabyākataṃ dhammaṃ paṭicca avitakkaavicāro abyākato dhammo uppajjati hetupaccayā… hetuyā satta.*';
P_HTM[4833]='*7-1. Pītittika-kusalattikaṃ*';
P_HTM[4834]='*34. Napītisahagataṃ nakusalaṃ dhammaṃ paccayā pītisahagato kusalo dhammo uppajjati hetupaccayā… hetuyā aṭṭhavīsa.*';
P_HTM[4835]='*Napītisahagataṃ naakusalaṃ dhammaṃ paccayā pītisahagato akusalo dhammo uppajjati hetupaccayā… hetuyā aṭṭhavīsa.*';
P_HTM[4836]='*Napītisahagato  naabyākato dhammo pītisahagatassa abyākatassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe aṭṭhavīsa, adhipatiyā anantare aṭṭhavīsa…pe… upanissaye aṭṭhavīsa, kamme catuvīsa, natthiyā vigate aṭṭhavīsa.*';
P_HTM[4837]='*8-1. Dassanattika-kusalattikaṃ*';
P_HTM[4838]='*35. Nadassanena  pahātabbaṃ nakusalaṃ dhammaṃ paccayā nevadassanena nabhāvanāya pahātabbo kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4839]='*Nadassanena pahātabbaṃ naakusalaṃ dhammaṃ paccayā dassanena pahātabbo akusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4840]='*Nadassanena pahātabbaṃ naabyākataṃ dhammaṃ paṭicca nevadassanena nabhāvanāya pahātabbo abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4841]='*9-1. Dassanahetuttika-kusalattikaṃ*';
P_HTM[4842]='*36. Nadassanena  pahātabbahetukaṃ nakusalaṃ dhammaṃ paccayā nevadassanena nabhāvanāya pahātabbahetuko kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4843]='*Nadassanena pahātabbahetukaṃ naakusalaṃ dhammaṃ paccayā dassanena pahātabbahetuko akusalo dhammo uppajjati hetupaccayā… hetuyā  cha.*';
P_HTM[4844]='*Nanevadassanena nabhāvanāya pahātabbahetukaṃ naabyākataṃ dhammaṃ paṭicca nevadassanena nabhāvanāya pahātabbahetuko abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4845]='*10-1. Ācayagāmittika-kusalattikaṃ*';
P_HTM[4846]='*37. Naācayagāmiṃ nakusalaṃ dhammaṃ paccayā ācayagāmī kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4847]='*Naācayagāmiṃ  naakusalaṃ dhammaṃ paccayā ācayagāmī akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4848]='*Naācayagāmiṃ naabyākataṃ dhammaṃ paṭicca nevācayagāmināpacayagāmī abyākato dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4849]='*11-1. Sekkhattika-kusalattikaṃ*';
P_HTM[4850]='*38. Nasekkhaṃ nakusalaṃ dhammaṃ paccayā sekkho kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4851]='*Nasekkhaṃ naakusalaṃ dhammaṃ paccayā nevasekkhanāsekkho akusalo  dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4852]='*Nasekkhaṃ naabyākataṃ dhammaṃ paṭicca nevasekkhanāsekkho abyākato dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4853]='*12-1. Parittattika-kusalattikaṃ*';
P_HTM[4854]='*39. Namahaggataṃ nakusalaṃ dhammaṃ paccayā mahaggato kusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4855]='*Namahaggataṃ  naakusalaṃ dhammaṃ paccayā paritto akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4856]='*Naparittaṃ naabyākataṃ dhammaṃ paṭicca paritto abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4857]='*13-1. Parittārammaṇattika-kusalattikaṃ*';
P_HTM[4858]='*40. Naparittārammaṇaṃ  nakusalaṃ dhammaṃ paccayā parittārammaṇo kusalo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4859]='*Naparittārammaṇaṃ  naakusalaṃ dhammaṃ paccayā parittārammaṇo akusalo dhammo uppajjati hetupaccayā… hetuyā cuddasa.*';
P_HTM[4860]='*Naparittārammaṇo naabyākato dhammo parittārammaṇassa abyākatassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)… Ārammaṇe ekavīsa.*';
P_HTM[4861]='*14-1. Hīnattika-kusalattikaṃ*';
P_HTM[4862]='*41. Nahīnaṃ nakusalaṃ dhammaṃ paccayā majjhimo kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4863]='*Nahīnaṃ naakusalaṃ dhammaṃ paccayā hīno akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4864]='*Nahīnaṃ naabyākataṃ dhammaṃ paṭicca majjhimo abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4865]='*15-1. Micchattaniyatattika-kusalattikaṃ*';
P_HTM[4866]='*42. Namicchattaniyataṃ nakusalaṃ dhammaṃ paccayā sammattaniyato kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4867]='*Namicchattaniyataṃ naakusalaṃ dhammaṃ paccayā micchattaniyato akusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4868]='*Namicchattaniyataṃ  naabyākataṃ dhammaṃ paṭicca aniyato abyākato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4869]='*16-1. Maggārammaṇattika-kusalattikaṃ*';
P_HTM[4870]='*43. Namaggārammaṇaṃ  nakusalaṃ dhammaṃ paccayā maggārammaṇo kusalo dhammo uppajjati hetupaccayā… hetuyā pañcatiṃsa. (Naakusalaṃ naabyākataṃ natthi.)*';
P_HTM[4871]='*17-18-1. Uppannādittikāni-kusalattikaṃ*';
P_HTM[4872]='*44. Nauppanno nakusalo dhammo uppannassa kusalassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe satta.*';
P_HTM[4873]='*Nauppanno naakusalo dhammo uppannassa akusalassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha.*';
P_HTM[4874]='*Nauppanno naabyākato dhammo uppannassa abyākatassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe satta.*';
P_HTM[4875]='*(Atītattikaṃ uppannattikasadisaṃ.)*';
P_HTM[4876]='*19-1. Atītārammaṇattika-kusalattikaṃ*';
P_HTM[4877]='*45. Naatītārammaṇaṃ  nakusalaṃ dhammaṃ paccayā atītārammaṇo kusalo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4878]='*Naatītārammaṇaṃ naakusalaṃ dhammaṃ paccayā atītārammaṇo akusalo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4879]='*20-1. Ajjhattattika-kusalattikaṃ*';
P_HTM[4880]='*46. Naajjhattaṃ nakusalaṃ dhammaṃ paccayā bahiddhā kusalo dhammo uppajjati hetupaccayā. Nabahiddhā nakusalaṃ dhammaṃ paccayā ajjhatto kusalo dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[4881]='*Naajjhattaṃ  naakusalaṃ dhammaṃ paccayā bahiddhā akusalo dhammo uppajjati hetupaccayā. Nabahiddhā naakusalaṃ dhammaṃ paccayā ajjhatto akusalo dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[4882]='*21-1. Ajjhattārammaṇattika-kusalattikaṃ*';
P_HTM[4883]='*47. Naajjhattārammaṇaṃ  nakusalaṃ dhammaṃ paccayā ajjhattārammaṇo kusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4884]='*Naajjhattārammaṇaṃ  naakusalaṃ dhammaṃ paccayā ajjhattārammaṇo akusalo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4885]='*22-1. Sanidassanattika-kusalattikaṃ*';
P_HTM[4886]='*48. Nasanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paccayā anidassanaappaṭigho kusalo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nakusalaṃ dhammaṃ paccayā anidassanaappaṭigho kusalo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nakusalañca naanidassanasappaṭighaṃ nakusalañca dhammaṃ paccayā anidassanaappaṭigho kusalo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4887]='*Nasanidassanasappaṭighaṃ naakusalaṃ dhammaṃ paccayā anidassanaappaṭigho akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4888]='*Nasanidassanasappaṭighaṃ naabyākataṃ dhammaṃ paṭicca sanidassanasappaṭigho abyākato dhammo uppajjati hetupaccayā… satta.*';
P_HTM[4889]='*(Naanidassanasappaṭighanaabyākatamūlāni sattameva, dukamūlāni sattameva, sabbaṃ ekavīsatimeva.)*';
P_HTM[4890]='*22-2. Sanidassanattika-vedanāttikaṃ*';
P_HTM[4891]='*49. Nasanidassanasappaṭighaṃ  nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca anidassanaappaṭigho sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4892]='*Nasanidassanasappaṭighaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca anidassanaappaṭigho dukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4893]='*Nasanidassanasappaṭighaṃ naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca anidassanaappaṭigho adukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4894]='*22-3. Sanidassanattika-vipākattikaṃ*';
P_HTM[4895]='*50. Nasanidassanasappaṭighaṃ  navipākaṃ dhammaṃ paṭicca anidassanaappaṭigho vipāko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4896]='*Nasanidassanasappaṭighaṃ navipākadhammadhammaṃ paccayā anidassanaappaṭigho vipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4897]='*Nasanidassanasappaṭighaṃ  nanevavipākanavipākadhammadhammaṃ paṭicca sanidassanasappaṭigho nevavipākanavipākadhammadhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4898]='*22-4. Sanidassanattika-upādinnattikaṃ*';
P_HTM[4899]='*51. Nasanidassanasappaṭigho naupādinnupādāniyo dhammo anidassanaappaṭighassa upādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha.*';
P_HTM[4900]='*Nasanidassanasappaṭighaṃ  naanupādinnupādāniyaṃ dhammaṃ paṭicca sanidassanasappaṭigho anupādinnupādāniyo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4901]='*Nasanidassanasappaṭighaṃ naanupādinnaanupādāniyaṃ dhammaṃ paccayā anidassanaappaṭigho anupādinnaanupādāniyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4902]='*22-5. Sanidassanattika-saṃkiliṭṭhattikaṃ*';
P_HTM[4903]='*52. Nasanidassanasappaṭighaṃ  nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā anidassanaappaṭigho saṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4904]='*Nasanidassanasappaṭighaṃ naasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca sanidassanasappaṭigho asaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4905]='*Nasanidassanasappaṭighaṃ naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paccayā anidassanaappaṭigho asaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4906]='*22-6. Sanidassanattika-vitakkattikaṃ*';
P_HTM[4907]='*53. Nasanidassanasappaṭighaṃ  nasavitakkasavicāraṃ dhammaṃ paṭicca anidassanaappaṭigho savitakkasavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4908]='*Nasanidassanasappaṭighaṃ naavitakkavicāramattaṃ dhammaṃ paṭicca anidassanaappaṭigho avitakkavicāramatto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4909]='*Nasanidassanasappaṭighaṃ naavitakkaavicāraṃ dhammaṃ paṭicca sanidassanasappaṭigho avitakkaavicāro dhammo uppajjati hetupaccayā … hetuyā ekavīsa.*';
P_HTM[4910]='*22-7. Sanidassanattika-pītittikaṃ*';
P_HTM[4911]='*54. Nasanidassanasappaṭighaṃ  napītisahagataṃ dhammaṃ paṭicca anidassanaappaṭigho pītisahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4912]='*Nasanidassanasappaṭighaṃ nasukhasahagataṃ dhammaṃ paṭicca anidassanaappaṭigho sukhasahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4913]='*Nasanidassanasappaṭighaṃ naupekkhāsahagataṃ dhammaṃ paṭicca anidassanaappaṭigho upekkhāsahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4914]='*22-8. Sanidassanattika-dassanattikaṃ*';
P_HTM[4915]='*55. Nasanidassanasappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paccayā anidassanaappaṭigho dassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā  tīṇi.*';
P_HTM[4916]='*Nasanidassanasappaṭighaṃ nabhāvanāya pahātabbaṃ dhammaṃ paccayā anidassanaappaṭigho bhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4917]='*Nasanidassanasappaṭighaṃ nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca sanidassanasappaṭigho nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4918]='*22-9. Sanidassanattika-dassanahetuttikaṃ*';
P_HTM[4919]='*56. Nasanidassanasappaṭighaṃ  nadassanena pahātabbahetukaṃ dhammaṃ paṭicca anidassanaappaṭigho dassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4920]='*Nasanidassanasappaṭighaṃ  nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca anidassanaappaṭigho bhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4921]='*Nasanidassanasappaṭighaṃ nanevadassanena nabhāvanāya pahātabbahetukaṃ  dhammaṃ paṭicca sanidassanasappaṭigho nevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4922]='*22-10. Sanidassanattika-ācayagāmittikaṃ*';
P_HTM[4923]='*57. Nasanidassanasappaṭighaṃ naācayagāmiṃ dhammaṃ paccayā anidassanaappaṭigho ācayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4924]='*Nasanidassanasappaṭighaṃ naapacayagāmiṃ dhammaṃ paccayā anidassanaappaṭigho apacayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4925]='*Nasanidassanasappaṭighaṃ nanevācayagāmināpacayagāmiṃ dhammaṃ paṭicca sanidassanasappaṭigho nevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4926]='*22-11. Sanidassanattika-sekkhattikaṃ*';
P_HTM[4927]='*58. Nasanidassanasappaṭighaṃ nasekkhaṃ dhammaṃ paccayā anidassanaappaṭigho sekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4928]='*Nasanidassanasappaṭighaṃ naasekkhaṃ dhammaṃ paccayā anidassanaappaṭigho  asekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4929]='*Nasanidassanasappaṭighaṃ nanevasekkhanāsekkhaṃ dhammaṃ paṭicca sanidassanasappaṭigho nevasekkhanāsekkho dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4930]='*22-12. Sanidassanattika-parittattikaṃ*';
P_HTM[4931]='*59. Nasanidassanasappaṭighaṃ  naparittaṃ dhammaṃ paṭicca sanidassanasappaṭigho paritto dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4932]='*Nasanidassanasappaṭighaṃ namahaggataṃ dhammaṃ paṭicca anidassanaappaṭigho mahaggato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4933]='*Nasanidassanasappaṭighaṃ naappamāṇaṃ dhammaṃ paccayā anidassanaappaṭigho appamāṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4934]='*22-13. Sanidassanattika-parittārammaṇattikaṃ*';
P_HTM[4935]='*60. Nasanidassanasappaṭighaṃ naparittārammaṇaṃ dhammaṃ paṭicca anidassanaappaṭigho parittārammaṇo dhammo uppajjati hetupaccayā … hetuyā tīṇi.*';
P_HTM[4936]='*Nasanidassanasappaṭighaṃ namahaggatārammaṇaṃ dhammaṃ paccayā anidassanaappaṭigho mahaggatārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4937]='*Nasanidassanasappaṭighaṃ naappamāṇārammaṇaṃ dhammaṃ paccayā anidassanaappaṭigho appamāṇārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4938]='*22-14. Sanidassanattika-hīnattikaṃ*';
P_HTM[4939]='*61. Nasanidassanasappaṭighaṃ nahīnaṃ dhammaṃ paccayā anidassanaappaṭigho hīno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4940]='*Nasanidassanasappaṭighaṃ namajjhimaṃ dhammaṃ paṭicca sanidassanasappaṭigho majjhimo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4941]='*Nasanidassanasappaṭighaṃ  napaṇītaṃ dhammaṃ paccayā anidassanaappaṭigho paṇīto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4942]='*22-15. Sanidassanattika-micchattaniyatattikaṃ*';
P_HTM[4943]='*62. Nasanidassanasappaṭighaṃ  namicchattaniyataṃ dhammaṃ paccayā anidassanaappaṭigho micchattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4944]='*Nasanidassanasappaṭighaṃ  nasammattaniyataṃ dhammaṃ paccayā anidassanaappaṭigho sammattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4945]='*Nasanidassanasappaṭighaṃ naaniyataṃ dhammaṃ paṭicca sanidassanasappaṭigho aniyato dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4946]='*22-16. Sanidassanattika-maggārammaṇattikaṃ*';
P_HTM[4947]='*63. Nasanidassanasappaṭighaṃ namaggārammaṇaṃ dhammaṃ paccayā anidassanaappaṭigho maggārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4948]='*Nasanidassanasappaṭighaṃ namaggahetukaṃ dhammaṃ paccayā anidassanaappaṭigho maggahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4949]='*Nasanidassanasappaṭighaṃ namaggādhipatiṃ dhammaṃ paccayā anidassanaappaṭigho maggādhipati dhammo uppajjati hetupaccayā… hetuyā  tīṇi.*';
P_HTM[4950]='*22-17. Sanidassanattika-uppannattikaṃ*';
P_HTM[4951]='*64. Nasanidassanasappaṭigho nauppanno dhammo anidassanaappaṭighassa uppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha.*';
P_HTM[4952]='*22-18. Sanidassanattika-atītattikaṃ*';
P_HTM[4953]='*65. Nasanidassanasappaṭigho  napaccuppanno dhammo anidassanaappaṭighassa paccuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha.*';
P_HTM[4954]='*22-19. Sanidassanattika-atītārammaṇattikaṃ*';
P_HTM[4955]='*66. Nasanidassanasappaṭighaṃ naatītārammaṇaṃ dhammaṃ paṭicca anidassanaappaṭigho atītārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4956]='*Nasanidassanasappaṭighaṃ naanāgatārammaṇaṃ dhammaṃ paccayā anidassanaappaṭigho anāgatārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4957]='*Nasanidassanasappaṭighaṃ napaccuppannārammaṇaṃ dhammaṃ paṭicca anidassanaappaṭigho paccuppannārammaṇo dhammo uppajjati hetupaccayā … hetuyā tīṇi.*';
P_HTM[4958]='*22-20-21. Sanidassanattika-ajjhattattikadvayaṃ*';
P_HTM[4959]='*67. Nasanidassanasappaṭigho  naajjhatto dhammo anidassanaappaṭighassa ajjhattassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe cha, adhipatiyā cha, purejāte atthiyā avigate cha.*';
P_HTM[4960]='*Nasanidassanasappaṭigho nabahiddhā dhammo anidassanaappaṭighassa bahiddhā dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe cha, adhipatiyā cha, purejāte atthiyā avigate cha.*';
P_HTM[4961]='*68. Nasanidassanasappaṭighaṃ naajjhattārammaṇaṃ dhammaṃ paṭicca anidassanaappaṭigho ajjhattārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4962]='*Nasanidassanasappaṭighaṃ  nabahiddhārammaṇaṃ dhammaṃ paṭicca anidassanaappaṭigho bahiddhārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4963]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[4964]='*Dhammapaccanīyānulome tikatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[4965]='*Dhammapaccanīyānulome dukadukapaṭṭhānaṃ*';
P_HTM[4966]='*1-1. Hetuduka-sahetukadukaṃ*';
P_HTM[4967]='*1. Nahetuṃ  nasahetukaṃ dhammaṃ paṭicca hetu sahetuko dhammo uppajjati hetupaccayā. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu sahetuko dhammo uppajjati hetupaccayā. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca  hetu sahetuko ca nahetu sahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4968]='*Nanahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu sahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4969]='*Hetuyā cattāri, ārammaṇe cattāri…pe… avigate cattāri.*';
P_HTM[4970]='*2. Nanahetu naahetuko dhammo nahetussa ahetukassa dhammassa hetupaccayena paccayo.*';
P_HTM[4971]='*Hetuyā ekaṃ, ārammaṇe cha…pe… avigate pañca. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[4972]='*3. Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4973]='*Nanahetuṃ  naahetukaṃ dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4974]='*Nahetuṃ naahetukañca nanahetuṃ naahetukañca dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā tīṇi.*';
P_HTM[4975]='*1-2-5. Hetuduka-hetusampayuttādidukāni*';
P_HTM[4976]='*4. Nahetuṃ  nahetusampayuttaṃ dhammaṃ paṭicca hetu hetusampayutto dhammo uppajjati hetupaccayā… hetuyā cattāri.*';
P_HTM[4977]='*Nahetuṃ nahetuvippayuttaṃ dhammaṃ paṭicca nahetu hetuvippayutto  dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4978]='*5. Nahetuṃ nahetuñceva naahetukañca dhammaṃ paṭicca hetu hetu ceva sahetuko ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4979]='*Nanahetuṃ naahetukañceva nanahetuñca dhammaṃ paṭicca nahetu sahetuko ceva na ca hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4980]='*6. Nahetuṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca hetu hetu ceva hetusampayutto ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4981]='*Nanahetuṃ nahetuvippayuttañceva nanahetuñca dhammaṃ paṭicca nahetu hetusampayutto ceva na ca hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4982]='*7. Nahetuṃ nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nahetu sahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4983]='*Nahetuṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu nahetu ahetuko dhammo uppajjati hetupaccayā. Hetuyā  ekaṃ.*';
P_HTM[4984]='*1-6-12. Hetuduka-cūḷantaradukāni*';
P_HTM[4985]='*8. Nahetu  nasappaccayo dhammo hetussa sappaccayassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe tīṇi. (Saṅkhataṃ sappaccayasadisaṃ.)*';
P_HTM[4986]='*9. Nahetuṃ  nasanidassanaṃ dhammaṃ paṭicca nahetu sanidassano dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4987]='*Nahetu naanidassano dhammo hetussa anidassanassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe tīṇi.*';
P_HTM[4988]='*10. Nahetuṃ nasappaṭighaṃ dhammaṃ paṭicca nahetu sappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4989]='*Nahetuṃ  naappaṭighaṃ dhammaṃ paṭicca nahetu appaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4990]='*11. Nahetuṃ narūpiṃ dhammaṃ paṭicca hetu rūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4991]='*Nahetuṃ naarūpiṃ dhammaṃ paṭicca hetu arūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4992]='*12. Nahetuṃ nalokiyaṃ dhammaṃ paṭicca nahetu lokiyo dhammo uppajjati hetupaccayā. Nanahetuṃ nalokiyaṃ dhammaṃ paṭicca nahetu lokiyo dhammo uppajjati hetupaccayā (gaṇitakena tīṇi.)*';
P_HTM[4993]='*Nahetuṃ nalokuttaraṃ dhammaṃ paccayā hetu lokuttaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4994]='*13. Nahetuṃ  nakenaci viññeyyaṃ dhammaṃ paṭicca hetu kenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā  nava.*';
P_HTM[4995]='*Nahetuṃ nakenaci naviññeyyaṃ dhammaṃ paṭicca hetu kenaci naviññeyyo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4996]='*1-13-18. Hetuduka-āsavagocchakāni*';
P_HTM[4997]='*14. Nahetuṃ noāsavaṃ dhammaṃ paṭicca hetu āsavo dhammo uppajjati hetupaccayā. Nahetuṃ noāsavaṃ dhammaṃ paṭicca nahetu āsavo dhammo uppajjati hetupaccayā. Nahetuṃ noāsavaṃ dhammaṃ paṭicca hetu āsavo ca nahetu āsavo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4998]='*Nanahetuṃ  noāsavaṃ dhammaṃ paṭicca hetu āsavo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4999]='*Nahetuṃ noāsavañca nanahetuṃ noāsavañca dhammaṃ paṭicca hetu āsavo dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[5000]='*Nahetuṃ nanoāsavaṃ dhammaṃ paṭicca nahetu noāsavo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[5001]='*Nanahetuṃ nanoāsavaṃ dhammaṃ paṭicca nahetu noāsavo dhammo uppajjati hetupaccayā. Nanahetuṃ nanoāsavaṃ dhammaṃ paṭicca hetu noāsavo dhammo uppajjati hetupaccayā. Nanahetuṃ nanoāsavaṃ dhammaṃ paṭicca hetu noāsavo ca nahetu noāsavo ca dhammā uppajjanti hetupaccayā tīṇi.*';
P_HTM[5002]='*Nahetuṃ nanoāsavañca  nanahetuṃ nanoāsavañca dhammaṃ paṭicca nahetu noāsavo dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[5003]='*15. Nahetuṃ nasāsavaṃ dhammaṃ paṭicca nahetu sāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5004]='*Nahetuṃ  naanāsavaṃ dhammaṃ paccayā hetu anāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5005]='*16. Nanahetuṃ naāsavasampayuttaṃ dhammaṃ paṭicca nahetu āsavasampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5006]='*Nahetuṃ naāsavavippayuttaṃ dhammaṃ paṭicca hetu āsavavippayutto dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[5007]='*17. Nahetuṃ naāsavañceva naanāsavañca dhammaṃ paṭicca hetu āsavo ceva sāsavo ca dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[5008]='*Nahetuṃ naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca nahetu sāsavo ceva no ca āsavo dhammo uppajjati hetupaccayā… hetuyā  pañca.*';
P_HTM[5009]='*18. Nahetuṃ  naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca hetu āsavo ceva āsavasampayutto ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5010]='*Nahetuṃ naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca nahetu āsavasampayutto ceva no ca āsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5011]='*19. Nahetuṃ āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca nahetu āsavavippayutto sāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5012]='*Nahetuṃ āsavavippayuttaṃ naanāsavaṃ dhammaṃ paccayā hetu āsavavippayutto anāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5013]='*1-19. Hetuduka-saññojanādigocchakāni*';
P_HTM[5014]='*20. Nahetuṃ  nosaññojanaṃ dhammaṃ paṭicca hetu saññojano dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5015]='*21. Nahetuṃ noganthaṃ dhammaṃ paṭicca hetu gantho dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[5016]='*22. Nahetuṃ nooghaṃ dhammaṃ paṭicca hetu ogho dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[5017]='*23. Nahetuṃ noyogaṃ dhammaṃ paṭicca hetu yogo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[5018]='*24. Nahetuṃ nonīvaraṇaṃ dhammaṃ paṭicca hetu nīvaraṇo dhammo uppajjati hetupaccayā… hetuyā  tīṇi.*';
P_HTM[5019]='*25. Nahetuṃ noparāmāsaṃ dhammaṃ paṭicca nahetu parāmāso dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5020]='*1-54. Hetuduka-mahantaradukaṃ*';
P_HTM[5021]='*26. Nahetuṃ  nasārammaṇaṃ dhammaṃ paṭicca hetu sārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5022]='*Nahetuṃ naanārammaṇaṃ dhammaṃ paṭicca nahetu anārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5023]='*27. Nahetuṃ nocittaṃ dhammaṃ paṭicca nahetu citto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5024]='*Nahetuṃ nanocittaṃ dhammaṃ paṭicca hetu nocitto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5025]='*28. Nahetuṃ  nacetasikaṃ dhammaṃ paṭicca hetu cetasiko dhammo uppajjati hetupaccayā… hetuyā  tīṇi.*';
P_HTM[5026]='*Nahetuṃ naacetasikaṃ dhammaṃ paṭicca nahetu acetasiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5027]='*29. Nahetuṃ nacittasampayuttaṃ dhammaṃ paṭicca hetu cittasampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5028]='*Nahetuṃ nacittavippayuttaṃ dhammaṃ paṭicca nahetu cittavippayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5029]='*30. Nahetuṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca hetu cittasaṃsaṭṭho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5030]='*Nahetuṃ nacittavisaṃsaṭṭhaṃ dhammaṃ paṭicca nahetu cittavisaṃsaṭṭho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5031]='*31. Nahetuṃ nocittasamuṭṭhānaṃ dhammaṃ paṭicca hetu cittasamuṭṭhāno  dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5032]='*Nahetuṃ nanocittasamuṭṭhānaṃ dhammaṃ paṭicca hetu nocittasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5033]='*32. Nahetuṃ  nocittasahabhuṃ dhammaṃ paṭicca hetu cittasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5034]='*Nahetuṃ nanocittasahabhuṃ dhammaṃ paṭicca nahetu nocittasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5035]='*33. Nahetuṃ nacittānuparivattiṃ dhammaṃ paṭicca hetu cittānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5036]='*Nahetuṃ  nanocittānuparivattiṃ dhammaṃ paṭicca nahetu nocittānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5037]='*34. Nahetuṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca hetu cittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5038]='*Nahetuṃ  nanocittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5039]='*35. Nahetuṃ nocittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca hetu cittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5040]='*Nahetuṃ nanocittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5041]='*36. Nahetuṃ nocittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca hetu cittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5042]='*Nahetuṃ nanocittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5043]='*37. Nahetuṃ  naajjhattikaṃ dhammaṃ paṭicca nahetu ajjhattiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5044]='*Nahetuṃ  nabāhiraṃ dhammaṃ paṭicca hetu bāhiro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5045]='*38. Nahetuṃ naupādā dhammaṃ paṭicca nahetu upādā dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5046]='*Nahetuṃ nanoupādā dhammaṃ paṭicca hetu noupādā dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5047]='*39. Nahetuṃ  naanupādinnaṃ dhammaṃ paṭicca nahetu anupādinno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5048]='*1-68. Hetuduka-upādānagocchakaṃ*';
P_HTM[5049]='*40. Nahetuṃ naupādānaṃ dhammaṃ paṭicca hetu upādāno dhammo  uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[5050]='*1-74. Hetuduka-kilesagocchakaṃ*';
P_HTM[5051]='*41. Nahetuṃ nakilesaṃ dhammaṃ paṭicca hetu kileso dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5052]='*1-82. Hetuduka-piṭṭhidukaṃ*';
P_HTM[5053]='*42. Nahetuṃ nadassanena pahātabbaṃ dhammaṃ paccayā hetu dassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5054]='*Nahetuṃ nanadassanena pahātabbaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5055]='*43. Nahetuṃ nabhāvanāya pahātabbaṃ dhammaṃ paccayā hetu bhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5056]='*Nahetuṃ nanabhāvanāya pahātabbaṃ dhammaṃ paṭicca nahetu nabhāvanāya  pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5057]='*44. Nanahetuṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca nahetu dassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā ekaṃ.*';
P_HTM[5058]='*Nahetuṃ  nanadassanena pahātabbahetukaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5059]='*45. Nanahetuṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu bhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā ekaṃ.*';
P_HTM[5060]='*Nahetuṃ nanabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5061]='*46. Nahetuṃ nasavitakkaṃ dhammaṃ paṭicca hetu savitakko dhammo uppajjati hetupaccayā… hetuyā  tīṇi. (Sabbattha saṃkhittaṃ.)*';
P_HTM[5062]='*47. Nahetuṃ nasaraṇaṃ dhammaṃ paccayā hetu saraṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5063]='*Nahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu araṇo dhammo uppajjati hetupaccayā. Nanahetuṃ naaraṇaṃ dhammaṃ paṭicca nahetu araṇo dhammo uppajjati hetupaccayā. Nahetuṃ naaraṇañca nanahetuṃ naaraṇañca dhammaṃ paṭicca nahetu araṇo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[5064]='*2-1. Sahetukādidukāni-hetudukaṃ*';
P_HTM[5065]='*48. Nasahetukaṃ nahetuṃ dhammaṃ paṭicca sahetuko hetu dhammo uppajjati hetupaccayā. Naahetukaṃ nahetuṃ dhammaṃ paṭicca sahetuko hetu dhammo uppajjati hetupaccayā. Nasahetukaṃ nahetuñca naahetukaṃ nahetuñca dhammaṃ paṭicca sahetuko hetu dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[5066]='*Nasahetukaṃ  nanahetuṃ dhammaṃ paṭicca sahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[5067]='*Naahetukaṃ  nanahetuṃ dhammaṃ paṭicca ahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi. Hetuyā cha.*';
P_HTM[5068]='*49. Nahetusampayuttaṃ nahetuṃ dhammaṃ paṭicca hetusampayutto hetu dhammo uppajjati hetupaccayā… tīṇi. (Sahetukadukasadisaṃ.)*';
P_HTM[5069]='*50. Nahetuñceva  naahetukaṃ nahetuṃ dhammaṃ paṭicca hetu ceva sahetuko ca hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5070]='*Naahetukañceva nana ca hetuṃ nanahetuṃ dhammaṃ paṭicca sahetuko ceva na ca hetu nahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5071]='*51. Nahetuñceva nahetuvippayuttañca nahetuṃ dhammaṃ paṭicca hetu ceva hetusampayutto ca hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5072]='*Nahetuvippayuttañceva nanahetuñca nanahetuṃ dhammaṃ paṭicca hetusampayutto ceva na ca hetu nahetu dhammo uppajjati hetupaccayā. Hetuyā  ekaṃ. (Antimadukaṃ na labbhati.)*';
P_HTM[5073]='*7-13-1. Cūḷantaradukāni-hetudukaṃ*';
P_HTM[5074]='*52. Naappaccayaṃ nahetuṃ dhammaṃ paṭicca sappaccayo hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5075]='*Naappaccayaṃ nanahetuṃ dhammaṃ paṭicca sappaccayo nahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Saṅkhataṃ sappaccayasadisaṃ.)*';
P_HTM[5076]='*53. Nasanidassanaṃ nahetuṃ dhammaṃ paṭicca anidassano hetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5077]='*Nasanidassanaṃ nanahetuṃ dhammaṃ paṭicca sanidassano nahetu dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[5078]='*54. Nasappaṭighaṃ  nahetuṃ dhammaṃ paṭicca appaṭigho hetu dhammo uppajjati hetupaccayā. Hetuyā  ekaṃ.*';
P_HTM[5079]='*Nasappaṭighaṃ nanahetuṃ dhammaṃ paṭicca sappaṭigho nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5080]='*55. Narūpiṃ nahetuṃ dhammaṃ paṭicca arūpī hetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5081]='*Narūpiṃ  nanahetuṃ dhammaṃ paṭicca arūpī nahetu dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[5082]='*56. Nalokiyaṃ nahetuṃ dhammaṃ paṭicca lokuttaro hetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[5083]='*Nalokuttaraṃ nahetuṃ dhammaṃ paṭicca lokiyo hetu dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā dve.*';
P_HTM[5084]='*Nalokiyaṃ nanahetuṃ dhammaṃ paṭicca lokiyo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[5085]='*Nalokuttaraṃ nanahetuṃ dhammaṃ paṭicca lokiyo nahetu dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā cattāri.*';
P_HTM[5086]='*57. Nakenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca kenaci viññeyyo hetu dhammo uppajjati hetupaccayā… hetuyā  nava.*';
P_HTM[5087]='*Nakenaci naviññeyyaṃ nanahetuṃ dhammaṃ paṭicca kenaci naviññeyyo nahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[5088]='*14-1. Āsavagocchaka-hetudukaṃ*';
P_HTM[5089]='*58. Noāsavaṃ nahetuṃ dhammaṃ paṭicca āsavo hetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[5090]='*Nanoāsavaṃ  nahetuṃ dhammaṃ paṭicca āsavo hetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[5091]='*Noāsavaṃ nahetuñca nanoāsavaṃ nahetuñca dhammaṃ paṭicca āsavo hetu dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[5092]='*Noāsavaṃ nanahetuṃ dhammaṃ paṭicca noāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[5093]='*Nanoāsavaṃ nanahetuṃ dhammaṃ paṭicca noāsavo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[5094]='*Noāsavaṃ  nanahetuñca nanoāsavaṃ nanahetuñca dhammaṃ paṭicca noāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[5095]='*55-1. Mahantaraduka-hetudukaṃ*';
P_HTM[5096]='*59. Nasārammaṇaṃ nahetuṃ dhammaṃ paṭicca sārammaṇo hetu dhammo uppajjati hetupaccayā… hetuyā  tīṇi.*';
P_HTM[5097]='*Naanārammaṇaṃ nanahetuṃ dhammaṃ paṭicca sārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Saṃkhittaṃ.)*';
P_HTM[5098]='*100-1. Saraṇaduka-hetudukaṃ*';
P_HTM[5099]='*60. Nasaraṇaṃ nahetuṃ dhammaṃ paṭicca araṇo hetu dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetuṃ dhammaṃ paṭicca saraṇo hetu dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5100]='*Nasaraṇaṃ nanahetuṃ dhammaṃ paṭicca araṇo nahetu dhammo uppajjati hetupaccayā. (1)*';
P_HTM[5101]='*Naaraṇaṃ nanahetuṃ dhammaṃ paṭicca araṇo nahetu dhammo uppajjati hetupaccayā. Naaraṇaṃ nanahetuṃ dhammaṃ paṭicca saraṇo nahetu dhammo uppajjati hetupaccayā. Naaraṇaṃ nanahetuṃ dhammaṃ paṭicca saraṇo nahetu ca araṇo nahetu ca dhammā uppajjanti hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[5102]='*100-2. Saraṇaduka-sahetukadukaṃ*';
P_HTM[5103]='*61. Nasaraṇaṃ  nasahetukaṃ dhammaṃ paṭicca araṇo sahetuko dhammo uppajjati hetupaccayā. Naaraṇaṃ nasahetukaṃ dhammaṃ paṭicca saraṇo sahetuko dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5104]='*62. Nasaraṇaṃ naahetukaṃ dhammaṃ paṭicca araṇo ahetuko dhammo  uppajjati hetupaccayā. Naaraṇaṃ naahetukaṃ dhammaṃ paṭicca araṇo ahetuko dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5105]='*100-3. Saraṇaduka-hetusampayuttadukaṃ*';
P_HTM[5106]='*63. Nasaraṇaṃ  nahetusampayuttaṃ dhammaṃ paṭicca araṇo hetusampayutto dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetusampayuttaṃ dhammaṃ paṭicca saraṇo hetusampayutto dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5107]='*64. Nasaraṇaṃ nahetuvippayuttaṃ dhammaṃ paṭicca araṇo hetuvippayutto dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetuvippayuttaṃ dhammaṃ paṭicca araṇo hetuvippayutto dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5108]='*100-4. Saraṇaduka-hetusahetukadukādi*';
P_HTM[5109]='*65. Nasaraṇaṃ nahetuñceva naahetukañca dhammaṃ paṭicca araṇo hetu ceva sahetuko ca dhammo uppajjati hetupaccayā. Naaraṇaṃ nahetuñceva naahetukañca dhammaṃ paṭicca saraṇo hetu ceva sahetuko ca dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5110]='*Nasaraṇaṃ naahetukañceva nanahetuñca dhammaṃ paṭicca araṇo sahetuko ceva na ca hetu dhammo uppajjati hetupaccayā. Naaraṇaṃ naahetukañceva nanahetuñca dhammaṃ paṭicca saraṇo sahetuko ceva na ca hetu dhammo uppajjati hetupaccayā. Hetuyā  dve. (Hetuhetusampayuttadukaṃ saṃkhittaṃ.)*';
P_HTM[5111]='*100-6. Saraṇaduka-nahetusahetukadukaṃ*';
P_HTM[5112]='*66. Nasaraṇaṃ  nahetuṃ nasahetukaṃ dhammaṃ paṭicca araṇo nahetu sahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5113]='*Nasaraṇaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca araṇo nahetu ahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[5114]='*Naaraṇaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca araṇo nahetu ahetuko dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā dve.*';
P_HTM[5115]='*100-7. Saraṇaduka-cūḷantaradukaṃ*';
P_HTM[5116]='*67. Nasaraṇo  nasappaccayo dhammo araṇassa sappaccayassa dhammassa ārammaṇapaccayena paccayo. Ārammaṇe ekaṃ.*';
P_HTM[5117]='*68. Nasaraṇo nasaṅkhato dhammo… (saṃkhittaṃ).*';
P_HTM[5118]='*69. Nasaraṇaṃ nasanidassanaṃ dhammaṃ paṭicca araṇo sanidassano dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5119]='*Nasaraṇo naanidassano dhammo saraṇassa anidassanassa dhammassa ārammaṇapaccayena paccayo. Nasaraṇo naanidassano dhammo araṇassa anidassanassa dhammassa ārammaṇapaccayena paccayo. Ārammaṇe dve.*';
P_HTM[5120]='*70. Nasaraṇaṃ  nasappaṭighaṃ dhammaṃ paṭicca araṇo sappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[5121]='*71. Nasaraṇaṃ narūpiṃ dhammaṃ paṭicca araṇo rūpī dhammo uppajjati hetupaccayā. Naaraṇaṃ narūpiṃ dhammaṃ paṭicca araṇo rūpī dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5122]='*Nasaraṇaṃ naarūpiṃ dhammaṃ paccayā saraṇo arūpī dhammo uppajjati hetupaccayā. Nasaraṇaṃ naarūpiṃ dhammaṃ paccayā araṇo arūpī dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5123]='*72. Nasaraṇaṃ  nalokiyaṃ dhammaṃ paṭicca araṇo lokiyo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5124]='*Nasaraṇaṃ nalokuttaraṃ dhammaṃ paccayā araṇo lokuttaro dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5125]='*73. Nasaraṇaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca araṇo kenaci viññeyyo  dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[5126]='*Nasaraṇaṃ nakenaci naviññeyyaṃ dhammaṃ paṭicca araṇo kenaci naviññeyyo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[5127]='*100-14-54. Saraṇaduka-āsavagocchakādi*';
P_HTM[5128]='*74. Naaraṇaṃ  naāsavaṃ dhammaṃ paṭicca saraṇo āsavo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5129]='*75. Naaraṇaṃ nasaññojanaṃ dhammaṃ paṭicca saraṇo saññojano dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5130]='*76. Naaraṇaṃ naganthaṃ dhammaṃ paṭicca saraṇo gantho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5131]='*77. Naaraṇaṃ naoghaṃ dhammaṃ paṭicca saraṇo ogho dhammo uppajjati hetupaccayā. Hetuyā  ekaṃ.*';
P_HTM[5132]='*78. Naaraṇaṃ noyogaṃ dhammaṃ paṭicca saraṇo yogo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5133]='*79. Naaraṇaṃ nanīvaraṇaṃ dhammaṃ paṭicca saraṇo nīvaraṇo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5134]='*80. Naaraṇaṃ naparāmāsaṃ dhammaṃ paṭicca saraṇo parāmāso dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5135]='*100-55-82. Saraṇaduka-mahantaradukādi*';
P_HTM[5136]='*81. Nasaraṇaṃ  nasārammaṇaṃ dhammaṃ paṭicca araṇo sārammaṇo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5137]='*Nasaraṇaṃ naanārammaṇaṃ dhammaṃ paṭicca araṇo anārammaṇo dhammo uppajjati hetupaccayā. Naaraṇaṃ naanārammaṇaṃ dhammaṃ paṭicca araṇo anārammaṇo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5138]='*82. Nasaraṇaṃ  nacittaṃ dhammaṃ paṭicca araṇo citto dhammo uppajjati hetupaccayā. Naaraṇaṃ nacittaṃ dhammaṃ paṭicca saraṇo citto dhammo uppajjati hetupaccayā. Hetuyā dve. (Saṃkhittaṃ.)*';
P_HTM[5139]='*83. Nasaraṇaṃ  nacetasikaṃ dhammaṃ paṭicca araṇo cetasiko dhammo uppajjati hetupaccayā. Naaraṇaṃ nacetasikaṃ dhammaṃ paṭicca saraṇo cetasiko dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5140]='*84. Nasaraṇaṃ nacittasampayuttaṃ dhammaṃ paṭicca araṇo cittasampayutto dhammo uppajjati hetupaccayā. Naaraṇaṃ nacittasampayuttaṃ dhammaṃ paṭicca saraṇo cittasampayutto dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5141]='*85. Nasaraṇaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca araṇo cittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Naaraṇaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca saraṇo cittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[5142]='*100-83. Saraṇaduka-piṭṭhidukaṃ*';
P_HTM[5143]='*86. Nasaraṇaṃ nadassanena pahātabbaṃ dhammaṃ paṭicca saraṇo dassanena pahātabbo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5144]='*Naaraṇaṃ nanadassanena pahātabbaṃ dhammaṃ paṭicca araṇo nadassanena pahātabbo dhammo uppajjati hetupaccayā. Hetuyā  ekaṃ. (Saṃkhittaṃ.)*';
P_HTM[5145]='*87. Nasaraṇaṃ  nasauttaraṃ dhammaṃ paṭicca araṇo sauttaro dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[5146]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[5147]='*Pañhāvāro*';
P_HTM[5148]='*Hetu-ārammaṇapaccayā*';
P_HTM[5149]='*88. Nasaraṇo nasauttaro dhammo araṇassa sauttarassa dhammassa hetupaccayena paccayo. Ekaṃ.*';
P_HTM[5150]='*Nasaraṇo nasauttaro dhammo araṇassa sauttarassa dhammassa ārammaṇapaccayena paccayo. Ekaṃ. Hetuyā ekaṃ.*';
P_HTM[5151]='*Paccanīyuddhāro*';
P_HTM[5152]='*89. Nasaraṇo  nasauttaro dhammo araṇassa sauttarassa dhammassa ārammaṇapaccayena paccayo… sahajātapaccayena paccayo… upanissayapaccayena paccayo… pacchājātapaccayena paccayo… (saṃkhittaṃ.) Nahetuyā  ekaṃ, naārammaṇe ekaṃ.*';
P_HTM[5153]='*Hetupaccayā naārammaṇe ekaṃ. (Saṃkhittaṃ.)*';
P_HTM[5154]='*Nahetupaccayā ārammaṇe ekaṃ. (Saṃkhittaṃ.)*';
P_HTM[5155]='*(Yathā kusalattike pañhāvāraṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[5156]='*Anuttarapadaṃ*';
P_HTM[5157]='*Hetu-anantarapaccayā*';
P_HTM[5158]='*90. Nasaraṇaṃ naanuttaraṃ dhammaṃ paccayā araṇo anuttaro dhammo uppajjati hetupaccayā. Hetuyā ekaṃ…pe… avigate ekaṃ.*';
P_HTM[5159]='*91. Nasaraṇo  naanuttaro dhammo araṇassa anuttarassa dhammassa anantarapaccayena paccayo. Anantare ekaṃ, samanantare ekaṃ, upanissaye dve, purejāte ekaṃ, āsevane ekaṃ, vippayutte ekaṃ, atthiyā ekaṃ, natthiyā ekaṃ, vigate ekaṃ, avigate ekaṃ.*';
P_HTM[5160]='*Paccanīyuddhāro*';
P_HTM[5161]='*92. Nasaraṇo naanuttaro dhammo araṇassa anuttarassa dhammassa upanissayapaccayena paccayo… purejātapaccayena paccayo.*';
P_HTM[5162]='*Naaraṇo naanuttaro dhammo araṇassa anuttarassa dhammassa upanissayapaccayena paccayo. Nahetuyā dve, naārammaṇe dve…pe… naupanissaye ekaṃ, napurejāte dve…pe… noavigate dve.*';
P_HTM[5163]='*Upanissayapaccayā nahetuyā dve. (Saṃkhittaṃ.)*';
P_HTM[5164]='*Nahetupaccayā  upanissaye dve, purejāte ekaṃ…pe… atthiyā ekaṃ…pe… avigate ekaṃ. (Saṃkhittaṃ.)*';
P_HTM[5165]='*(Yathā kusalattike pañhāvāraṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[5166]='*Anulomadukatikapaṭṭhānato paṭṭhāya yāva pariyosānā tiṃsamattehi bhāṇavārehi paṭṭhānaṃ.*';
P_HTM[5167]='*Dhammapaccanīyānulome dukadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[5168]='*Paccanīyānulomapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[5169]='*Paṭṭhānapakaraṇaṃ niṭṭhitaṃ.*';
